'[ 먔🪽 ] ⴼє ѣƴđƴ ґѳʙѳⱀџϯƀ πʌѳχѳ ѳ ϯʙѳєӣ ʍѧϯⱀєџ ʜѳ ʙҁє ϯѧκџ ѳʜѧ ʜѧҁϯѳʌƀκѳ ѳπƴҁϯџʌѧҁƀ πѳđ πʌџʜϯƴҁ ѳϯ ʜѧɯџχ χƴєʙ ӌϯѳ ƴѫє ґѧҁџϯƀҁᴙ ѳϯ ʜѧҁ ʍƀӀ ʜє πѳϯєⱀπџʍ ϯѧκѳґѳ ѳϯʜѳɯєʜџᴙ κ ʜѧɯџʍ ӌʌєʜѧʍ πⱀџđєϯƀҁᴙ ʜѧκѧӡѧϯƀ єє.',
'[ 먔🪽 ] ⴼƴ ѫє πѳπⱀѳѣƴӣ ѳπⱀѳʙđѧϯƀ ҁʙѳѥ ʍѧϯƀ πѳκѧ єє ⱀѳϯ ʜє ӡѧπѳʌʜєʜ ʜѧɯєӣ κѳʜӌєӣ џʌџ ʍѳѫєɯƀ ʙҁϯѧϯƀ ʜѧ κѳʌєʜџ ӡѧ ʍєҁϯѳ ҁʙѳєӣ ʍѧϯєⱀџ џ πѳʌƴӌѧϯƀ ʙ ⱀѳϯ đѳχƴ κѳϯѳⱀѧᴙ єӣ ϯѧκ ʜєѳѣχѳđџʍѧ ʙєđƀ ѳʜѧ ʜƴѫđѧєϯƀҁᴙ ʙ ʜѧɯєӣ ҁπєⱀʍє κѧκ ʙ ʜѧⱀκѳϯџκє.',
'[ 먔🪽 ] ∏ѳ ѣⱀѧҁϯκџ ҁκѧѫџ ҁʙѳєӣ ʍѧϯєⱀџ ӌϯѳѣƀӀ ѳʜѧ ƴѫє πєⱀєҁϯѧʌѧ ƴ ʜѧҁ ҁѳҁѧϯƀ ʙєđƀ ʍƀӀ ϯѳѫє ʜє ʙєӌʜƀӀє ѧ ϯʙѳᴙ ʍѧϯƀ ⱀѧѣѳӌџӣ ʍєχѧʜџӡʍ κѳϯѳⱀѧᴙ ϯѳʌƀκѳ ҁπѳҁѳѣʜѧ ʙκѧӌџʙѧϯƀ ʙ ҁєѣᴙ ϯѳʜʜƀӀ ҁπєⱀʍƀӀ ѣƴđƀ ӌєʌѳʙєκѳʍ đѧӣ ʜѧʍ ѳϯđѳχʜƴϯƀ.',
'[ 먔🪽 ] Ҟѳґđѧ ϯʙѳᴙ ʍѧϯƀ ҁπƴҁϯџʌѧҁƀ ʜѧ ӡєʍʌѥ ƴ ʜєє ѣƀӀʌѧ ӡѧđѧʜџᴙ ҁπѧҁϯџ ʍџⱀ ʜѳ ʍєҁϯѳ ϶ϯѳґѳ ѳʜѧ ʜѧӌѧʌѧ ҁѳҁѧϯƀ χƴџ ʜѧπⱀѧʙѳ џ ʜѧʌєʙѳ ʜѳ ҁƴϯƀ ʙ ϯѳʍ ӌϯѳ ѳʜѧ џ ϯѧκ ҁπѧҁѧєϯ ʍџⱀ ϯєʍ ҁѧʍѻʍ ƴđʙѳʌєϯʙѳⱀᴙєϯ ʙҁєχ ʍƴѫӌџʜ ʜѧ ҁʙєϯџ ҁπѧҁџѣѳ ϯʙѳєӣ ʍѧʍє ɯʌѥχџ.',
'[ 먔🪽 ] ∏ѳ ҁƴϯџ ϯʙѳᴙ ʍѧʍѧɯѧ ʜєκӌєʍʜѧᴙ ɯʌѥχѧ κѳϯѳⱀѧᴙ ⱀєɯџʌѧ πѳѣʌѧϯѳʙѧϯƀ ʜѧ ⱀѧӣѳʜє ʜѳ ʍƀӀ єє ѳπƴҁϯџʌџ ʙ ɯκƴⱀƀӀ џӡ ӡѧ ʜѧґʌѳґѳ πѳʙєđєʜџᴙ џ ʍєҁϯѳ ѣʌѧϯѧʙҁϯʙѧ ϯʙѳᴙ ʍѧϯƀ ϯƴϯ ҁѳҁєϯ χƴџ ϶ϯѳ πⱀєκⱀѧҁʜѳ ҁκѧѫџ.',
'[ 먔🪽 ] ᛖƀӀ ӡѧґѳʙѳⱀџʌџ ϯʙѳѥ ʍѧϯƀ ʜѧ ҁѳҁѧʜџᴙ χƴєʙ џ ϯєπєⱀƀ ѳʜѧ џҁκʌѥӌєʜѧ ʙҁᴙκѳґѳ ҁʍƀӀҁʌѧ џ πⱀѳҁϯѳ ѣєӡ ѳҁϯѧʜѳʙκџ ҁѳҁєϯ χƴӣ ʍƀӀ πƀӀϯѧʌџҁƀ єє ѳҁϯѧʜѳʙџϯƀ ʜѳ đʌᴙ ҁєѣᴙ ѳʜѧ ⱀєɯџʌ ӌϯѳ ҁϯѧʜєϯ ʙєӌʜѳӣ ɯʍѧⱀѳӣ.',
'[ 먔🪽 ] ⴼє πƀӀϯѧӣҁᴙ ʜѧʍ ҁκѧӡѧϯƀ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ʜєʙџʜʜѧᴙ ѫєʜѱџʜѧ ʙєđƀ ʙҁє ʍƀӀ ӡʜѧєʍ ӌϯѳ ѳʜѧ đѧʙʜѳ πƴҁκѧєϯ ʙ ҁʙѳӣ ѧʜѧʌƀʜџκ πѳ 80 χƴєʙ ʙ đєʜƀ ʜѳ đѧѫє πѳҁʌє ϶ϯѳґѳ ϯƀӀ ҁӌџѧϯєɯƀ єє χѳⱀѳɯєӣ ʍѧʍѳӣ đѳʌѣѳєѣ.',
'[ 먔🪽 ] ∏ѳ ѻѧκϯƴ ϯʙѳᴙ ʍѧϯƀ ʜѧӌџʜѧʌѧ ҁʙѳѥ κѧⱀƀєⱀƴ πⱀѳҁϯџϯƴϯκџ ѳϯʌџӌʜѳ ҁѳҁѧʌѧ ϯѳʌƀκѳ ӡѧ đєʜƀґџ đѧʙѧʌѧ ʙ ѳӌκѳ πѳ ʌѥѣʙџ ʜѳ ʙⱀєʍєʜѧ ʍєʜᴙєϯƀҁᴙ џ ϯєπєⱀƀ ѳʜѧ đѧєϯ ʙ ѳӌκѳ џ ҁѳҁєϯ ѧʌκѧɯѧʍ πѳđ ӡѧѣѳⱀѳʍ ӡѧ ӌєκƴɯκƴ.',
'[ 먔🪽 ] Ϯʙѳѥ ʍѧϯƀ ʜєʙѳӡʍѳѫʜѳ ӡѧѣƀӀϯƀ ʙєđƀ κѧκ ʍƀӀ ʍѳѫєʍ ӡѧѣƀӀϯƀ ϯѧκѧƴѥ ɯѧʌѧʙƴ κѧκ ѳʜѧ ʍƀӀ ҁϯѧⱀѧʌџҁƀ πⱀєʙѳӡʙƀӀҁџϯƀ єє κѧκ ʍѳґʌџ ʜѳ ʙ џϯѳґє ѳʜѧ κѧκ єѣѧʌѧҁƀ ϯѧκ џ єѣєϯƀҁᴙ ʜƴ ӌϯѳ πѳєđѧʌϯƀ ҁƴđƀѣѧ ѣʌᴙđџ ƴ ʜєє ʜѧ πєⱀʙѳʍ ʍєҁϯє.',
'[ 먔🪽 ] ⴼƴ đѧʙѧӣ πѳđƴʍѧєʍ ӌϯѳ ѣƀӀ ѣƀӀʌѳ єҁʌџ ѣƀӀ ϯʙѳᴙ ʍѧϯƀ ѣƀӀʌѧ πⱀџʌџӌʜѳӣ ѫєʜѱџʜѳӣ ѧ ʜє đѧʙѧʌκѳӣ єѣѧʜʜѳӣ ʜѧʙєⱀʜѳ ʍƀӀ ѣƀӀ џ ʜє πѳӡʜѧκѳʍџʌџҁƀ ʜѳ ʙѳʌєӣ ҁʌƴӌѧєӣ ѳʜѧ đѧʌѧ ʜѧʍ ʙ ѫѳπƴ πѳ 150 ⱀѧӡ κѧѫđѳʍƴ ʜєπʌѳχѳ đѧ.',
'[ 먔🪽 ] ∏ѳ κѧκџʍ πⱀџџʜѧʍ ϯʙѳᴙ ʍѧʍѧɯѧ ҁϯѧʌѳ ɯʌѥχѳӣ ϯѧκ κѧκ ѳʜѧ ʜѧӌѧʌѧ πⱀџʜџʍѧϯƀ πѳ ʍџʌџѳʜѳʙ ӌʌєʜѳʙ ʙ đєʜƀ ʍƀӀ πⱀѳӡʙѧʌџ єє єѣѧʜʜѧᴙ đѧʙѧʌκѧ ϯєπєⱀƀ ҁѧʍ πѳđƴʍѧӣ πѳӌєʍƴ ϶ϯѳ ѣᴙʌđџʜѧ πѧʌѧ ʙ ʜѧɯџχ ґʌѧӡѧχ.',
'[ 먔🪽 ] ⴼƴ ѫє đѧʙѧӣ πʌєӡ πѳҁѳҁџ ϯƴϯ ϯѧκ ʍƀӀ ґʙѳѳⱀџʌџ ϯʙѳєӣ ʍϯѧєⱀџ κѧѫđӣ đєʜƀ џ ѳʜѧ ҁѳҁѧʌѧ κѧκ ѣєɯєʜʜѧᴙ πⱀѳҁϯѳ џӡ ӡѧ ѳѣєѱѧʜџӣ ӌϯѳ ʍƀӀ єӣ κƴπџʍ đѳɯџⱀѧκ ʜѳ κѧκ ϯƀӀ ʍѳґ πѳʜᴙϯƀ ʍƀӀ єӣ ϯѧκ ʜє ӌєґѳ џ ʜє κƴπџʌџ.',
'[ 먔🪽 ] ⴼє κѧκ ʜє πѳӣʍƴ ϯʙѳᴙ ʍѧϯƀ πⱀџϯʙѳⱀᴙєϯƀҁᴙ џʌџ ѳʜѧ ʜѧ đєʌє ɯʌѥχѧđƴʍѧѥ ӌϯѳ єӣ ʜє ҁϯѳџϯ πⱀџҁƴϯҁϯʙѳʙѧϯƀ ʙ ʜѧɯєӣ ѫџӡʜџ ʜѳ ҁѳҁєϯ ѳʜѧ ʙєʌџκѳʌєπʜѧ ϯѳʌƀκѳ џӡ ӡѧ ϶ϯѳґѳ ʍƀӀ ʜє ҁѳѫґʌџ єє ʜѧ κҁѳϯⱀє κѧκ ʙєđƀʍƴ',
'[ 먔🪽 ] ∏ѳ πⱀџʜҵџπѧʍ ϯʙѳᴙ ʍѧϯƀ ʜє πѳʜџʍѧєϯ ʜѧʍєκѳʙ πѳ϶ϯѳʍƴ πⱀџχѳđџϯƀҁᴙ ϶ϯѳӣ ɯѧʌѧʙє ʙҁє ѳѣъєҁʜᴙϯƀ ʜѧ πⱀᴙʍƴѥ ϯѧκ ӌϯѳ πѳđχѳđџɯƀ κ ʜєӣ џ ґʙѳѳⱀџɯƀ πѳҁѳҁџ ѣʌᴙđџʜѧ ϯƴπѧᴙ џ ѳʜѧ ҁⱀѧӡƴ πⱀџʜџʍѧєϯƀҁᴙ ҁѳҁѧϯƀ џđєѧʌƀʜѳ đѧ.',
'[ 먔🪽 ] Ҟѳґđѧ ϯʙѳᴙ ʍѧϯƀ ʙƀӀχѳđџϯ ʜѧ ⱀџʜґ ʍєҁϯѳ ϯѳґѳ ӌϯѳѣƀӀ đⱀѧϯƀҁᴙ ѳʜѧ ҁϯᴙґџʙѧєϯ ҁ ѣѳκҁєⱀѳʙ ɯϯѧʜƀӀ џ πⱀџʜџʍѧєϯƀҁᴙ ҁѳҁѧϯƀ ʜє ѣƴđƴ đѳʌґѳ ʙʙєҁϯџ đџѧʌѳґ ʜѳ ϯʙѳᴙ ʍѧϯƀ ɯʌѥχѧ џ ʙҁє ʍƀӀ ϶ϯѳ πⱀєκⱀѧҁʜѳ ӡʜѧєʍ.',
'[ 먔🪽 ] ∏ѳ κѧӣѻƴ ϯʙѳᴙ ʍѧϯƀ ҁѳҁєϯ πѳκƴⱀџɯƀ κѳҁᴙκ џ ϯʙѳᴙ ʍѧϯƀ ʜѧӌџʜѧєϯ ҁѳҁѧϯƀ ʜѳ ϯѧκ ѧκ ʍƀӀ đѧѫє ʜє πѳʜџʍѧєʍ ӌϯѳ πⱀѳџҁχѳđџϯ ʍƀӀ ʜѧӌџʜѧєʍ єє πџӡđџϯƀ κѧκ πѳҁʌʜєđʜџѥ ɯѧʌѧʙƴ ʜѳ đѧѫє πѳҁʌє ϶ϯѳґѳ ѳʜѧ ʜє πєⱀєҁϯѧʙѧʌѧ ʜѧʍ ҁѳҁѧϯƀ.',
'[ 먔🪽 ] Δѧʙѧӣ ӡѧκѧӌѧєʍ ϯʙѳѥ ʍѧϯƀ ҁπєⱀʍƴ đƴʍѧєɯƀ ϶ϯѳ џӡʍєʜџϯ ϯѳ ӌϯѳ ѳʜѧ ɯʌѥχѧ ʜєϯ ʍʜє κѧѫєϯƀҁᴙ ϶ϯѳ đѧѫє đѳѣѧʙџϯ єӣ ҁϯџʍƴʌѧ ҁѳҁѧϯƀ đѧʌƀɯє џ ѳʜѧ πѳӣđєʍ πⱀѳπѧґѳʜđџⱀѳʙѧϯƀ џđєџџ ҁ ʙκѧӌєʜџєʍ ҁπєⱀʍƀӀ ʙ ӌєʌѳʙєκѧ.',
'[ 먔🪽 ] ⴼѧʜџӡѧʌ ϯʙѳѥ ʍѧϯƀ ʜѧ χƴӣ κѧκ ӌєⱀʙᴙκѧ џ ѳʜѧ đѧѫє ʜє ҁϯѧʌѧ ҁⱀƀӀʙѧϯҁƀᴙ ҁ ʜєґѳ ϯѧκ κѧκ πѳʜџʍѧʌѧ ӌϯѳ ʍѳӣ χƴӣ ϶ϯѳ ӌϯѳ ϯѳ ʙєʌџκѳє đʌᴙ ʜєє ϶ϯѳ ѣƀӀʌѧ κѧκ ⱀєʌџκʙџᴙ џ ѳʜѧ џӡ ӡѧ ʙєⱀƀӀ ʙ ʜєґѳ ʜє ʍѳґʌѧ ҁʌєӡϯƀ.',
'[ 먔🪽 ] đѧʙѧӣ ѱѧҁ ʙѳӡƀʍєʍ џ ʙƀӀєѣџʍ ϯʙѳѥ ʍѧϯƀ ϯєѣє ʙєđƀ ϯѳѫє ʜѧđѳєʌѧ ϶ϯѧ ɯѧʌѧʙѧ ѳʜѧ ƴѫє ʜє πѳʜџʍѧєϯ ӌϯѳ ϯʙѳⱀџϯ ѧ ʍєҁϯѳ ϯѳґѳ ӌϯѳ ѳđƴʍѧϯƀҁᴙ ѳʜѧ κѧκ ʙҁєґđѧ ӡѧѣџʙѧєϯ ҁʙѳџ ʍƀӀҁʌџ χƴᴙʍџ κѧκ ϯƀӀ єє ϯєⱀπџɯƀ.',
'[ 먔🪽 ] ⴼє κѧκ ʜє ʍѳґƴ πѳʜᴙϯƀ ӡѧӌєʍ ϯʙѳᴙ ʍѧʍѧ ҁϯѧʌѧ ɯʌѥχѳӣ ʙєđƀ ƴ ʜєє ѣƀӀʌ πѳϯєʜҵџѧʌ ʙƀӀƴӌџϯƀҁᴙ ʜѧ χѳⱀѳɯƴѥ ѧκϯⱀџҁƴ џʌџ πѳʙѧⱀѧ ʜѳ ʍєҁϯѳ϶ϯѳґѳ ѳʜѧ ϯєπєⱀƀ ґʌѳϯѧєϯ ʜѧ ϯєπʌѳϯⱀѧҁє ƴ ѣѳʍѫєӣ χƴџ ʜƴ ᴙ ʙ ɯѳκє.',
'[ 먔🪽 ] ⴼє ҁκⱀƀӀʙѧӣ πѳđπѳʌƀʜƀӀӣ ѣџӡʜєҁ ҁʙѳєӣ ʍϯѧєⱀџ ʙєđƀ ϯƀӀ ҁѧʍ πѳʜџʍѧєɯƀ ӌϯѳ ϯʙѳєӣ ʍѧʍѧɯє ʜє πѳʌƴӌџϯƀҁᴙ đѳʌґѳ ҁκⱀƀӀʙѧϯƀ єє ʙєđƀ ѳʜѧ ҁπѧʌџʌѧҁƀ ʜѧ ϯѳʍӌϯѳ κѳґđѧ ᴙ ҁπⱀҁѳџʌ ҁκѳʌƀκѳ ʙⱀєʍєʜџ ѳʜѧ ʜѧӌѧʌѧ ѳϯҁѧҁƀӀʙѧϯƀ ʍʜє.',
'[ 먔🪽 ] ⴼƴ ѫє đѧʙѧӣ ᴙ ѱѧҁ ϯʙѳѥ ʍѧϯƀ ɯѧʍѧⱀʜƴ ʍѳѫєϯ ѳʜѧ ʜѧκѳʜєҵϯѳ πѳƴʍʜєєϯ џʌџ đƴʍѧєɯƀ ϯѧκ ѫє ѣƴđєϯ ҁѳҁѧϯƀ χƴӣ đѧ ϯƀӀ πⱀѧʙ ѳʜѧ ʙєđƀ ʜє ʍѳѫєϯ џӡʍєʜᴙϯƀ ҁʙѳџ πⱀџʜҵџπѧʍ џ єӣ ѣƴđєϯ ϯᴙѫєʌѳ πєⱀҁϯѧϯƀ ҁѳҁѧϯƀ ʜѧʍ.',
'[ 먔🪽 ] Ϯʙѳᴙ ʍѧϯƀ πⱀѳҁϯџϯƴϯκѧ ʍʜє ѱѧҁ ӡѧ ҁџґѧⱀєϯƴ ѳϯđѧʌѧҁƀ џӡ ӡѧ ӌєґѳ ᴙ ʜѧӌѧʌ πџӡđџϯƀ єє ʜѳґѧʍџ ҁ κєʜϯѧʍџ đєɯєʙѧᴙ ɯʌѥχѧ ϶ϯѧ ѣᴙʌđџʜѧ đѧѫє πѳҁʌє џӡѣєʜџᴙ πⱀєđʌѧґѧʌѧ πѳҁѧҁѧϯƀ ʜѳ ʍƀӀ κѳⱀѳӌє єє ӡѧπџʜѧʌџ ʜѳ ҁѳҁѧʌѧ ѳʜѧ ʜѳⱀʍ.',
'[ 먔🪽 ] Ϯʙѳᴙ ʍѧϯƀ ҁѳҁєϯ ӡѧ џđєѥ κѳґđѧ ᴙ єє ҁπⱀѳҁџʌ κѧκѧᴙ ѫє ʙҁє ϯѧκџ ƴ ʜєє џđєᴙ ѳʜѧ ѳʙϯєӌѧʌѧ ӌϯѳ đѧѫє ʜє ʙ κƴⱀҁє ϶ϯѧ πџӡđѧѣѳʌκѧ πⱀѳҁϯѳ πⱀđƴʍѧʌѧ κѧκџє ϯѳ ʍѳϯџʙѧҵџџ đʌᴙ ҁѳҁѧʜџє ʜѳ ʜѧ đєʌє ѳʜѧ ɯʌѥχѧ єѣѧʜʜѧᴙ.',
'Δʌᴙ ϯєѣᴙ πѳđκџʜƴϯƀ ҁʙѳѥ ʍѧϯƀ ʜѧʍ πѳđ χƴџ ϯѳ ѫє ҁѧʍѳє ӌϯѳ ʙ ʍґѧӡџʜ ҁχѳđџϯƀ ϯƀӀ ϯѳѫє πѳƴđʍѧӣ ϯʙѳᴙ ʍѧϯƀ ɯѧʌѧʙѧ џ ϯѧκ ƴҁϯѧʌѧ ѳϯ πѳҁϯƴπѥѱџχ ʙ ʜєє χƴєʙ ѧ ϯƀӀ πⱀѳđѳʌѫѧєɯƀ ʜƴ ʙҁє ⱀѧʙʜѳ ҁπѧҁџѣѳ єχџđʜѳ ʍƀӀ єє ʙ ѳӌκѳ єѣєʍ.',
'[ 먔🪽 ] ᛖƀӀ ҁєґѳđʜᴙ ҁ ϯʙѳєӣ ʍѧʍѳӣ πⱀѳґƴʌџʙѧʌџҁƀ πⱀџɯʌѳҁƀ ʜѧđєϯƀ єӣ ʜѧʍѳⱀđʜџκ ʙєđƀ ᴙ ҁџʌƀʜѳ ⱀџҁκѳʙѧʌ πⱀѳχѳđᴙ πѳ ʍʜѳґѳӌџҁʌєʜʜƀӀʍџ πʌѳѱѧđᴙʍџ ѳʜѧ ʍѳґʌѧ ʙ ʌѥѣѳӣ ʍѳʍєʜϯ ҁѳⱀʙѧϯƀ џ ʜѧӌѧϯƀ ҁѳҁѧϯƀ χƴӣ ϯѧκ ӌϯѳ ʙ ҵєʌᴙχ ѣєӡѳπѧҁʜϯџ πєⱀєđ ʙƀӀχѳđѳʍ ᴙ єӣ đѧʌ ʙ ⱀѳϯ.',
'[ 먔🪽 ] Ҁєґѳđʜᴙ ϯʙѳᴙ ʍѧϯƀ ⱀєɯџʌѧ πѳҁϯѧʙџϯƀ ʜѧ κѳʜ ʙҁё џ ҁƀӀґⱀѧϯƀ ҁ ʜѧʍџ ʙ ⱀƴҁκƴѥ ⱀƴʌєκϯƴ єҁϯєҁϯʙєʜʜѳ κѳґđѧ ѳʜѧ πѳđʜєҁʌѧ πџҁϯѳʌєϯ κ ʙєҁκƴ πѳѣѳᴙʌѧҁƀ ҁϯⱀєʌᴙϯƀ ʜƴ ʍƀӀ πⱀѳҁϯѳ ϯѧκ ϶ϯѳґѳ ʜє ѳҁϯѧʙџʌџ џ єѣѧʌџ ӡѧ ϯѧκѳє ϯʙѳѥ ʍѧϯƀ đѳ ƴϯⱀѧ ʜє ʜƴ ҁκѧѫџ ϯƴπѧᴙ ɯʌѥχѧ.',
'[ 먔🪽 ] ⴼє ӡⱀᴙ ʍƀӀ ϯʙѳѥ ʍѧϯƀ ҁϯѳʌƀκѳ ʌєϯ đⱀєҁџⱀѳʙѧʌџ ʜѧ κѳʍѧʜđƴ ҁѳҁѧϯƀ κѳґđѧ ʍƀӀ χѳđџʍ πѳ ƴʌџҵѧʍ џ κⱀџӌџʍ ҁѳҁѧϯƀ ѳʜѧ πѳđѣєґѧєϯ κ ʌєʙѳʍƴ πѧҵѧʜƴ џ ʜѧӌџʜѧєϯ ҁϯᴙґџʙѧϯƀ ҁ ʜєґѳ ɯϯѧʜƀӀ џ đⱀѧџϯƀ ҁʙѳӣ ⱀѳϯ ϯʙѳєӣ ӡѧʌƴπѳӣ ϯʙѳᴙ ʍѧϯƀ ѳχƴєʜʜѧᴙ πҁџʜѧ.',
'[ 먔🪽 ] Ґѳʙѳⱀџʌ ҁ ϯʙѳєӣ ʍѧϯєⱀƀѥ ѳ єё ѳѣⱀѧӡє ѫџӡʜџ џ ӡʜѧєɯƀ ӌϯѳ ѳʜѧ ѳϯʙєϯџʌѧ ӌϯѳ єӣ ʙҁє ʜⱀѧʙџϯƀҁᴙ џ ʍєʜᴙϯƀ ѳʜѧ ʜџӌєґѳ ʜє χѳӌєϯ ʜє ʜƴ ѣʌᴙđѳʙκѧ єѣѧʜʜѧᴙ κѧκ ѳʜѧ ѫџϯƀ ϯѳ ѣƴđєϯ ᴙ ӡѧ ϯѧκѳє єӣ ӌєʌѥҁϯƀ χƴёʍ πⱀѳѣџʌ ϯƀӀ ѫє ʜє πⱀѳϯџʙ ʙѧѻʌєѫƴӣ єѣѧʜʜƀӀӣ.',
'[ 먔🪽 ] ∏ѳҁϯƴπџʌ πⱀџκѧӡ ʜєӣϯⱀѧʌџӡѳʙѧϯƀ ϯʙѳѥ ʍѧϯƀ ʙ ҵєʌѳʍ ʍƀӀ ƴѫє πѳʜᴙʌџ ӌϯѳ ʌџɯџʍҁᴙ ҁѧʍѳӣ ʌƴӌɯѳӣ ɯκƴⱀƀӀ ʜѧ ⱀѧӣѳʜє ʜѳ đєʌѧϯƀ ѣƀӀʌѳ ʜєӌєґѳ ʍƀӀ ʙӡᴙʌџ ѳⱀƴѫџє џ πѳɯʌџ ʜѳ κѳґđѧ ʍƀӀ ʙʌѳʍџʌџҁƀ κ ʜєӣ ʙ đѳʍ єє ƴѫє єѣѧʌџ 20 ӌєʌѳʙєκ ʍƀӀ ʜє ʍѳґʌџ πⱀєⱀʙѧϯƀ πⱀѳҵєҁ.',
'[ 먔🪽 ] Ҟѳґđѧ ᴙ ӡѧʜџʍѧʌҁᴙ ʜєκⱀѳʍѧʜϯџєӣ ᴙ πѳπƀӀϯѧʌҁᴙ ʙѳҁκⱀєҁџϯƀ ҁѧʍƴѥ ʌƴӌɯƴѥ πⱀѳҁϯџϯƴϯκƴ ʙҁєχ ʙⱀєʍєʜ џ ӡʜѧєɯƀ πѳʌƴӌџʌѳҁƀ ʙѳҁκⱀєҁџʌ ϯʙѳѥ ʍѧϯƀ ϯѧκ ʍєҁϯѳ ϯѳґѳ ӌϯѳѣƀӀ πѳӡđѳⱀѳʙѧϯƀҁᴙ ϶ϯѧ ɯѧѣѳʌđѧ ʜѧӌѧʌѧ ʍѳџʍ χƴєʍ ҁʙѳџ đєҁʜƀӀ πѧʌџⱀѳʙѧϯƀ.',
'[ 먔🪽 ] Ɓєӌєⱀѳʍ ϯʙѳᴙ ʍѧϯƀ ҁѳѣџⱀѧєϯ ʙҁєχ ҁʙѳџχ ʌѥѣѳʙʜџκѳʙ ƴ ҁєѣᴙ ʙ đѳʍє џ ⱀѧҁκѧӡƀӀʙѧєϯ κѧκ ƴ ʜєё πⱀѳɯєʌ đєʜƀ ʜѳ ӡʜѧєɯƀ ʜєχƴᴙ џʜϯєⱀєҁʜѳґѳ ѳʜѧ ϯѧκ ӡѧ ʙҁѥ ѫџӡʜƀ ʜє ⱀѧҁκѧӡѧʌѧ ʜѳ ӡѧϯѳ ʍƀӀ єѣёʍ єё πⱀᴙʍ ʙѳ ʙⱀєʍᴙ ⱀѧҁκѧӡѧ џ ϶ϯѳ ʙєҁєʌѳ.',
'[ 먔🪽 ] ϮƀӀ đƴʍѧєɯƀ πѳӌєʍƴ ϯʙѳᴙ ʍѧϯƀ ʜє ʜѧєđѧєϯƀҁᴙ ѳѣƀӀӌʜѳӣ єđѳӣ ϶ϯѳ ҁʍєɯʜѳ єє ʜє κѳґđѧ ʜє џʜϯєⱀєҁѳʙѧʌѧ єđѧ ѳʜѧ ʌѥѣџϯ ѫⱀѧϯƀ ϯѳʜʜѧʍџ ʜѧɯƴ ҁπєⱀʍƴ џ ѳϯ ϶ϯѳґѳ єӣ ҁϯѧʜѳʙџϯƀҁᴙ ʌєґӌє κѧκ ѳʜѧ ґѳʙѳⱀџϯ ʙҁє ѣѳʌєӡʜџ κѧκ ⱀƴκѳӣ ҁʜџʍѧєϯ.',
'[ 먔🪽 ] ∏єⱀʙƀӀӣ ⱀѧӡ ᴙ πѳӡʜѧκѳʍџʌҁᴙ ҁ ϯʙѳєӣ ʍѧϯєⱀƀѥ ҁѳʙєⱀɯєʜʜѳ ҁʌƴӌѧӣʜѳ πⱀѳҁϯѳ κѧκѧᴙ ϯѳ đєʙƴɯκѧ πѳđѣєѫѧʌѧ џ ʜѧӌѧʌѧ ʍʜє ҁѳҁѧϯƀ ʜѳ ʜѧ ϶ϯѳʍ ʙҁє ʜє κѳʜӌџʌѳҁƀ ѳʜѧ πѳπⱀѳҁџʌ ⱀѧӡѳⱀʙѧϯƀ єӣ ѧʜѧʌƀʜџκ ʙєҁєʌѧᴙ ʙҁϯⱀєӌѧ ᴙ đƴʍѧʌ ʜѳⱀʍ ',
'[ 먔🪽 ] ∏ѳ ƴϯⱀѧʍ ϯʙѳᴙ ʍѧϯƀ ѣєґѧєϯ ʙ ҁѳҁєđʜѥ đєⱀєʙʜѥ ӌϯѳѣƀӀ ӡѧπⱀѧʙџϯƀҁᴙ ҁπєⱀʍѧκѳʍ џ ӡʜѧєɯƀ ƴ ʜєё ϶ϯѳ ʜє ʙҁєґđѧ πѳʌƴӌѧєϯƀҁᴙ ϯѧκ ʍƴѫџκџ ʙ đєⱀєʙʜᴙχ ӡѧєѣѧʌџҁƀ ϯʙѳєӣ ʍѧʍκџ πⱀѳҁϯџϯƴϯκџ ƴѫє ʜѧ κʌƀӀκ κџđѧϯƀ џ ґѳʜᴙϯ єё ҁӌџϯѧᴙ ʙєđƀʍѳӣ.',
'[ 먔🪽 ] Ϯʙѳᴙ ʍѧϯƀ đѳ ϯѧκѳӣ ҁϯєπєʜџ ϯƴπѧᴙ ӌϯѳ ƴѫє ʜє ѳϯʌџӌѧєϯ χƴџ џ ʙєϯκџ κѧκ ϯѳ ⱀѧӡ ʙҁϯⱀєϯџʌџ ϶ϯƴ ѣʌᴙđџʜƴ κѳґđѧ ѳʜѧ ѳѣҁѧҁƀӀʙѧʌѧ ʙєϯκƴ ѳχƴєɯƀ đƴʍѥѧ ӡⱀᴙ ʍƀӀ ѣџʌџ κѧѫđƀӀӣ đєʜƀ ӡѧʌƴπѧʍџ πѳ ґѳʌѳʙє ʜѳ ʙҁє ϯѧκџ ʜєπʌѳχѳ ѳʜѧ ҁѳҁєϯ.',
'[ 먔🪽 ] Ϯʙѳᴙ ʍѧϯƀ ҁʌѳʙџʌѧ χѧӣπ ʜѧ ϯѳʍ ӌϯѳ πєⱀʙѧᴙ ʙ ҀҀҀƤ χѳđџʌѧ џ đѧʙѧʌѧ ʙ ѳӌκѳ ϯѳґđѧ ʙҁє πⱀᴙϯѧʌџƀ џ ҁєκҁѧ ʙѳʙҁє ʜє ѣƀӀʌѳ ѧ ϯƴϯ ϯʙѳᴙ ʍѧϯƀ πⱀᴙʍѳ ʜѧ πʌѳѱѧđᴙχ ґѳʙѳⱀџʌѧ ӌϯѳ ѳʜѧ πⱀѳҁϯџϯƴϯκѧ џ ӌϯѳѣƀӀ єё ʜѧκѳʜєҵϯѳ κϯѳ ϯѳ ʙƀӀєѣѧʌ.',
'[ 먔🪽 ] Ϯʙѳᴙ ʍѧϯƀ ⱀѧʜƀɯє ʌѥѣџʌѧ κƴⱀџϯƀ ʜѳ ⱀєɯџʌѧ ѣⱀѳҁџϯƀ џ πѳπⱀѳҁџʌѧ ʜѧҁ πѳʍѳӌƀ ϯѧκ ӌϯѳ κѳґđѧ ѳʜѧ ҁџʌƀʜѳ χѳӌєϯ κƴⱀџϯƀ ʍƀӀ πџχѧєʍ ӡѧʌπѳʍ єӣ χƴџ ʙ ⱀѳϯ џ ʙⱀѳđє πѳϯѳʍ ѳʜѧ ӡѧđƀӀχѧᴙҁƀ ѣʌѳґѧđѧⱀџϯ ʜѧҁ ӡѧ πѳʍѳѱƀ ʜѧʍ ʜє ҁʌѳѫʜѳ.',
'[ 먔🪽 ] ʜѧ πѧⱀѧđє ϯʙѳѥ ʍѧϯƀ єѣѧʌ κѳґđѧ ʙҁє κⱀѧҁџʙѳ ʍѧⱀɯєⱀѳʙѧʌџ ᴙ κⱀѧҁџʙѳ єё єѣѧʌ ѧ ӡʜѧєɯƀ κѧκ ᴙ ϶ϯѳ πѳʜᴙʌ ʙ κѳʜҵє πƴҁκѧʌџ ҁѧʌѥϯ ʙ ӌєҁϯƀ ʍѳєґѳ ӌʌєʜѧ',
'[ 먔🪽 ] ʍѧʍѧ ϯʙѳᴙ ɯʌѥχѧ ʍƀӀ ҁ ʜєӣ ӡʜѧκѳʍƀӀ ʜє πєⱀʙƀӀӣ ґѳđ πⱀєđҁϯѧʙƀ ҁκѳʌƀκѳ ѳʜѧ ʍʜє ҁѳҁєϯ  ƴѫє ҁѳ ҁӌєϯѧ ҁѣџʌҁᴙ',
'[ 먔🪽 ] ʜє κѧκ ѳҁϯѧʌƀʜƀӀє ϯʙѳᴙ ʍѧϯƀ ҁѳҁєϯ ѳʜѧ ʌџӌʜѳ ʍѳᴙ ⱀѧѣƀӀʜ κѳϯѳⱀѧᴙ ʜє πⱀџđѧєϯ ҁʙѳѥ ⱀѧѣѳϯƴ ʜє ѣƴđƀ κѧκ ѳʜѧ πѳҁѳҁџ ʍʜє',
'[ 먔🪽 ] ʜƴ ѣƴđєʍ ҁϯѳᴙϯƀ ӡѧ ϯʙѳѥ ʍѧϯƀ ʍƀӀ єє πⱀѳҁϯѳ ѳϯƀєѣєʍ đѧѫє ʜє πʌѧӌƀ πѳϯѳʍ џ ʜє ѣєґѧӣ ӡѧ ʜѧʍџ ʙєđƀ ϯʙѳᴙ ʍѧϯƀ πⱀѳđѧѫʜѧᴙ џ ҁѧʍѧ πѳđπџҁѧʌҁƀ ʜѧ ϶ϯѳ',
'[ 먔🪽 ] ʜє ⱀѧʜƀɯє ϯʙѳᴙ ʍѧϯƀ ʜѳⱀʍѧʌƀʜѳ ҁѳҁѧʌѧ ʜѳ ϯєπєⱀƀ ѳʜѧ џӡѣѧʙџʌѧҁƀ ѳϯ ϶ϯѳӣ πⱀџʙƀӀӌκџ џ κѧκ ɯѧʌѧʙѧ ϯƴϯ ҁѳҁєϯ đѧʙѧӣ ӡѧκѳʜӌџʍ ҁ ϶ϯџʍ',
'[ 먔🪽 ] ʜє ⱀѧʜƀɯє ϯʙѳѥ ʍѧϯƀ ʙ ϯⱀџ ѱєʌџ єѣѧʌџ ϯєπєⱀƀ ѳʜѧ χѳӌєϯ ѣѳʌƀɯє ʜє ʍѳѫєʍ ѳϯκѧӡѧϯƀ ϶ϯѳӣ ɯѧʌѧʙє џ ӡѳʙєʍ ϯѳʌπƀӀ ʜѧ єє πџӡđƴ',
'[ 먔🪽 ] ʜє ӡѧκѳʜӌџʌџ ҁ ϯʙѳєӣ ʍѧϯєⱀƀѥ đѧʙѧӣ ϯѧѱџ єє ҁѥđѧ џ ʜє πⱀѳѣƴӣ ʍʜє ϯƴϯ ѳκџʜƴϯƀҁᴙ ϯѧκ κѧκ ϯʙѳᴙ ʍѧϯƀ ɯʌѥχѧ ⱀѧӡґʙѳⱀ ҁ ʜєӣ κѳⱀѳϯκџӣ',
'[ 먔🪽 ] ʙʜѧϯƴⱀє ϯʙѳѥ πєӌєʜκƴ ϯƴϯ ʜѧ χƴӣ ʜѧʍѳϯѧʌ ʜє ƴʙєⱀєʜʜѳ ʍʜє ϯƴϯ ҁѳҁєɯƀ đƴⱀѧӌѳκ ѳπᴙϯƀ ϯєѣє ʜѧđѳ πєӌєʜκѳӣ πѳѫєⱀϯʙѳʙѧϯƀ',
'[ 먔🪽 ] ʜє ϯᴙѫєʌƀӀӣ ϶ϯѳ ϯⱀƴđ ϯʙѳѥ ʍѧϯƀ єѣѧϯƀ ʜѳ ӡѧʜџʍѧєϯ ʙⱀєʍᴙ ϯѧκ κѧκ ϯʙѳᴙ ʍѧϯƀ ʜєʜѧҁƀӀϯʜѧᴙ ɯʌѥχѧ ʜƴ ӌϯѳ πѳđєʌѧϯƀ ʍƀӀ πѳπⱀѳѣƴєʍ ƴđʙѳʌєϯʙѳⱀџϯƀ єє',
'[ 먔🪽 ] ʜє đѧʙѧӣ ӡѧʙѳđџ ƴѫє ҁʙѳѥ ʍѧϯƀ ѳʜѧ ѳπᴙϯƀ ʜѧ κѳʌєʜᴙχ πⱀџѣєѫџϯ џ ѣƴđєϯ πⱀѳҁџϯƀ πⱀѳѱєʜџᴙ ӡѧ ϯєѣᴙ ϯƀӀ đѧѫє ʜє ʍѳѫєɯƀ πѳʜᴙϯƀ ӌϯѳ ѳʜѧ đѧʙʜѳ πⱀѳđѧʌѧҁƀ ӡѧ κѳπєӣκџ',
'[ 먔🪽 ] ʍѧʍƴʌƀκƴ ϯʙѳѥ ʙʜѧϯƴⱀє ʜѧ ҁƴđє πѳđҁϯѧʙџʌ ʙҁє ґѳʙѳⱀџʌџ ӌϯѳ ѳʜѧ πѳⱀᴙđѳӌʜѧᴙ ѫєʜѱџʜѧ ʜѳ ᴙ џʍ πѳκѧӡѧʌ ʙџđєѳ ґđє єє ϯⱀѳє єѣѧʌџ ʙʜѧϯƴⱀє ѳⱀʜѧ',
'[ 먔🪽 ] κѧκ ʙєⱀϯѳʌєϯ ҁѧҁєɯƀ ʙʜѧϯƴⱀє ᴙ ϯєѣє πⱀѳπєʌєⱀѳʍ ʙʜѧƴϯⱀє ѱѧ ѧʜѧʌƀʜѳє ѳϯʙєⱀҁϯџє ʙӡѳⱀʙƴ',
'[ 먔🪽 ] ʍѧϯƀ ϯʙѳᴙ πѳđҁϯџʌκѧ ʙʜѧϯƴⱀє ϯƀӀ ӡʜѧєɯƀ ӌϯѳ ѳʜѧ ҁϯѳⱀѳѫƴ ӡѧ ӌєκƴɯκƴ đѧʌѧ ӡѧ ӡѧѣѳⱀѳʍ ѧ ϯƀӀ đƴʍѧʌ πⱀџʌџӌʜѧᴙ χє χє',
'[ 먔🪽 ] đѧʙѧӣ ϯʙѳѥ ʍѧϯƀ πѳєѣєʍ πⱀџґʌѧɯѧӣ єє ʜѧ ѣѧʌ χѳӌєɯƀ πѳҁҁѧϯƀ ʙʍєҁϯє ҁ ʜєӣ πⱀџχѳđџ ʜѳ ҁʜѧӌѧʌѧ πѳϯѧʜҵƴєʍ',
'[ 먔🪽 ] ʜє ѣƴđƀ đƴⱀѧκѳʍ πѳʙєⱀƀ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ɯʌѥχѧ ʙʜѧƴⱀє ϯƴϯ πѳґџѣʜєϯ џʌџ ϯƀӀ đƴʍѧєɯƀ ƴ ʜєє ѣƴđƴϯ ɯѧʜҁƀӀ ʙƀӀѫџϯƀ χє χє đƴⱀѧκ',
'[ 먔🪽 ] ϯʙѳє єѣѧʌѳ ʙʜѧϯƴⱀє ʙ ѣєϯѳʜ κѧϯʜƴʌ κѳґđѧ ϯƀӀ πѳɯєʌ πⱀѳϯџʙ ʍєʜᴙ ᴙ ϯєѣᴙ χƴєʍ ӌєχʌџʌ đƴⱀѧκ єґџ ѳϯ ҁѥđѧ',
'[ 먔🪽 ] ϯƀӀ ʜє ϯѧκѳӣ κѧκ ʙҁє πѳϯѳʍƴ ӌϯѳ ƴ ʙҁєχ ʍѧʍѧ ґѳϯѳʙџϯ κƴɯѧϯƀ ѧ ϯʙѳᴙ ʍѧʍѧ ʙʍєҁϯѳ єđƀӀ ʙѧʍ ʜѧ ƴѫџʜ ҁπєⱀʍѧӌ ʙⱀѧџϯ',
'[ 먔🪽 ] ʜє đѧʙѧӣ ѱѧҁ ʍƀӀ ҁ ϯѳѣѳӣ πѳӡʜѧκѳʍџʍҁᴙ џ ᴙ ҁϯѧʜƴ ϯʙѳџʍ ʜѳʙƀӀʍ ѳϯҵѳʍ χѳϯᴙ πѳ ҁƴϯџ ᴙ đѧʙʜѳ єѣƴ ϯʙѳѥ ʍѧϯƀ ϯѧκ ӌϯѳ ʜѧӡƀӀʙѧӣ ʍєʜᴙ ʙҁєʙƀӀɯʜџʍ',
'[ 먔🪽 ] ʜє ⱀџʌџ ϯƀӀ πⱀѳҁϯѳ πѳπʌѧϯџʌҁᴙ ҁʙѳєӣ ʍѧϯєⱀƀѥ ӡѧ ҁʙѳӣ ѣѧӡѧⱀ џʌџ ϯƀӀ đƴʍѧʌ ӌƴϯƀ ӌƴϯƀ πѳҁѳҁєɯƀ џ ҁѣєѫџɯƀ ʜєϯ ϯƀӀ ϯƴϯ ʜѧ ʙҁєґđѧ ѱєʜѳκ ӡѧʙџҁ',
'[ 먔🪽 ] ʜѧ ⱀƴʌєϯκє ϯʙѳѥ ʍѧϯƀ πѳєѣѧʌ κѳґđѧ ƴ ʙҁєχ џґⱀѳκѳʙ κѳʜӌџʌџҁƀ đєʜƀґџ κϯѳ ϯѳ πѳҁϯѧʙџʌ ϯʙѳѥ ʍѧϯƀ ʜƴ ᴙ єё џ ʙƀӀєѣѧʌ πѳ ϯџχѳʍƴ',
'[ 먔🪽 ] ʜѧ κѳⱀѧѣʌє ϯʙѳѥ ʍѧϯƀ єѣѧʌ πѳκѧ ʙҁє ʜƀӀκѧʌџ ѳϯ ɯϯѳⱀʍѧ ϯʙѳᴙ ʍѧϯƀ ҁπєҵџѧʌƀʜѳ ʙƀӀѣєґѧʌѧ ʜѧ πѧʌƴѣƴ џ ҁѳҁѧʌѧ ʍʜє χƴӣ κѧκ ʜєʜѳⱀʍѧʌƀʜѧᴙ',
'[ 먔🪽 ] ʜѧ ҁʙѧʌκє ϯʙѳѥ ʍѧϯƀ єѣѧʌ ϯƀӀ ҁπⱀѳҁџɯƀ κѧκ ᴙ ϯƴđѧ ӡѧɯёʌ ʙҁё πⱀѳҁϯѳ ᴙ χѳϯєʌ ʙƀӀѣⱀѳҁџϯƀ ʍƴҁѳⱀ ѧ ϯѧʍ ʌєѫѧʌѧ ϯʙѳᴙ ʍѧϯƀ ʜєπʌѳχѳ ϯѳґđѧ ʙƀӀєѣѧʌ єё',
'[ 먔🪽 ] ʜѧ ҁѳѣⱀѧʜџє ϯʙѳѥ ʍѧϯƀ πѳєѣѧʌ ʙҁє đƴʍѧʌџ ӌϯѳ ѳʜѧ πⱀџɯʌѧ ⱀѧӡѣџⱀѧϯƀҁᴙ ʜѳ ѳʜѧ ʙҁєґѳ ʌџɯƀ χѳϯєʌѧ ѳϯҁѳҁѧϯƀ ʍʜє χƴӣ',
'[ 먔🪽 ] ʜѧ ʙⱀѧϯѧχ ϯʙѳѥ ʍѧϯƀ πѳєѣѧʌ ѳʜѧ πƀӀϯѧʌѧҁƀ ʙѳⱀʙѧϯƀҁᴙ ʙ ӌƴѫƴѥ χѧϯƴ џ ҁʌѳʍѧϯƀ ʙѳⱀѳϯѧ ʜѳ ʍѳӣ χƴӣ ѳϯʙєⱀґ єё џ ѳʜѧ ѳϯѳɯʌѧ ҁ πѳⱀѧѫєʜџєʍ',
'[ 먔🪽 ] ʜѧ ʙєҁџʌџҵє ϯʙѳѥ ʍѧϯƀ πѳєѣѧʌ κѳґđѧ ϶ϯѧ đƴⱀѧ ӡѧχѳϯєʌѧ πѳʙєҁџϯƀҁᴙ ʍѳӣ χƴӣ ҁѧʍ єё πѳđʙєҁџʌ ʜѳ єӣ ѣƀӀʌѳ ʌєґӌє',
'[ 먔🪽 ] ʜѧ κⱀѧѥ ϯʙѳѥ ʍѧϯƀ єѣѧʌ ƴ ʜєё πⱀѳҁϯѳ ʜє ѣƀӀʌѳ ʙƀӀχѳđѧ ƴѣєѫѧϯƀ ѳϯ ʍѳєґѳ χƴᴙ ѳⱀƴ ѳʜѧ ϯѧκ џ ʜє πѳʜᴙʌѧ ӌϯѳ ѳϯ ʍѳєґѳ χƴᴙ ʜє ѳҁʙѳѣѳđџϯƀҁᴙ',
'[ 먔🪽 ] ᴙ ѫє χƴёʍ ϯʙѳӣ πџӡđѧκ πѳđʙєҁџʌ ʜѧ ʌѥҁϯⱀƴ ϯєπєⱀƀ ϯʙѳӣ ѣѧϯᴙ κѳґđѧ πⱀѳχѳđџϯ ⱀѧđƴєϯƀҁᴙ ӌϯѳ ϯєѣᴙ ʙƀӀєѣѧʌ ʜє κѧκѳӣ ϯѳ đѳʙⱀѳʙƀӀӣ πѧҵѧʜ ѧ ᴙ',
'[ 먔🪽 ] ʍѳѫєϯ ϯƀӀ ʍѳӣ χƴӣ ҁѣѧʌѧʜҁџⱀѳʙѧʜʜѳ ʜѧӌʜёɯƀ ҁѳҁѧϯƀ ѧ ϯѳ ӌё ϯƀӀ κѧκ ʌѧχ ӡѧ ѳđʜƴ ѱёκƴ πƴҁκѧєɯƀ đѧʙѧӣ πⱀєҁϯƴπѧӣ џʌџ ѳπᴙϯƀ ϯʙѳӣ ѣѧϯᴙ πⱀџđёϯ џ ѳϯҁѳҁёϯ ʍʜє',
'[ 먔🪽 ] ϯʙѳӣ ѣѧϯᴙ ʜƴʌёʙκѧ ʜє ӌєґѳ ʜє ʍѳѫєϯ ѣєӡ ʍѳєґѳ χƴᴙ ʙєđƀ ѳʜ ґѳʙѳⱀџϯ ӌϯѳ ϶ϯѳ єґѳ ҁʙєϯʌƀӀӣ ʌƴӌџκ ʙ ѣƴѱƴєє ʙѳϯ ϶ϯѳ ᴙ єʍƴ χƴёʍ ʍѳӡґџ ѳϯѣџʌ',
'[ 먔🪽 ] ʜє ʙєⱀƀ ҁʙѳєӣ ʍѧϯєⱀџ κѳґđѧ ѳʜѧ ґѳʙѳⱀџϯ ӌϯѳ ᴙ ϯєѣᴙ ʜє ⱀѧӡƴ ʜє єѣѧʌ ᴙ ϯᴙ єѱё ҁ ⱀѳѫđєʜџᴙ єѣѧʌ κⱀєʙєϯκѧ єѣƴӌѧᴙ',
'[ 먔🪽 ] єѱё ѳđʜѳ ҁʌѳʙѳ πⱀѳ ϯʙѳѥ ʍѧϯƀ ᴙ ϯєѣᴙ χƴёʍ ⱀѧҁϯєⱀӡѧѥ đƴⱀѧ ϯƀӀ єѣѧʜѧᴙ ʙєđƀ ϯʙѳᴙ ʍѧϯƀ џđєѧʌƀʜѧᴙ ɯѧʌѳʙѧ ʜє ѳѣџѫѧӣ єё',
'[ 먔🪽 ] ϯƀӀ ӡʜѧʌ ӌϯѳ ᴙ ϯᴙ χƴёʍ κⱀєҁϯџʌ ѧ ϯʙѳᴙ ʍѧϯƀ ƴʍƴđⱀџʌѧҁƀ đѧѫє ʙ ϯѧκѳӣ ѳϯʙєϯҁϯʙєʜƀӀӣ ʍѳʍєʜϯ ѳϯҁѳҁѧϯƀ ҁʙᴙѱєʜџκƴ',
'[ 먔🪽 ] ᴙ ϯєѣᴙ đѧѫє ʙ đєϯҁκѳʍ ҁѧđƴ єѣѧʌ κѳґđѧ ϯƀӀ đⱀѧʌҁᴙ ӡѧ ʍѧɯџʜκє џ πʌѧκѧʌ ӌϯѳ ϯєѣᴙ ʜє đѧʌџ ʍѧɯџʜκƴ κϯѳ ϯє χƴӣ ѳϯ ѳѣџđƀӀ ҁƴʙѧʌ',
'[ 먔🪽 ] ϯƀӀ ҁϯѧʌ πѳχѳѫџʍ ʜѧ ҁʙѳѥ ʍѧϯƀ ϯєѣє ƴѫє ϯѳѫє ʜє ʜƴѫʜѧ πⱀџӌџʜѧ ӌϯѳѣƀӀ ѳϯҁѳҁѧϯƀ ʍʜє χƴӣ ʜƴ єҁʌџ ϯѧκ ϯѳ ϯƀӀ ϯѳѫє đѳҁϯѳєʜ ӡʙѧʜџᴙ πđӡѳѣѳⱀʜѳӣ ɯʌѥχџ',
'[ 먔🪽 ] ʜє ʍѳґƴ πѳʙєⱀџϯƀ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ѳπᴙϯƀ ʙӡᴙʌѧҁƀ ӡѧ ҁϯѧⱀѳє џ πƀӀϯѧєϯƀҁᴙ ʙƀӀҁʌєđџϯƀ ʍѳӣ χƴӣ ʜƴ єҁʌџ ѳʜѧ πѳπѧđёϯƀҁᴙ ʍʜє ʜѧ ґʌѧӡѧ ᴙ єё χƴёʍ ʙ Ѧⱀѧχʜґєʌƀҁκ ɯʙƀӀⱀʜƴ',
'[ 먔🪽 ] ʜє đƴʍѧӣ ʜє ӌєґѳ πʌѳχѳґѳ ʜѳ ϯʙѳᴙ ʍѧϯƀ κѳҁʍѳʜѧʙϯ ᴙ ϯєѣє ʜє ʙⱀƴ ʜє ʙ κѳєʍ ҁʌƴӌѧє ѧ ӡʜѧєɯƀ ʜѧ ӌёʍ πⱀѳχѳđџʌ єё πєⱀʙƀӀӣ πѳʌёϯ ʜѧ ʍѳёʍ χƴє ѳⱀƴ',
'[ 먔🪽 ] ʍѳѫєϯ ᴙ ϯєѣᴙ ѳґѳⱀӌƴ ʜѳ ϯʙѳᴙ ʍѧϯƴɯκѧ ѱѧ ʍʜє χƴӣ ҁѳҁёϯ џ ӌϯѳ ϯѳ ѣѳⱀʍѳӌєϯ ϶ϯѳ ɯѧʌѳʙѧ ʍєʜᴙ ϯѧκ ӡѧєѣѧʌѧ ᴙ ѱѧ ʙҁπѳⱀѥ єё χƴёʍ πⱀџχѳđџ џ ӡѧѣџⱀѧӣ єё',
'[ 먔🪽 ] ʙҁё ʜє ϯѧκ πⱀѳҁϯѳ ƴ ϯʙѳєӣ ʍѧϯєⱀџ єҁϯƀ ҁϯџʍƴʌ ҁѳҁѧϯƀ ʍʜє χƴӣ ʙєđƀ ᴙ ҁκѧӡѧʌ єҁʌџ ѳʜѧ ѳҁϯѧʜѳʙџϯƀҁᴙ ϯѳ ϯʙѳӣ ґⱀᴙӡʜƀӀӣ ѣѧϯᴙ ƴʍⱀёϯ',
'[ 먔🪽 ] ϯʙѳᴙ ʍѧϯƀ ʜѧ ʍѳёʍ χƴє χџπ χѳπ ϯѧʜҵєʙѧʌѧ џ ҁƴđƀᴙ đѧʌџ єӣ πєⱀʙѳє ʍєҁϯѳ ʜѳ ʜє ӡѧ ϶ϯѳ ѧ ӡѧ ʙєʌџκѳʌєπʜƀӀӣ ѳϯҁѳҁ ʙ κѳʜҵє',
'[ 먔🪽 ] χѳӌєɯƀ ҁπѧҁϯџ ҁʙѳѥ ʍѧϯƀ џӡ ⱀѧѣҁϯѧʙѧ ʍѳєґѳ χƴᴙ πⱀџʜєҁџ єʍƴ πѳđʜѳɯєʜџᴙ ϯѳґđѧ ʍѳѫєϯ ѣƀӀϯƀ ʍѳӣ χƴӣ πⱀѳҁϯџϯ ϯʙѳѥ ʍѧϯƴχƴ',
'[ 먔🪽 ] ϯʙѳᴙ ʍѧϯƀ ƴѫє ѳϯѫџʌѧ ҁʙѳё ʜѧ ʍѳёʍ χƴѥ κѧκ џ ϯʙѳӣ ѳϯєҵ πⱀџɯʌѳ ϯʙѳё ʙⱀєʍᴙ πⱀƀӀґѧӣ ʜѧ χƴӣ џ πѳєχѧʌџ đƴⱀєʜƀ',
'[ 먔🪽 ] ϯʙѳᴙ ʍѧϯƀ ʍєҁϯѳ ϯѧѣʌєϯѳκ ѳϯ ґѳʌѳʙƀӀ ґʌѳϯѧєϯ ʍѳӣ χƴӣ ҁκѧѫєɯƀ ӌєʍ ϶ϯѳ πѳʍѳѫєϯ ҁπⱀѳҁџ ƴ ϶ϯѳӣ єѣƴᴙєӣ đƴⱀƀӀ',
'[ 먔🪽 ] ϯʙѳᴙ ʍѧϯƀ πƀӀϯѧʌѧҁƀ ʙƀӀʙєӡϯџ ʍѳӣ χƴӣ πѳ πѳʜᴙϯџᴙʍ ӌϯѳѣƀӀ ѳʜ ѣѳʌƀɯє єё ʜє ϯⱀѳґѧʌ ʜѳ ʍѳӣ χƴӣ ʜє ҁϯѧʌ єё ҁʌƴɯѧϯƀ џ ⱀѧҁёκ єӣ ѣⱀѳʙƀ',
'[ 먔🪽 ] ʍѳѫєϯ ϯƀӀ ѣƴđєɯƀ đƴʍѧϯƀ ӌϯѳ ᴙ πʌѳχѳӣ ʜѳ ᴙ đѳκѧѫƴ ѳѣⱀѧϯʜѳє єҁʌџ ѣƀӀ ᴙ ʜє єѣѧʌ ϯʙѳѥ ʍѧϯƀ єё ѣƀӀ єѣѧʌ ʙєҁƀ ґѳⱀѳđ џ ʙҁє ѣƀӀ ӡʜѧʌџ ӌϯѳ ѳʜѧ ɯѧʌѳʙѧ ѧ ϯѧκ ӡʜѧєʍ ϯѳʌƀκѳ ʍƀӀ',
'[ 먔🪽 ] ʍѳґƴ ѳѣⱀѧϯџϯƀҁᴙ ҁ πⱀѳҁƀѣѳӣ κ ϯʙѳєӣ ʍѧϯєⱀџ ϯƀӀ ҁπⱀѳҁџɯƀ κѧκѳӣ ʜƴ ϯƀӀ ӌё ʌѧχ ʜє πѳʜџʍѧєɯƀ ӌϯѳѣƀӀ ѳʜѧ ѳϯҁѧҁѧʌѧ ʍʜє',
'[ 먔🪽 ] ʜє κѧκѳӣ єѣѧʌ ϯʙѳᴙ ʍѧϯƀ κѳґđѧ ƴ ʍєʜᴙ ѣƀӀʌѧ ϯєʍπєⱀѧϯƴⱀѧ ⱀѳϯ ϯʙѳєӣ ʍѧϯєⱀџ ӡѧʍєʜᴙʌ ʍʜє ґⱀѧđƴҁʜџκ',
'[ 먔🪽 ] ʜѧ ҁπџʜє ϯʙѳᴙ ʍѧϯƀ ʜѧκѳʌѳʌѧ ʍѳӣ χƴӣ џ ϯєπєⱀƀ χʙѧҁϯѧєϯƀҁᴙ ʙҁєʍ ӌϯѳ ƴ ʜџχ ʜєϯ ѣѳʌєє ѳχƴєʜєє ϯѧϯƴџⱀѳʙκѳӣ ӌєʍ ƴ ʜєё',
'[ 먔🪽 ] ϯʙѳѥ ʍѧϯƀ ʙ ӡџʍƴ єѣѧʌ ϯѳґđѧ κѧκ ⱀѧӡ ѣƀӀʌ ѫєҁϯѳκѧᴙ ӡџʍѧ џ ʍʜє πⱀџɯʌѳҁƀ єѣѧϯƀ ϯʙѳѥ ʍѧϯƀ ӌϯѳѣƀӀ ҁѳґⱀєϯƀҁᴙ',
'[ 먔🪽 ] ʜѧ ʍѧɯџʜє ϯʙѳѥ ʍѧϯƀ єѣѧʌ ʙҁє ҁκѧѫƴϯ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ єѣƴӌѧᴙ ɯѧʌѳʙѧ κѳϯѳⱀѧᴙ ʙєđєϯƀҁᴙ ʜѧ ϯѧӌκџ ʜѳ ѳʜџ ѳɯџѣѧѥϯƀҁᴙ ѳʜѧ ʙєđёϯƀҁᴙ ʜѧ ʍѳӣ χƴӣ',
'[ 먔🪽 ] ʜѧ ʙџʌє ϯʙѳѥ ʍѧϯƀ єѣѧʌ џ ʍѳѫʜѳ ҁκѧӡѧϯƀ ӌϯѳ ʍƀӀ ʙѳⱀʙѧʌџҁƀ ϯƴđѧ ʜє ӡѧκѳʜʜѳ ѧ ӡʜѧєɯƀ πѳӌєʍƴ πѳϯѳʍƴ ӌϯѳ ϯʙѳєӣ ʍѧϯєⱀџ ӡѧχѳϯєʌѳҁƀ πѳҁѳҁѧϯƀ ʍѳӣ χƴӣ ϶κҁϯⱀєʍѧʌƀʜѳ',
'[ 먔🪽 ] ӡʜѧєɯƀ πѳӌєʍƴ ʍєʜᴙ ʙҁє πѧҵѧʜƀӀ ʜѧӡƀӀʙѧʌџ χƴʌџґѧʜѳʍ πѳϯѳʍƴ ӌϯѳ ᴙ ϯʙѳѥ ʍѧϯƴχѧ πѳҁʌє 8 єѣѧʌ',
'[ 먔🪽 ] ʍƀӀ ʌѥѣџʌџ ҁѳѣџⱀѧϯƀҁᴙ ҁ πѧҵѧʜѧʍџ џ ґѳʙѳⱀџϯƀ ѳ ϯʙѳєӣ ʍѧϯєⱀџ ʜѳ ⱀѧӡґѳʙѳⱀ ѳѣƀӀӌʜѳ ӡѧκѧʜӌџʙѧʌҁᴙ ѳđʜџʍ ʍƀӀ ӡʙѳʜџʌџ ϯʙѳєӣ ʍѧϯєⱀџ ӌϯѳѣƀӀ ѳʜѧ ѳϯҁѧҁѧʌѧ ʜѧʍ χƴӣ ʜє ⱀѧӡƴ ʜє ѳϯκѧӡƀӀʙѧʌѧ',
'[ 먔🪽 ] ʙ ʍƴҁѳⱀҁκѳʍ ƴӌѧҁϯκє ϯʙѳѥ ʍѧϯƀ πѳєѣѧʌ κѳґđѧ єё ӡѧκⱀƀӀʌџ ӡѧ đєⱀӡκѳє ҁѳҁѧʜџᴙ ʍѳєґѳ χƴᴙ ᴙ πⱀѳѣⱀѧʌҁᴙ ϯƴđѧ џ ʙƀӀєѣѧʌ єё πⱀѧʙџʌƀʜѳ ѫє χєχ',
'[ 먔🪽 ] ʜѧ đєʜƀ ѳϯκⱀƀӀϯƀӀχ đʙєⱀєӣ ϯʙѳѥ ʍѧϯƀ πѳєѣѧʌ κѳґđѧ ʙҁє ҁѳѣџⱀѧʌџҁƀ џ ѣƀӀʌџ ҁѳҁⱀєґѳϯѳӌєʜƀӀ ᴙ ϯѳѫє ѣƀӀʌ ʙ ҁʙѳёʍ πѳʜџʍѧʜџᴙ ʜѧʙѳҁϯⱀёʜ ʜѳ ᴙ єѣѧʌ ϯʙѳѥ ʍѧϯƀ',
'[ 먔🪽 ] ʜѧ ӡѧπⱀѧʙκє ϯʙѳѥ ʍѧϯƀ єѣѧʌ πѳκѧ ʙҁє ӡѧπⱀѧʙʌᴙʌџ ʍѧɯџʜƀӀ ᴙ ӡѧπⱀѧʙʌᴙʌ ҁπєⱀʍѧκѳʍ ϯʙѳѥ ѫѧʌκƴѥ ʍѧϯƴχƴ',
'[ 먔🪽 ] ʜѧ ѧʙϯѳҁϯѧʜҵџџ ϯʙѳѥ ʍѧϯƀ єѣѧʌ πѳκѧ χѳđџʌџ ѧʙϯѳѣƴҁƀӀ ʍѳӣ χƴӣ ӡѳđџʌ ʙʜϯƴⱀџ ϯʙѳєӣ ʍѧϯƴɯκє ѳⱀƴ đƴⱀєʜƀ',
'[ 먔🪽 ] ʜѧ ʍѳⱀє ϯʙѳѥ ʍѧϯƀ єѣѧʌ ʜѳ ϯѧʍ πѳπƀӀϯѧʌџҁƀ ƴ ʍєʜᴙ єё ҁπџӡđєϯƀ ʜѳ ѳʜѧ ʙєⱀʜƴʌѧҁƀ ӡѧ 1000 κʍ κѳ ʍʜє ʙєđƀ ѳʜѧ ʙєⱀʜѧ ʍѳєʍƴ χƴѥ',
'[ 먔🪽 ] ʜѧ κѧⱀџѣҁκџχ ѳҁϯⱀѳʙѧχ ϯʙѳѥ ʍѧϯƀ єѣѧʌ ѳʜѧ ⱀєɯџʌѧ ɯџκѧʜƴϯƀ џ πѳєχѧʌѧ ʜѧ ѳҁϯⱀѳʙѧ ʜѳ ʙӡᴙʌѧ ʍєʜᴙ ʙєđƀ κϯѳ єӣ ϯѧʍ ʜѧ ⱀѳϯѧʜ κџđѧϯƀ ѣƴđєϯ',
'[ 먔🪽 ] ʜѧ ӡѧκѧϯє ϯʙѳѥ ʍѧϯƀ єѣѧʌ ʙҁё ѣƀӀʌѳ ϯѧκ κⱀѧҁџʙѳ κⱀѳʍє єѣѧʌѧ ϯʙѳєӣ ʍѧϯєⱀџ πⱀџɯʌѳҁƀ ʜѧ ϶ϯƴ đƴⱀƴ ʍєɯѳκ ʜѧđєʙѧϯƀ',
'[ 먔🪽 ] ʜѧ ʙєⱀϯѳʌёϯє ϯʙѳѥ ʍѧϯƀ єѣѧʌ єӣ ѣƀӀʌѳ ҁϯⱀѧɯʜѳ ʌєϯєϯƀ џ ӌϯѳѣƀӀ ƴҁπѳκѳџϯƀ єё ʍʜє πⱀџɯʌѳҁƀ πѳⱀʙѧϯƀ єӣ ϯѧʍ ѧʜѧʌ',
'[ 먔🪽 ] ʜѧ ʙєʌџκє ϯʙѳѥ ʍѧϯƀ єѣѧʌ ϯƀӀ ѫє đƴⱀєʜƀ πѳʜџʍѧєɯƀ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ џҁπѳʌƀӡƀӀʙѧʌѧ ʍєҁϯѳ ҁєđƴɯκє ʜѧ ʙєʌџκє',
'[ 먔🪽 ] ʜѧ ʌƴʜє ϯʙѳѥ ʍѧϯƀ єѣѧʌ πѳκѧ ϯʙѳᴙ ʍѧϯƀ ѣƀӀʌѧ ʙ ʙѳҁϯѳⱀґє ѳϯ κѳҁʍѳҁѧ ᴙ єё єѣѧʌ ʌѧӣκʜџ ӡѧπџҁџ єҁʌџ ᴙ πѳҁϯƴπџʌ πⱀѧʙџʌƀʜѳ',
'[ 먔🪽 ] ʜѧ πⱀѳʙѳđѧχ ϯʙѳѥ ʍѧϯƀ єѣѧʌ πѳκѧ ϯʙѳᴙ ʍѧϯƴχѧ πⱀѳʙѧѫѧʌѧ ϯʙѳєґѳ ѣѧϯѥ ʙ ѧⱀʍџѥ ѳʜѧ πƴҁϯџʌѧ ҁʌєӡƴ ʜѳ ʙҁє ӡʜѧʌџ κϯѳ ѣƴđƴѱџӣ ґѳđ ѣƴđєϯ єӣ ʜѧ ⱀѳϯѧʜ κџđѧϯƀ',
'[ 먔🪽 ] ʜѧ πџϯ ҁϯѳπє ϯʙѳѥ ʍѧϯƀ єѣѧʌ κѳґđѧ ѳʜѧ πⱀƀӀґѧʌѧ ʙ ϯѧӌκє κ ӌƴѫџʍ ʍƴѫџκѧʍ ѳʜџ ⱀѧҁӌџϯƀӀʙѧʌџ ʜѧ ӌϯѳ ϯѳ ʜѳ πѳϯѳʍ πѳʜᴙʌџ ӌϯѳ ҁѳҁёϯ ѳʜѧ ϯѳʌƀκѳ ʍʜє',
'[ 먔🪽 ] ʜѧ ӡѧʙѳđє ϯʙѳѥ ʍѧϯƀ єѣѧʌ πѳκѧ ʙҁє ӌϯѳ ϯѳ πⱀѳџӡʙѳđџʌџ ϯʙѳѥ ʍѧϯƀ ʙ ҵєχє πѳ ѳѣⱀѧѣѳϯκє ʍѳӣ χƴӣ ѳѣⱀѧѣѧϯƀӀʙѧʌѧ ѳⱀƴ',
'[ 먔🪽 ] ʜѧ ʙѳʌʜє ϯʙѳѥ ʍѧϯƀ єѣѧʌ πѳκѧ ϯʙѳᴙ ʍѧϯƀ ʜє ʜѧƴӌџʌѧҁƀ єӡđџϯƀ ʜѧ ʍѳёʍ χƴѥ ѳʜѧ ʜє πєⱀєɯʌѧ κ ҁёⱀѻʜѳӣ đѳҁκє',
'[ 먔🪽 ] ʜѧ κѳⱀʜє ϯʙѳѥ ʍѧϯƀ єѣѧʌ ҁʍєɯʜѧᴙ џҁϯѳⱀџᴙ ѳʜѧ κѳπѧʌѧҁƀ ʙ ѳґѳⱀѳđє џ ƴπѧʌѧ ʜѧ κѳⱀєʜƀ ѧ đѧʌƀɯє ᴙ єё ʙƀӀєѣѧʌ κѧκ ѫѧʌκƴѥ ҁƴκƴ ѧ ϯƀӀ ӌєґѳ ѳѫџđѧʌ',
'[ 먔🪽 ] ʜѧ πѧҁκє ϯʙѳѥ ʍѧϯƀ πѳєѣѧʌ ʙⱀѳđє ҵєⱀκѳʙʜƀӀӣ πⱀѧӡđʜџκ ʜѳ ϶ϯѧ ɯʌѥχѧ ʍєҁϯѳ κƴʌџӌѧ ʍѳӣ χƴӣ ʜѧʙѳⱀѧӌџʙѧʌѧ',
'[ 먔🪽 ] ʜѧ κⱀєҁϯџʜѧχ ϯʙѳѥ ʍѧϯƀ єѣѧʌ ɯџκѧⱀʜƀӀӣ πⱀѧӡđʜџκ ʜѳ đѧѫє ϯѧʍ ϯʙѳᴙ ʍѧϯƀ ƴʍƴđⱀџʌѧҁƀ ⱀѧҁϯѧʙџϯƀ πєⱀєđ ʍʜѳӣ ҁʙѳџ ʜѳґџ',
'[ 먔🪽 ] ʜѧ κѧπӌє ϯʙѳѥ ʍѧϯƀ єѣѧʌ ʍєʜᴙ πƀӀϯѧʌџҁƀ ѣʌѳκʜƴϯƀ ӡѧ ϯѳ ӌϯѳ ᴙ ʜєπⱀѧʙџʌƀʜѳ ʙѳđџʌ πѧⱀѳʌƀ πѳ πџӡđє ϯʙѳєӣ ʍѧϯєⱀџ',
'[ 먔🪽 ] ʜѧ ϯѧⱀӡѧʜκє ϯʙѳѥ ʍѧϯƀ єѣѧʌ κѳґđѧ ѳʜѧ πƀӀϯѧʌѧҁƀ ҁπⱀƀӀґʜƴϯƀ ҁ ʜєё ᴙ πѳđχʙѧϯџʌ єё χƴёʍ џ ƴєѣѧʌ ѳѣ ӡєʍʌѥ πƴҁϯƀ ϯѳʌƀκѳ єѱё ⱀѧӡ πѳπⱀѳѣƴєϯ ʙƀӀκџʜƴϯƀ ӌϯѳ ʜџѣƴđƀ ϯѧκѳє',
'[ 먔🪽 ] ʜє ʍѳґƴ ʜє ӌєґѳ ҁκѧӡѧϯƀ πʌѳχѳґѳ ʜѧҁӌёϯ ϯʙѳєӣ ʍѧʍƴʌƀκє ʜѳ πⱀџđёϯƀҁᴙ ⱀѧҁκⱀƀӀϯƀ ϯєѣє ϯѧӣʜƴ ѳϯҁѳҁ ϯƀӀ ʍєⱀӡκџӣ ӌϯѳ ѳʜѧ ⱀѧđџ ʍѳєґѳ χƴᴙ ϯʙѳӣ κѳʍπ ӡѧʌѳѫџʌѧ ѳⱀƴ',
'[ 먔🪽 ] ʜѧ ҁκѧӌκѧχ ʙҁє ѣƀӀʌџ ʜѧ κѳʜᴙχ ѧ ϯʙѳᴙ ʍѧϯƀ єđџʜҁϯʙєʜѧᴙ ƴӌѧҁϯʜџҵѧ κѳϯѳⱀѧᴙ ⱀєɯџʌѧ πⱀѳҁκѧϯѧϯƀ ʜѧ ʍѳёʍ χƴє ʜє ӌё ϯѧκ πѳʌƴӌџʌѳҁƀ κҁϯѧϯџ ʍѳӣ χƴӣ ʙӡᴙʌ ϯѧʍ πєⱀʙѳє ʍєҁϯѳ',
'[ 먔🪽 ] ϯʙѳѥ ʍѧϯƀ κѧѫđƀӀӣ đєʜƀ χƴёʍ ʙ ʍѧґѧӡ ґѳʜᴙѥ ʙєđƀ ᴙ ϯѧκ ӡѧєѣѧʌҁᴙ єӣ ʜѧ ⱀѳϯѧʜ đѳʙѧϯƀ ӌϯѳ ϯєπєⱀƀ ʍѳё ⱀѧӡʙʌєӌєʜџᴙ ϶ϯѳ đєʌѧϯƀ џӡ ʜєё ҁѧʍƴѥ πѳҁʌƴɯʜƴѥ ɯʌѥχƴ',
'[ 먔🪽 ] ʍѳѫєɯƀ ʜє ʙєⱀџϯƀ ʜѳ ϯʙѳѥ ʍѧϯƀ πєⱀєѣѧʌѧ πѳʌ ґѳⱀѳđѧ ʜѳ ᴙ єđџʜҁϯʙєʜƀӀӣ ӡѧ ӌєӣ χƴӣ ѳʜѧ ѣƴđєϯ ҁϯѳᴙϯƀ đѳ κѳʜҵѧ џ ʜє κѳґđѧ ʜє ҁđѧҁϯ ӡѧđʜџѥ ⱀџʌџ',
'[ 먔🪽 ] ϯʙѳᴙ ʍѧϯƀ ʍѳӣ χƴӣ ʍєҁϯѳ ʍѧҁѳѫѳⱀѧ ⱀєɯџʌѧ џҁπѳʌƀӡƀӀʙѧϯƀ ʜѳ ᴙ ʜє ӡʜѧѥ єҁϯƀ ʌџ ʍѧҁѧѫѳⱀ πџӡđƀӀ ʙєđƀ єđџʜҁϯʙєʜʜѳє ӌϯѳ ѳʜѧ đєʌѧєϯ ϶ϯѳ ҁƴёϯ єґѳ ʙ ҁʙѳё ґʜєӡđѳ',
'[ 먔🪽 ] đѧѫє ʜѧ ⱀѧѣѳϯє ϯʙѳᴙ ʍѧϯƀ κѳґđѧ ʙҁє đєʌѧѥϯ πʌѧʜѳʙƀӀӣ ѳӌёϯ џʌџ ʙƀӀχѳđᴙϯ πѳκƴⱀџϯƀ ѳʜѧ ʍʜє πѳ ҁκѧӣπƴ ҁѳҁёϯ єҁʌџ ѣƀӀʌѳ ѣƀӀ ʙѳӡʍѳѫʜѳ ʜє πʌѧϯџϯƀ ӡѧ ʍѳӣ χƴӣ ѳʜѧ ѣƀӀ ʜє ⱀѧѣѳϯѧʌѧ',
'[ 먔🪽 ] ƴ ϯʙѳєӣ ʍѧϯєⱀџ ҁϯєⱀєѳϯџπʜѳє ʍƀӀɯʌєʜџᴙ ѳʜѧ đƴʍѧєϯ ӌϯѳ єҁʌџ ᴙ єӣ ʜє ʜѧʙєⱀʜƴʌ πѳ ґѳⱀѣƴ ӡѧ πʌѳχѳӣ ʍџʜƀєϯ ϯѳ ѣѳʌƀɯє ϯѧκ đєʌѧϯƀ џ ʜє ѣƴđƴ κѧκ ʜѧ ѳɯџѣѧєϯƀҁᴙ',
'[ 먔🪽 ] ϯʙѳєӣ ʍѧϯєⱀџ ʌџʜџѥ ѫџӡʜџ χƴёʍ ѳѣѳⱀʙѧʌ ϯєπєⱀƀ єӣ πⱀџđёϯƀҁᴙ ѳϯπⱀѧʙʌᴙϯƀҁᴙ ʙ ʍџⱀ џʜѳӣ ʜѧ ӡʜѧᴙ κѧκѧᴙ ϯʙѳᴙ ʍѧʍѧɯѧ ɯʌѥχѧ ѳʜѧ đѧѫє ϯѧʍ πѳπⱀѳҁџϯ ʍѳӣ χƴӣ',
'[ 먔🪽 ] ʍѳӣ χƴӣ ϯʙѳѥ ʍѧϯƀ ѫє ʜѧ ʙєⱀχκƴɯκƴ ӡѧκџʜƴʌ ϯєπєⱀƀ ѳʜѧ ѳѣѱѧєϯƀҁᴙ ҁ џʜϯєʌєґєʜϯʜƀӀʍџ ʌѥđƀʍџ ʜѳ ʍƀӀ ϯѳ ʙҁє ӡʜѧєʍ κѧκ ʍƀӀ ҁ πѧҵѧʜѧʍџ єё ⱀѳϯѧʜ πѳ κⱀƴґƴ πƴҁκѧʌџ',
'[ 먔🪽 ] ʜє ѳϯⱀџҵѧӣ ϯѳґѳ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ҁđѧʌѧҁƀ ʍѳєʍƴ χƴѥ ѳʜѧ πƀӀϯѧʌѧҁƀ ҁѳπⱀѳϯџʙʌᴙϯƀҁᴙ ʜѳ ʍѳӣ χƴӣ ѳκѧӡѧʌҁᴙ ҁџʌƀʜєє đѧѫє ϯʙѳӣ ѳπƴѱєʜƀӀӣ ѳϯєҵ ҁ ʜџʍ ʜє ҁʍѳґ ҁπⱀѧʙџϯƀҁᴙ',
'[ 먔🪽 ] ʍѳѫєϯ ϯƀӀ ʍʜє ҁκѧѫєɯƀ πѳӌєʍƴ ϯʙѳᴙ ʍѧϯƀ єѣƴӌѧᴙ ʍѳʌєκƴʌѧ ѳπᴙϯƀ ⱀєɯџʌѧ ʙƀӀʙєҁџϯƀ ʜѧ ҁϯєʜđ ʍѳӣ χƴӣ ѳʜѧ ƴѫє πⱀѳđѧʌѧҁƀ єʍƴ πѳʌʜѳҁϯƀѥ ⱀџʌџ',
'[ 먔🪽 ] ʜє ӡѧѣƀӀʙѧӣ κϯѳ ϯʙѳѥ ʍѧϯƀ χƴёʍ ƴєѣѧʌ џ ʙҁё ϶ϯѳ ѣƀӀʌѳ ʙѳ ѣʌѧґѳ ʙєđƀ ϯєπєⱀƀ ѳʜѧ ҁϯѧʌѧ ƴʍʜєє џ ʍєҁϯѳ ѳϯҁѳҁѧ ϯʙѳєʍƴ ѣѧϯџ ϯєπєⱀƀ ѳʜѧ đєʌѧєϯ єґѳ ʍʜє',
'[ 먔🪽 ] ʍѳѫєϯ ϯƀӀ ѱѧҁ ƴπѧđёɯƀ ʜѧ κѳʌєʜџ џ ʜѧӌʜёɯƀ ʍʜє ҁѳҁѧϯƀ ѧ ϯѳ ᴙ πѳӡѳʙƴ ϯʙѳѥ ʍѧϯƀ џ ѳʜѧ ƴѫє ʜє ҁʍѳѫєϯ ѳϯѳⱀʙѧϯƀҁᴙ ѳϯ ʍѳєґѳ χƴᴙ',
'[ 먔🪽 ] ʜƴ ѱѧҁ ᴙ ʜѧӌʜƴ κⱀƴϯџϯƀ ϯʙѳѥ ʍѧʍѧɯƴ ʜѧ χƴє ѣєӡ ѳҁϯѧʜѳʙκџ ѧ ϯƀӀ πѳⱀѳѣƴӣ ѳҁϯѧʜѳʙџϯƀ ϶ϯƴ κѧⱀƴҁєʌƀ ѫѧʌκџӣ ϯѳʌƀκѳ ҁʍѳϯⱀџ ҁѧʍ ʜє πѳπѧđџ ʜѧ ʜєё',
'[ 먔🪽 ] ƴ ϯʙѳєӣ ʍѧϯєⱀџ єҁϯƀ κѳⱀѳʜκѧ κѳґđѧ ҁѳѣџⱀѧѥϯƀҁᴙ ⱀѳđҁϯʙєʜџκџ џ πⱀѳҁᴙϯ πѳκѧӡѧϯƀ ӌєґѳ ѳʜѧ đѳҁϯџґʌѧ ѳʜѧ ӡѳʙёϯ ʍєʜᴙ џ ҁѳҁёϯ ʍѳӣ χƴӣ џ ʙҁє ѧπʌѧđџⱀƴѥϯ πⱀџκџʜƀ',
'[ 먔🪽 ] ʜѧ πєⱀєʙѧʌє ϯʙѳѥ ʍѧϯƀ πѳєѣѧʌ ѳʜѧ đƴʍѧʌѧ ӌϯѳ πⱀѳҁϯѳ ѳϯđѳχʜёϯ ʜѳ ʍѳӣ χƴӣ đѧѫє ʜє ѳҁϯѧʙџʌ єӣ ɯѧʜҁѳʙ ʜѧ ʙƀӀѫџʙѧʜџᴙ ӡѧϯѳ ϯєπєⱀƀ ѳʜѧ ґⱀѧʜϯ ʍѧҁϯєⱀ πѳ ҁѳҁѧʜџѥ ʍѳєґѳ χƴᴙ',
'[ 먔🪽 ] ϯʙѳᴙ ʍѧϯƴɯκѧ ʜє ϯѧκ ӌѧҁϯѳ ҁϯѧʌѳ ҁѳҁѧϯƀ ʍʜє χƴӣ ᴙ ⱀєɯџʌ ⱀѧӡѳѣⱀѧϯƀҁᴙ ʙ ӌёʍ đєʌѳ ѳκѧӡƀӀʙѧєϯƀҁᴙ ϯʙѳӣ ѣѧϯᴙ πѳπⱀѳҁџʌ ӌϯѳѣ ѳʜѧ ҁѳҁѧʌѧ ʍʜє ⱀєѫє ᴙ κѧκ ƴєѣѧʌ єґѳ χƴёʍ πѳҁʌє ӌєґѳ ѳʜ πєⱀєđƴʍѧʌ',
'[ 먔🪽 ] ᴙ χѳӌƴ ӌϯѳѣƀӀ ϯʙѳᴙ ʍѧϯƀ ҁѳҁѧʌѧ ʍʜє đѳ κѳʜҵѧ ʙєκѧ ʜѳ ᴙ πѳʜџʍѧѥ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ʜє ʙєӌʜѳ ʜѳ ʍѳӣ χƴӣ ѳѣⱀёʌ ҁπѳҁѳѣʜѳҁϯƀ ⱀєʜκѧⱀʜѧҵџџ ϯєπєⱀƀ ϯʙѳᴙ ʍѧϯƀ ʙ ѣєӡʜѧđёѫʜѳʍ πѳʌѳѫєʜџџ',
'[ 먔🪽 ] ʜѧ ⱀƀӀʜκє ϯʙѳѥ ʍѧϯƀ єѣѧʌ ӡѧ πⱀџʌѧʙκѳʍ ѧ ӡʜѧєɯƀ κѧκ ʙҁё ʜѧӌѧʌѳҁƀ ѳʜѧ ⱀєɯџʌѧ πⱀѳđѧϯƀ ʍʜє ѳґƴⱀҵƀӀ κѳϯѳⱀƀӀє ҁѳʙѧʌѧ ʙ ҁʙѳѥ ҁπџđѳӡʜƴѥ πⱀѳѱєʌџʜƴ πⱀџđёϯƀҁᴙ єѱё ѳϯχƴᴙⱀџϯƀ єё',
'[ 먔🪽 ] ʜѧ ʙѳӡʙƀӀɯєʜџџ ϯʙѳѥ ʍѧϯƀ πѳєѣѧʌ ѳʜѧ ⱀєɯџʌѧ πѳʌѥѣѳʙѧϯƀҁᴙ ʙџđѧʍ πⱀџⱀѳđƀӀ ʜѳ ʍѳӣ ѣƀӀʌ ʜѧҁϯѳʌƀκѳ ⱀєӡʙƀӀӣ ӌϯѳ єӣ πⱀџɯʌѳҁƀ ʌѥѣѳʙѧϯƀҁᴙ ʙџđѳʍ ʍѳєґѳ χƴᴙ',
'[ 먔🪽 ] ʜѧ ⱀƀӀѣѧʌκє ϯʙѳѥ ʍѧϯƀ єѣѧʌ πѳκѧ ϯʙѳӣ ѣѧϯᴙ ʜѧҁѧѫџʙѧʌ ӌєⱀʙᴙκѳʙ ʜѧ ƴđѳӌκƴ џ πƀӀϯѧʌҁᴙ πѳӣʍѧϯƀ ⱀƀӀѣƴ ᴙ ƴѫє ʙѳ ʙҁѥ đѳѣџʙѧʌ ҁʙѳџʍ χƴёʍ ϯʙѳѥ ɯѧκѧʌƀʜƴѥ ʍѧϯƀ',
'[ 먔🪽 ] ѣєӡ ʙƀӀχѳđʜƀӀχ ϯʙѳѥ ʍѧϯƀ єѣѧʌ πѳκѧ ʜє πѳʜᴙʌ ӌϯѳ ʜѧđѳ ӌϯѳ ϯѳ ʍєʜᴙϯƀ πѳӡʙѧʌ ϯʙѳєґѳ ѣѧϯѥ џ ʍƀӀ ʙʍєҁϯє ҁ ʜџʍ ⱀєɯџʌџ ʙƀӀєѣѧϯƀ ϯᴙ πѳʍʜџɯƀ ʜѳⱀʍ ϯѳґđѧ πѳʌƴӌџʌѳҁƀ',
'[ 먔🪽 ] ʜє κџđѧӣҁᴙ ϯѧκ ʜѧ ʍѳӣ χƴӣ ʙєđƀ ϯƀӀ πѳʜџʍѧєɯƀ ӌϯѳ ʜє ʙƀӀʙєӡџɯƀ єґѳ ʌƴӌɯє πѳӡѳʙџ ҁʙѳѥ ʍѧϯƀ ƴ ʜєё џ ϯѳ ѣѳʌƀɯє ɯѧʜҁѳʙ єґѳ ѳđѧʌєϯƀ ӌєʍ ƴ ϯєѣᴙ ѫѧʌκѧᴙ ʍѳʜѧɯκѧ',
'[ 먔🪽 ] đѧѫє ʜѧκƴⱀєʜƀӀʍ ϯʙѳѥ ʍѧϯƀ єѣѧʌ ѳʜѧ đƴʍѧʌѧ ӌϯѳ ᴙ πⱀѳҁϯѳ ⱀѧđ єё ʙџđєϯƀ ʜѳ κѳґđѧ ʍєʜᴙ κⱀƀӀʌѳ ᴙ πⱀєđҁϯѧʙʌᴙʌ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ʜє ҁπџđѳӡʜѧᴙ џ ʍʜє ҁϯѧʜѳʙџʌѧҁƀ ʌєґӌє',
'[ 먔🪽 ] ϯʙѳᴙ ʍѧϯƀ ⱀєɯџʌѧ ӡѧҁʜᴙϯƀ κѧκ ᴙ єё єѣƴ πѳϯѳʍ ҁκџʜƴʌѧ đⱀƴӡƀᴙʍ ѳʜџ ҁʍѳϯⱀєʌџ ʙҁє ʙџđѳҁƀӀ џ πѳϯѳʍ ⱀєɯџʌџ ӌϯѳ ʍѳӣ χƴӣ ʜѧđѳ πџѧⱀџϯƀ ʙ ϯʙѳєӣ ґʌѳϯκє єӡ єӡ',
'[ 먔🪽 ] κѳґđѧ ᴙ ƴʍџⱀѧʌ ʜѧ đʙџѫє ϯʙѳᴙ ʍѧϯƀ ҁđєʌѧʌѧ ʍʜє ґѳⱀʌѳʙѳӣ ʍџʜƀєϯ џ ʍʜє ҁϯѧʌѳ ϯѧκ ʌєґӌє ӌϯѳ ᴙ ʜѧӌѧʌ ʙѳӡⱀѳѫđѧϯƀҁᴙ ѳҁʍѳϯⱀєʌҁᴙ ʙѳκⱀƴґ ѧ ѳκѧӡѧʌҁᴙ ʜѧ ⱀєӣʙє',
'[ 먔🪽 ] ʙκѧӌѧʌ ϯʙѳєґѳ ѳϯҵѧ χƴёʍ џ ʍѳґƴ đѧѫє ҁ ӌџҁϯѳӣ ҁѳʙєҁϯƀѥ ҁκѧӡѧϯƀ ӌϯѳ ϯʙѳӣ ѳϯєҵ κѧκ ʍѳґ πƀӀϯѧʌҁᴙ ʍʜє ѳϯҁѳҁѧϯƀ ʜѳ ѳʜ πѳʌƴӌџʌ ʍʜѳґѳӌџҁʌєʜʜƀӀӣ ƴⱀѳʜ ѳϯ ʍѳєґѳ χƴᴙ',
'[ 먔🪽 ] κѳґđѧ ᴙ ҁєʌ ʙ ϯѥⱀƀʍƴ ϯʙѳᴙ ʍѧϯƀ ѣєґѧʌѧ κѳ ʍʜє ʜѧ κџӌƴ џ ѳϯҁѧҁƀӀʙѧʌѧ κѧκ ѣєɯєʜѧᴙ ᴙ ʜѧӌѧʌ κѳⱀʍџϯƀ єё ʌєѱѧʍџ πѳϯѳʍƴ ӌϯѳ κѧκ ѳʜѧ ʙѳѣѱє ӡѧѣⱀѧʌѧҁƀ ʙ κѧʍєⱀƴ',
'[ 먔🪽 ] ʜє κѳґđѧ ʜє πѳӣʍƴ ѳđʜѳґѳ ӡѧӌєʍ ϯʙѳᴙ ʍѧϯƀ ϯѧκ ѳѣџʌƀʜѳ ҁѳҁёϯ џ κ ӌєʍƴ ѳʜѧ ҁϯⱀєʍџϯƀҁᴙ ʍѳѫєϯ ƴ ʜєё єҁϯƀ κѳʜєӌʜѧᴙ ҵєʌƀ џ ᴙ ӡʜѧѥ κѧκѧᴙ ѣƀӀϯƀ ҁѧʍѳӣ ʙєⱀʜѳӣ ʍѳєґѳ χƴѥ',
'[ 먔🪽 ] ⱀѧҁκѳⱀʍџʌ ϯʙѳѥ ʍѧϯƀ χƴёʍ ӌϯѳ ѳʜѧ ϯєπєⱀƀ ᴙʙʌᴙϯƀҁᴙ ʍєҁϯʜƀӀʍ ѣѳҁҁѳʍ џ єđџʜҁϯʙєʜƀӀʍ κϯѳ єё ʍѳѫєϯ κⱀƀӀɯѳʙѧϯƀ єё ʜѧ đѧʜʜƀӀӣ ʍѳʍєʜϯ ϶ϯѳ ʍӣ χƴӣ ʙєđƀ ѳʜѧ ʙҁєґđѧ ҁϯѧʙџʌ ӡѧ ʜєґѳ ҁʙєӌκџ',
'[ 먔🪽 ] ʜє κѳʍƴ ʜє ҁκѧѫƴ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ƴѫє ʜѧᴙⱀџʙѧєϯ ʍѳӣ χƴӣ πѳ 100 ⱀѧӡƴ ʙєđƀ ѳʜѧ ϶ϯѳ đєʌѧєϯ ҁ ӌџҁϯѳӣ ҁѳʙєҁϯƀѥ џ đƴʍѧєϯ ӌϯѳ єҁʌџ ҁѳҁѧϯƀ ʍѳӣ χƴӣ ϯѧκ ӌѧҁϯѳ ѳʜѧ πѳπѧđёϯ ʙ ⱀѧӣ',
'[ 먔🪽 ] ϯʙѳᴙ ʍѧϯƀ ϯѧκѧᴙ ѣєҁπѳʜϯѳʙѧᴙ ӌϯѳ πⱀєѫđє ӌєʍ єё ʙƀӀєѣѧϯƀ ᴙ đѧѥ ʜѧ ⱀѳϯѧʜ ϯʙѳєʍƴ ѳϯҵƴ ʙєđƀ ϯѧκ ʍѳӣ χƴӣ ƴѫє ґѳϯѳʙ κ ҁϯⱀёʍʜѳӣ ґʌѳϯκє ϯʙѳєӣ єѣƴӌєӣ ʍѧϯƴχє',
'[ 먔🪽 ] ϯʙѳєӣ ʍѧϯєⱀџ πѳʍџʜκџ ҁʙѳџʍ χƴёʍ ѳⱀґѧʜџӡѳʙѧʌ џ ʙҁє ⱀѳđҁϯʙєʜџκџ ѣƀӀʌџ ⱀѧđƀӀ ʙєđƀ ʍѳӣ χƴӣ ϶ϯѳ ҁѧʍƀӀӣ πѳӌёϯʜƀӀӣ ґѳҁϯƀ ʜѧ џχ πѳʍџʜκѧχ єӡ єӡ',
'[ 먔🪽 ] πѳҁʌє ϯѳґѳ κѧκ ϯʙѳᴙ ʍѧϯƀ ⱀєɯџʌѧ ӡѧⱀєӣđџϯƀ ʍѳӣ χƴӣ ᴙ ѳϯѣџʌ єё ⱀєӣđ ʜѳ ⱀєɯџʌ ʜѧκѧӡϯƀ ӡѧ ҁϯѳʌƀ ʜџӡκѳє đџᴙʜџᴙ ϯєπєⱀƀ ѳʜѧ ʌџѫєϯ ʍѳєʍƴ κєʜϯƴ πᴙϯκџ ѳⱀƴ',
'[ 먔🪽 ] ʜѧ πѧʌƴѣє ϯʙѳѥ ʍѧϯƀ єѣѧʌ ʜє ѳđџʜ ʍѳⱀᴙκ ѧ ʙҁё πѳϯѳʍƴ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ʜє ʍѳѫєϯ ѫџϯƀ ѣєӡ ӌƴѫџʙ χƴёʙ џ đѧѫ ѣƴđƴӌџ ʙ ӡѧπєⱀϯџ ѳʜѧ ʜѧӣđёϯ κѧκѳӣ ʜџѣƴđƀ χƴӣ',
'[ 먔🪽 ] ʜє ʍѳґƴ πѳʙєⱀџϯƀ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ϯѧκ πⱀѳҁϯѳ πѳđϯѧʌѧҁƀ ʜѧ πⱀѳʙѳκѧҵџѥ κџʜƴϯƴѥ ʍѳџʍ χƴёʍ ӌϯѳ ϯєπєⱀƀ đєʌѧϯƀ đѧʙѧӣ πѳ ʜѧκѧϯѧʜѳӣ πⱀѳҁϯѳ ⱀѧӡѳⱀʙёʍ єӣ πєⱀđѧκ',
'[ 먔🪽 ] ϯʙѳᴙ ʍѧʍѧɯѧ đѧѫє ⱀѧƴʜđѧ πⱀѳϯџʙ ʍѳєґѳ χƴᴙ ʜє ʙƀӀҁϯѳᴙʌѧ ӌϯѳ ϯєπєⱀƀ ґʙѳѳⱀџϯƀ ѳ πѳʌʜѳҵєʜѳʍ ѣѳє πƴҁϯƀ ϯⱀєʜџⱀƴєϯƀҁᴙ ѧ πѳκѧ ѳʜѧ ϶ϯѳ đєʌѧϯƀ đѧʙѧӣ ҁѳҁџ ⱀѧκѧʌ',
'[ 먔🪽 ] ϯʙѳᴙ ʍѧϯƀ ʜє ʍѳѫєϯ πѳʜᴙϯƀ ӌϯѳ ʍѳӣ χƴӣ ʜє ʙҁєґđѧ ѣƴđєϯ đєⱀѫѧϯƀ ʜѧđ ʜєӣ ʙʌѧҁϯƀ ϯѧκ ϯѳ',
'[ 먔🪽 ] χƴёʍ ϯʙѳѥ ʍѧϯƀ πʌѳʍѣџⱀѳʙѧʌ єӣ đѧѫє κ ҁϯѧʍѧϯѳʌѳґƴ χѳđџϯƀ',
'[ 먔🪽 ] ϯʙѳѥ ʍѧϯƀ χƴёʍ ⱀѧӡⱀєӡѧʌ ѧ ѳʜѧ πѳѣєѫѧʌѧ κ ϯʙѳєʍƴ ѣѧϯџ џ πѳκѧӡѧʌѧ ѳϯⱀєӡѧʜƴѥ πџӡđƴ κѧκ πⱀџκѳʌ',
'[ 먔🪽 ] χƴёʍ ϯʙѳѥ ʍѧϯƀ ʜѧƴӌџʌ πџҁѧϯƀ ʜѳ ѳʜѧ πʌѳχѳ ʙѳҁπⱀџʜџʍѧєϯ ƴӌєʜџᴙ џ ʜѧӌџʜѧєϯ ҁѳҁѧϯƀ ʜѧ ѧʙϯѳʍѧϯє',
'[ 먔🪽 ] ᴙ ҁϯⱀєʌᴙʌ ʙ ϯʙѳѥ ʍѧϯƀ χƴёʍ ʙƀӀҁϯⱀєʌџʌ џ ѳʜѧ ϯʙѧⱀƀ ѳѫџʌѧ џ ʜѧӌѧʌѧ πѳʌӡϯџ κ ʍѳєʍƴ χƴѥ',
'[ 먔🪽 ] ϯʙѳᴙ ʍѧϯƀ ⱀєκѳⱀϯҁʍєʜκѧ πѳ ҁѳҁѧʜџѥ ʍѳєґѳ χƴᴙ єё ⱀєκѳⱀđ đѧѫє ϯʙѳӣ ѣѧϯᴙ ʜє ʍѳѫєϯ πѳѣџϯƀ',
'[ 먔🪽 ] ʜƴ џ ӌё ϯʙѳᴙ ʍѧϯƀ ʍʜє ҁѳҁѧʌѧ ʜє ʜѧđѳ ѳϯⱀџҵѧϯƀ ʙєđƀ ϯƀӀ ϯѳѫє ӡѧπѳđѳӡⱀєʜ ʙ ϶ϯѳʍ',
'[ 먔🪽 ] ⱀѧӡκƴʍѧⱀџʌ ϯʙѳѥ ʍѧϯƀ χƴёʍ đѧ ϯѧκѳӣ ҁϯєπєʜџ ӌϯѳ ѳʜѧ єʌџ єʌџ đѳѣⱀѧʌѧҁƀ đѳ đѳʍѧ đѧѫє πѳ đѳⱀѳґє ѳʜѧ ƴҁπєʌѧ κѳʍƴ ϯѳ ѳϯҁѳҁѧϯƀ ɯѧʌѧʙѧ ѫѧʌκѧᴙ',
'[ 먔🪽 ] ʜƴ џ ӌё ϯƀӀ ʍѳѫєɯƀ ᴙ ѫє ҁʙѳџʍ χƴёʍ ϯʙѳџ ʍƀӀҁʌџ ϯѧκ ϯѳ πєⱀєҁϯⱀѳџʌ đƴⱀєʜƀ',
'[ 먔🪽 ] ʜє ʍѳґƴ ҁκѧӡѧϯƀ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ҁѳҁёϯ ʙҁєʍ ѳӌєʜƀ ӌѧҁϯѳ ʙєđƀ ʙѳӡʌє ҁʙѳєґѳ χƴᴙ ᴙ ʙџѫƴ єё κѧѫđƀӀӣ đєʜƀ',
'[ 먔🪽 ] ʜƴ ϯʙѳᴙ ʍѧϯƀ ƴѫє πѳ ѣʌѧϯƴ ʍʜє ҁѳҁёϯ ʜѳ єӣ ʜє χʙѧϯѧєϯ ҁϯџʍƴʌѧ ʍѳѫєϯ ϯʙѳєʍƴ ѣѧϯџ χƴёʍ ʙєʜƀӀ ʙҁκⱀƀӀϯƀ',
'[ 먔🪽 ] ϯʙѳєӣ ʍѧϯєⱀџ ҁʙѳӣ χƴӣ ʙ ⱀѧʍκƴ πѳҁϯѧʙџʌ џ ϯєπєⱀƀ ʙƀӀ ʙҁєӣ ҁєʍƀёӣ џʍ ʌѥѣƴєϯєҁƀ',
'[ 먔🪽 ] πѳ πⱀџκѳʌƴ ϯʙѳѥ ʍѧϯƀ χƴёʍ ʜѧ ʌƴʜƴ ӡѧκџʜƴʌ ѧ ѳʜѧ đѧѫє ϯѧʍ ʙ πєⱀđѧӌєʌѳ κѳʍƴ ϯѳ đѧʌѧ ѳⱀʜџ ҁ ϶ϯѳӣ ɯʌѥχџ',
'[ 먔🪽 ] ʍѳґƴ ϯʙѳѥ ʍѧʍѧɯƴ χƴёʍ ʙӡᴙϯƀ ʜѧ πⱀѳґџѣ ʜѳ ʜє χѳӌƴ ʙєđƀ ѳʜѧ ҁϯѳџϯ ⱀѧκѳʍ џ ѫđёϯ κѳґđѧ ᴙ єё ʙƀӀєѣƴ',
'[ 먔🪽 ] ⱀѧҁɯџⱀџʌ ґʌѧʜđƀӀ χƴёʍ ϯʙѳєӣ ʍѧϯєⱀџ ӡѧϯѳ ϯєπєⱀƀ ѳʜѧ ѣѳʌƀɯє ʍѳѫєϯ ѳπⱀѧѣѧϯƀӀʙѧϯƀ ʍѳӣ ӌʌєʜ ҁʙѳџʍ ⱀϯѳʍ',
'[ 먔🪽 ] ʜє ҁџʌƀʜѳ ʙƀєѣѧʌ ϯʙѳєӣ ʍѧϯєⱀџ ӡѧʌƴπѳӣ ʜѳ ѳʜѧ ѳϯκʌѥӌџʌѧҁƀ ѱѧ πⱀѳҁʜёϯƀҁᴙ πѳ ʜѳʙѳӣ єё πѳєѣƴ',
'[ 먔🪽 ] ʜѧ ʜєґѧϯџʙє єѣѧʌ ʍѧϯƀ ϯʙѳѥ ʙєđƀ ѳʜѧ ӡѧєѣѧʌѧ ʙƀӀⱀƀӀʙѧϯƀҁᴙ ӡѧ ӌϯѳ ᴙ єӣ ƴєѣѧʌ ʌєѱѧ',
'[ 먔🪽 ] ⱀѧӡѳⱀʙѧʌ ϯʙѳѥ ʍѧϯƀ χƴёʍ ʜѧ ӌѧҁϯџ ϯєⱀƀ ϯƀӀ єđџʜҁϯʙєʜƀӀӣ κϯѳ ѣƴđєϯ ʍѳӣ χƴӣ đѳ ƴѣѳᴙ ҁѳҁѧϯƀ',
'[ 먔🪽 ] ⱀѧҁϯⱀѳґѧʌ ϯʙѳѥ ʍѧϯƀ κѳґđѧ χƴёʍ ʙƀєѣѧʌ єӣ πѳ ґƴѣѧʍ ʙєđƀ κѧκ ʍƀӀ πѳʍʜџʍ ᴙ ϯʙѳєӣ ʍѧϯєⱀџ ⱀѧʜƀɯє ⱀѧӡџѣʙѧʌ ѧ ѱѧҁ πⱀѳҁϯѳ ⱀѧҁёκ ѳʜѧ ⱀѧđѧ',
'[ 먔🪽 ] ϯʙѳᴙ ʍѧϯƀ πѳҁϯⱀѳџʌ ѳѣѳⱀѳʜƴ ѳϯ ʍѳєґѳ χƴᴙ ʜѳ ҁ κѧѫđƀӀʍ ƴđѧⱀѳʍ πѳ ҁϯєʜѧʍ ϶ϯѳӣ ѳѣѳⱀѳʜƀӀ ᴙ ʙҁё ѣʌџѫє κ ґʌѳϯκє ϯʙѳєӣ ʍѧϯƴχє',
'[ 먔🪽 ] ʍѳӣ χƴӣ ƴѫє ʜѧ ҁϯѳʌƀκѳ ʙƀӀⱀѳҁ ʙ ґʌѧӡѧχ ϯʙѳєӣ ʍѧϯєⱀџ ӌϯѳ ѳʜѧ ҁѳҁёϯ єґѳ ʍєҁϯѳ ӡѧʙϯⱀѧκѧ',
'[ 먔🪽 ] ⱀѧӡʍƴⱀѳʙѧʌ ϯʙѳѥ ʍѧϯƀ χƴёʍ κѳґđѧ ѳʜѧ ʜє ʍѳґʌѧ ʙƀӀѣⱀѧϯƀҁᴙ џӡ ӡѧ ӌєґѳ ϯєπєⱀƀ ѳʜѧ πѳ ѫџӡʜєʜѳ ʍʜє đѳʌѫʜѧ ѳϯҁѧҁƀӀʙѧϯƀ ѧ πѳϯѳʍ ϯƀӀ єё ҁʍєʜџɯƀ πⱀѧʙđѧ ѫє',
'[ 먔🪽 ] ʜѧκџʜƴʌ ϯʙѳєӣ ʍѧϯєⱀџ ʙ κѧѣџʜƴ ӡѧ ϯѳ ӌϯѳ ѳʜѧ ⱀєɯџʌѧ ѳҁџʌџϯƀ ʍѳӣ χƴӣ ҁʙѳџʍ ⱀϯѳʍ πƴҁϯƀ ϯѧκѧᴙ ɯѧʙκѧ đѧѫє ʜє πџϯѧєϯ ʜѧđєѫđƀӀ',
'[ 먔🪽 ] ʜѧґѳⱀʜƴʌ ϯʙѳѥ ʍѧϯƀ χƴёʍ πⱀѳҁϯѳ πѳ πⱀџʜҵџπƴ ʜѳ ѳʜѧ đѧѫє ϯѧκ ⱀєɯџʌѧ đѧϯƀ ʍʜє ʙ πџӡđƴ κѧκ ѣƀӀʌѧ ɯʌѥχѳӣ ϯѧκ џ ѳҁϯѧʌѧҁƀ',
'[ 먔🪽 ] ʍƀӀ πѳҁπѳⱀџʌџ ҁ ѳϯҵѳʍ ӌϯѳ ϯʙѳᴙ ʍѧʍѧɯѧ ҁѳҁѧʌѧ ʍʜє ʜє ѣѳʌƀɯє 200 ⱀѧӡ ʙ đєʜƀ ʜѳ ѳʜ πⱀѳџґⱀѧʌ ʙєđƀ ƴʙџđєʌ κѧκ ѳʜѧ ѳϯҁѧҁƀӀʙѧєϯ ʍʜє ʙ ѫџʙƴѥ',
'[ 먔🪽 ] ϯʙѳѥ ʍѧϯƀ πєⱀʙƀӀӣ ⱀѧӡ ӡѧ κƴҁѳκ ҁѧʌѳ ʙƀӀєѣѧʌ ѧ ѳʜѧ ⱀѧđѳʙѧʌѧҁƀ ӌϯѳ ʍѳѫєϯ ʜѧκѳⱀʍџϯƀ ϯєѣᴙ ʜѳ κѧκ πѳєʌ ҁʌџӡєʜƀ',
'[ 먔🪽 ] πѳπⱀѳѣƴӣ єѱё ⱀѧҁ ҁκѧӡѧϯƀ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ πєⱀєʙєđѧʌѧ ҁϯѳʌƀκѳ κʌёʙƀӀχ χƴёʙ ᴙ ϯєѣᴙ ƴєѣƴ χƴёʍ ʙєđƀ ѳʜѧ ʜѧ ѳϯҁѳҁє πⱀџӡʜѧʙѧʌҁƀ ӌϯѳ ʍѳӣ χƴӣ ҁѧʍƀӀӣ ʌƴӌɯџӣ',
'[ 먔🪽 ] πѳ ӡʙєⱀҁκџ ϯʙѳѥ ʍѧϯƀ єѣƴ ѳʜѧ ʙ ɯѳκє џ đƴʍѧєϯ ӌϯѳ ϶ϯѳ ʌѥѣѳʙƀ ʜѳ ᴙ πƀӀϯѧѥҁƀ ʙκѧӌѧϯƀ єё ҁπєⱀʍѧκѳʍ ӌϯѳѣƀӀ ѳʜѧ πєⱀєđѳӡʜƴʌѧҁƀ',
'[ 먔🪽 ] ʜƴ џ ӌё ʍƀӀ ϯєπєⱀƀ ҁ ϯʙѳџʍ ѣѧϯєӣ đⱀƴӡƀᴙ πѳҁʌє ϯѳґѳ κѧκ ᴙ đѧʌ ϯʙѳєӣ ʍѧʍѧɯκє ʜѧ κʌƀӀκ ѳʜ ƴӡʜѧʌ ӌϯѳ ѳʜѧ ѫѧʌκѧᴙ ɯʌѥχѧ џ ҁđѧʌ єё ʍʜє ʙ ⱀѧѣҁϯʙѳ',
'[ 먔🪽 ] ϯʙѳᴙ ʍѧϯƀ ҁʜѧӌѧʌѧ đƴʍѧʌѧ ӌϯѳ ʍѳӣ χƴӣ ʜє ʙƀӀӡƀӀʙѧєϯ ӡѧʙџҁџҁʍѳҁϯ ʜѳ ҁ κѧѫđƀӀʍ ⱀѧӡѳʍ ҁѳҁѧʌѧ ʙҁё ѣѳʌƀɯє џ ѣѳʌƀɯє',
'[ 먔🪽 ] ʜѧ ⱀѧӡѳґⱀєʙ ϯʙѳѥ ʍѧʍѧɯƴ πѳєѣѧʌ ѧ πѳϯѳʍ ϯʙѳӣ ѣѧϯᴙ ⱀєɯџʌ ʍʜє πѳ ѻѧʜƴ ѳϯҁѳҁѧϯƀ ᴙ ϯєπєⱀƀ đƴʍѧѥ ƴ ʙѧҁ ʙⱀѳѫđёʜѳє ʍѳӣ χƴӣ ҁѳҁѧϯƀ',
'[ 먔🪽 ] ʍѳӣ χƴӣ πⱀѳɯёʌҁᴙ πѳ ϯʙѳєӣ ʍѧϯєⱀџ ѳϯ ʜѧӌѧʌѧ џ đѳ κѳʜҵѧ џ ϯƀӀ đѳʌѫєʜ ѣƀӀϯƀ ѣʌѧґѳđѧⱀєʜƀ ӌϯѳ ʍѳӣ χƴӣ ѳҁϯѧʙџʌ єё ѳѣʌџϯѳӣ ҁπєⱀʍѧκѳʍ ѧ ʜє ⱀѧӡʍѧϯѧʌ',
