'[ 먔🪽 ] ʜѧ κѧʜƴʜє ϯʙѳѥ ʍѧϯƀ πѳєѣѧʌ џ ʍѳґƴ ҁκѧӡѧϯƀ ѳđʜѳ ѳʜѧ ѣƀӀʌѧ ʜѧҁϯѳʌƀκѳ ⱀѧӡʙⱀѧϯʜѳӣ ɯʌѥχѳӣ ӌϯѳ ҁѳҁѧʌѧ ʍʜє χƴӣ đѧѫє ʜѧ ʌѧʜӌє',
'[ 먔🪽 ] ʍѳѫєϯ ϯʙѳᴙ ʍѧϯƀ đʌᴙ ϯєѣᴙ џ ʌƴӌɯѧᴙ ʜѳ ʍƀӀ ѣƴđєʍ ӡʜѧϯƀ ʙҁєґđѧ ӌϯѳ ҁ ʍѳєґѳ χƴᴙ ѳʜѧ ʙƀӀƴӌџʌѧҁƀ κѧӡѧϯƀ ѳѣⱀѧӡѳʙѧʜʜѳӣ',
'[ 먔🪽 ] џ ӌё ϯʙѳᴙ ʍѧϯƀ ʍʜє ҁѳҁёϯ ѧ ϯƀӀ ʜєʍѳѱƀ đѧѫє ʜє ʍѳѫєɯƀ єё ӡѧʍєʜџϯƀ',
'[ 먔🪽 ] ϯƀӀ ӌё ѣʌᴙϯƀ ᴙ ѱѧ ϯʙѳѥ ʍѧϯƀ ʙ πєⱀđѧκ χƴᴙⱀѥ ѧ ѳʜѧ πƀӀϯѧєϯƀҁᴙ κƴđѧ ϯѳ ƴѣєѫѧϯƀ',
'[ 먔🪽 ] ʜє ʍѳґƴ πѳʜᴙϯƀ πѳӌєʍƴ ϯʙѳᴙ ʍѧϯƀ ʜѧ ҁϯѳʌƀκѳ ƴҁєⱀđʜѳ ҁѳҁёϯ ʍѳӣ χƴӣ κ ӌєʍƴ ѳʜѧ ҁϯⱀєʍџϯƀҁᴙ',
'[ 먔🪽 ] ƴѫє ҁѣџʌҁᴙ ҁ ӌёϯƴ ҁκѳʌƀκѳ ᴙ єѣѧʌ ϯʙѳѥ ʍѧϯƀ ʜѧđѳ ҁπⱀѳҁџϯƀ ƴ ϯʙѳєґѳ ѳϯҵѧ ʙєđƀ ѳʜ đⱀѳӌџʌ ʜѧ ϶ϯѳ',
'[ 먔🪽 ] ϯʙѳӣ ѳϯєҵ đѧʙʜѳ ƴѫє ƴχѳđџ ҁ κʙѧⱀϯџⱀƀӀ џ ѫđёϯ πѳκѧ ᴙ πѳєѣƴ ϯʙѳѥ ʍѧϯƀ ѧ πѳϯѳʍ πⱀџχѳđџϯ κѧκ ʜє ʙ ӌёʍ ʜє ѣƀӀʙѧʌ ѳʌƴχ ϯƀӀ єѣѧʜƀӀӣ',
'[ 먔🪽 ] ᴙ єѣѧʌ ϯʙѳѥ ʍѧϯƀ πѳκѧ ϶ϯѳ ʜє ҁϯѧʌѳ ʍєӣʜҁϯⱀџʍѳʍ ⱀџʌџ',
