'[ 먔🪽 ] ∏ѳ ϯєʌџκƴ κҁϯѧϯџ ϯʙѳѥ ʍѧϯƀ ʙџđєʌ ѳʜѧ ѳπᴙϯƀ ʙƀӀџґⱀѧʌѧ χџϯ-πѳⱀѧđ πⱀѳҁϯџϯƴϯѳκ ϯʙѳєґѳ ґѳⱀѳđѧ đѧ πⱀєđҁϯѧʙʌᴙєɯƀ ѣƀӀʌџ đѧѫє ҁѳⱀєʙʜѳʙѧʜџᴙ ґđє ϯʙѳᴙ ʍѧϯƀ πѳπєⱀχʜƴʌѧҁƀ ϯⱀєʍᴙ ӡѧʌƴπѧʍџ ʜѳ ʙҁє ϯѧκџ ѳϯҁϯѳᴙʌѳ đѳҁϯѳӣʜʜѧ ҁʙѳє ʍєҁϯѳ ʙ ҁπџҁκє ѣʌᴙđєӣ.',
'[ 먔🪽 ] ∏ⱀџɯєʌ κ ϯʙѳєӣ ʍѧϯєⱀџ ҁπⱀѳҁџϯƀ κѧκ ѫџӡʜƀ ʜѳ ѳʜѧ đѧѫє ʜє ʙƀӀҁʌƴɯѧʙ ʍєʜᴙ πѳπⱀѳҁџʌѧ ѳϯπѳⱀѳϯƀ єё ʜѧ κⱀʙѧϯџ ʜѳ κѧκ ʍѳѫʜѳ єѣѧϯƀ ϯʙѳѥ ʍѧϯƀ џ ѳđʜѳʍƴ κѳʜєӌʜѳ ѫє ᴙ πѳӡʙѧʌ đⱀƴӡєӣ џ ʙѳϯ ϯѳґđѧ ʍƀӀ ƴѫє đⱀƴѫʜѳ ʙӡđєⱀʜƴʌџ єё.',
'[ 먔🪽 ] ⴼє ʙєđџҁƀ ʜѧ ⱀѧʙѳđκџ ϯʙѳєӣ ʍѧϯєⱀџ ϯџπѳ ѳʜѧ ʜє ɯʌѥχѧ ϶ϯѳ πⱀѳҁϯѳ ѫџӡʜƀ ϯѧκѧᴙ đѧ ʜєϯ єӣ ʙ κѧӣѻ ѳϯҁѧҁƀӀʙѧϯƀ ѣѳʍѫѧʍ џ ʙҁєʍ πѳđⱀᴙđ ʜє ҁƴđџϯє єє ҁϯⱀѳґѳ πⱀѳҁϯѳ ѳʜѧ πⱀџⱀѳѫđєʜʜѧᴙ πⱀѳҁϯџϯƴϯκѧ ʜє ӌєґѳ ѣѳʌєє ᴙ đƴʍѧѥ ҁʜѳʙѧ єѣѧʜƴϯƀ єӣ ҁʍѧӌʜѳґѳ ʌєѱѧ',
'[ 먔🪽 ] ⴼєʌƀӡᴙ πєⱀєχѳđџϯƀ đѳⱀѳґƴ ϯʙѳєӣ ʍѧϯєⱀџ ʙєđƀ єҁʌџ ϯƀӀ πѳπⱀѳѣƴєɯƀ ʜѧӡʙѧϯƀ єё ɯʌѥχѳӣ ѳʜѧ ʜѧӌʜєϯ đѳκѧӡƀӀʙѧϯƀ ѳѣⱀѧϯʜѳє џ ʙҁє κѧκ ʙҁєґđѧ ӡѧκѳʜӌџϯƀҁᴙ πѳⱀєʙѳʍ ѧ πѳϯѳʍ ѳʜѧ ҁκѧѫєϯ πⱀѳҁϯџ ᴙ ʜє χѳϯєʌѧ πⱀѳҁϯѳ πⱀџʙƀӀκʌѧ ӌϯѳ κѳґđѧ ʜѧ ʍєʜᴙ κⱀџӌѧϯ ʜѧđѳ đѧϯƀ ʙ ѫѳπƴ.',
'[ 먔🪽 ] Ҁϯѳᴙʌ ҁπѳκѳӣʜʜѳ κƴⱀџʌ џ ϯƴϯ πѳđѣєґѧєϯ ϯʙѳᴙ ʍѧϯƀ ᴙ đѧѫє ʜє ƴӡʜѧʌ єє ҁⱀѧӡƴ ґѳʙѳⱀѥ ӌϯѳ ʙѧʍ ʜѧđѳ џ ѳʜѧ ѳϯʙєӌѧєϯ ӡѧ ҁџґѧⱀєϯƴ ѳϯҁѳҁƴ џ ϯѳґđѧ ᴙ πѳʜᴙʌ ӌϯѳ ϶ϯѳ ϯʙѳᴙ ʍѧϯƀ џ πⱀѳҁϯѳ ӡѧҁϯѧʙџʌ ҁđєʌѧϯƀ єё ѳϯҁѳҁ єѱє ѣʌᴙϯƀ ᴙ ϶ϯѳӣ ɯѧʌѧʙє ҁџґѧⱀєϯƀӀ ʜє đѧʙѧʌ.',
'[ 먔🪽 ] Ҁѣⱀѧʌҁᴙ ѳґⱀѳʍʜƀӀӣ ҁϯѳʌ џ ӡѧ ϶ϯџʍ ҁϯѳʌѳʍ ʍƀӀ ⱀєɯџʌџ κѧκ ѣƴđєʍ ⱀѧҁπⱀѳҁϯⱀѳʜᴙϯƀ ϯʙѳѥ ʍѧϯƀ ʙ ʍѧҁҁƀӀ џ ϯѳґđѧ ʜѧʍ πⱀџɯʌѧ џđєᴙ πƴҁϯџϯƀ єё ʙ κѧκѳӣ ʜџѣƴđƀ ѣѳʍѫѧϯʜџκ ʙєđƀ κѧκ ʍƀӀ ҁӌџϯѧєʍ єӣ ϯѧʍ ҁѧʍѳє ʍєҁϯѳ đѧ џ ϯєʍ ѣѳʌєє ѳπƀӀϯѧ ϯѧʍ ʜѧѣєⱀєϯƀҁᴙ.',
'[ 먔🪽 ] ⴼє ѳҁϯѧʙʌᴙӣ ʜѧ ӡѧʙϯⱀѧ ϯѳ ӌϯѳ ʍѳѫєɯƀ ҁđєʌѧϯƀ ҁєґѳđʜᴙ ϯѧκ ʍʜє ҁκѧӡѧʌѧ ϯʙѳᴙ ʍѧϯƀ πѳҁʌє ӌєґѳ πⱀџɯʌѳҁƀ єё ʙƀӀєѣѧϯƀ ʙєđƀ κѧκ ʍʜє κѧѫєϯƀҁᴙ ϯѧκѧᴙ ɯʌѥχѧ κѧκ ѳʜѧ ϯѳӌʜѳ πʌѳχѳ ʜє πѳҁѳʙєϯƴєϯ ʌџɯƀ ѣƀӀ ҁπџđѳʍ ʜє ӡѧӡѧӡџϯƀҁᴙ ҁʌѧʙѧ ѣѳґƴ єҁϯƀ ⱀєӡџʜκџ κѳϯѳⱀƀӀє ѳʜѧ ʙӡᴙʌѧ ƴ ϯʙѳєґѳ ѣѧϯџ.',
'[ 먔🪽 ] Ɓ ⱀєѧʌƀʜѳӣ ѫџӡʜџ ϯʙѳᴙ ʍѧϯƀ ʜє ϯѧκѧᴙ κѧκ ʙ џʜϯєⱀʜєϯє ϯ.є ʙ џʜєϯє ѳʜѧ πџɯєϯ ӌϯѳ џѱєϯ ҁєⱀƀёӡʜƀӀє ѳϯʜѳɯєʜџє џ ϯѧκ đѧʌєє ʜѳ ʙ ѫџӡʜџ ʙҁё ҁѳʙҁєʍ πѳ đⱀƴґѳʍƴ ʙєđƀ ѳʜѧ ʙ ѫџӡʜџ ʙҁё ӌϯѳ đєʌѧєϯ ϶ϯѳ ҁѳҁёϯ ʜѧʍ ӡѧ ҁʙѳё ʍєҁϯѳ πѳđ ҁѳʌʜҵєʍ.',
'[ 먔🪽 ] ⴼє κƴⱀџ πѳҁʌє ҁʙѳєӣ ʍѧϯєⱀџ ѣƀӀӌκѧҁѳҁ ʍѧʌѳʌєϯʜџӣ ʙєđƀ ӡʜѧєɯƀ ӌϯѳ κƴⱀџϯƀ πѳҁʌє đѧʙѧʌѳκ ҁӌџϯѧєϯƀҁᴙ πʌѳχџʍ πѳⱀѳґѳʍ ʌƴӌɯє đѧӣ єӣ ʜѧ ⱀѳϯѧ џ џđџ κƴπџ ʜѳⱀʍѧʌƀʜƀӀχ ҁџґѧⱀєϯ џ ʜє đѧʙѧӣ ҁʙѳєӣ ʍѧϯєⱀџ єё ѫџⱀʜƀӀʍџ πѧʌƀҵѧʍџ đѧѫє πⱀџκѳҁʜƴϯƀҁᴙ κ πѧӌκџ.',
'[ 먔🪽 ] ∏єⱀʙƀӀӣ џ πѳҁʌєđʜџӣ ⱀѧӡ ᴙ πѳʙєⱀџʌ ϯʙѳєӣ ʍѧϯєⱀџ ʙєđƀ ϶ϯѧ ѣʌᴙđѳʙκѧ ҁκѧӡѧʌѧ ӌϯѳ єё єѣѧʌџ ʜє ѣѳʌƀɯє ϯƀӀҁᴙӌџ ʌѥđєӣ ʜѳ ʜѧ đєʌє ѳκѧӡѧʌѳҁƀ ӌϯѳ єё đⱀѧʌџ πѳʌ ґѳⱀѳđѧ џ đѧѫє κѧѫđƀӀӣ πѳđϯʙєⱀđџʌ ʍƀӀ ʍѳѫєʍ ƴҁⱀѧџʙѧϯƀ ҁχѳđκƴ ёѣƀӀⱀєӣ ϯʙѳєӣ ʍѧʍƀӀ.',
'[ 먔🪽 ] ∏ёϯⱀ 1 ϯѧκ ӡʙѧʌџ πєⱀʙѳґѳ ёѣƀӀⱀᴙ ϯʙѳєӣ ʍѧʍκџ ϯƀӀ đѳʌѫєʜ єґѳ ӡʜѧϯƀ ʙєđƀ ʙƀӀ πⱀѳχѳđџʌџ єґѳ ʙ ɯκѳʌє џ ϯƀӀ πѳʜџʍѧєɯƀ ʜѧҁϯѳᴙѱџѥ πⱀџӌџʜƴ єґѳ ҁʍєⱀϯџ ѳʜ ѣƀӀʌ χѳⱀѳɯџʍ џʍπєⱀѧϯѳⱀѳʍ ʜѳ κѳґđѧ ϯʙѳᴙ ʍѧϯƀ ҁϯⱀєʍџʌѧҁƀ ҁđєʌѧϯƀ єʍƴ ѳϯҁѳҁ κѧѫđƴѥ ҁєκƴʜđƴ πⱀѳҁϯџϯє ӡđєҁƀ ʌѥѣѳӣ ҁκѳʜӌѧєϯƀҁᴙ.',
'[ 먔🪽 ] Ƴѫє πѳɯʌџ πєҁʜѥ πⱀѳ ϯʙѳѥ ʍѧϯƀ ʜє ϯѳ ӌϯѳ ӌѧҁϯƴɯκџ ʙ ϶ϯџχ πєҁʜᴙχ πѳёϯƀҁᴙ ѳ ⱀѧӡѳӌєⱀѳʙѧʜџє ʙєđƀ ʙҁє đƴʍѧʌџ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ πⱀѳҁϯѳ єѣѧʜʜѧᴙ πѳđҁϯџʌκѧ ʜѳ πѳҁʌє ϯѳґѳ κѳґđѧ ѳʜџ ƴӡʜѧʌџ ӌϯѳ ѳʜѧ đѧʙѧʌѧ đѧѫє ѣєґєʍѳϯƴ ʜєϯ ʜƴ πⱀѳҁϯџϯє ϶ϯѳ ҁʌџɯκѳʍ.',
'[ 먔🪽 ] ⴼє ʙєɯѧӣ ʜѳҁ ʍѳѫєϯ єѱё ʙҁё џӡʍєʜџϯƀҁᴙ ʙ ʌƴӌɯƴѥ ҁϯѳⱀѳʜƴ πѳџѱџ ʙ ҁʙѳєӣ ʍѧʍє χѳⱀѳɯџє ҁϯѳⱀѳʜƀӀ ʙєđƀ ѳʜџ đѳʌѫʜƀӀ ѣƀӀϯƀ ʙѳϯ πⱀџʙєđƴ πⱀџʍєⱀ ϯʙѳᴙ ʍѧϯƀ ҁѳҁєϯ κѧѫđѳʍƴ ϯєʍ ҁѧʍƀӀʍ đєʌѧᴙ đѳѣⱀѳ ʍѳѫєɯƀ ʜѧӡƀӀʙѧϯƀ єё ѣѳґџʜєӣ đѳѣⱀѧ.',
'[ 먔🪽 ] Ѧ ϯƀӀ đƴʍѧʌ ӌϯѳ ᴙ ʜє πⱀџđƴ џ ʜє ʜѧҁҁƴ ϯʙѳєӣ ʍѧϯєⱀџ ʜѧ єѣʌєϯ ϯƀӀ ҁџʌƀʜѳ ѳɯџѣѧʌҁᴙ ʙєđƀ πѳҁʌє ҁʌѳʙ ӌϯѳ ᴙ ʜє đѳҁϯѳџʜ ϯѳґѳ ӌϯѳѣƀӀ πⱀџđƴɯџϯƀ єё χƴёʍ ᴙ ѳӌєʜƀ ⱀѧӡѳӡʌџҁᴙ πѳҁʌє ϯѳґѳ κѧκ ᴙ єё ѳϯπџʜѧʌ ʜѳґѧʍџ ѳʜѧ χѳđџϯ ϯєπєⱀƀ ϯѳʌƀκѳ ʜѧ πѳʙѳđκє.',
'[ 먔🪽 ] Ҟѳґđѧ ϯʙѳᴙ ʍѧϯƀ κџʜƴʌѧ ӡџґƴ ᴙ ƴѫє πѳʜᴙʌ ӌϯѳ ϶ϯѳ ɯκƴⱀѧ ʜѧҵџҁϯҁκѧᴙ џ єё ʍѳѫʜѳ πєⱀđѳʌџϯƀ χѳϯƀ 24 ӌѧҁѧ ʙ ҁƴϯκџ ʜѳ ⱀєɯџʌ πⱀѳʙєⱀџϯƀ ϯѧκ ҁκѧӡѧϯƀ ʜѧ ѫџʙҵѧ κџʜƴʌ ⱀєӡџʜѳʙƀӀӣ ҁϯⱀѧπѳʜ џ πⱀєđҁϯѧʙʌᴙєɯƀ ѳʜѧ κџʜƴʌѧҁƀ ʜѧ ʜєґѳ κѧκ ҁѳѣѧκѧ єѣѧʜʜѧᴙ.',
'[ 먔🪽 ] Λџɯƀ ѣƀӀ ҁʜѳʙѧ ҁєґѳđʜᴙ ʜє ʙҁϯⱀєϯџϯƀҁᴙ ҁ ϯʙѳєӣ ʍѧϯєⱀƀѥ ʙєđƀ ҁѧʍ πѳʜџʍѧєɯƀ ϯᴙѫєʌѳ ϯєⱀπєϯƀ ҁѳϯƀӀӣ ѳϯҁѳҁ ʙ đєʜƀ ʜѧ ҁѧʍѳʍ đєʌє ᴙ ƴѫє ʜѧӌџʜѧѥ єё ѣѳᴙϯƀҁᴙ ʍѧʌѳ ʌџ ѳʜѧ ʙƀӀҁκѳӌџϯ џӡ ӡѧ ƴґʌѧ џ ʜѧӌʜєϯ ʜѧᴙⱀџʙѧϯƀ ґƴѣѧʍџ ʍѳӣ χƴӣ ʜѧđѳ ѳҁϯєⱀєґѧϯƀҁᴙ.',
'[ 먔🪽 ] ᛖƀӀ ӡđєҁƀ ʌџɯƀ đʌᴙ ϯѳґѳ ӌϯѳѣƀӀ đѳκѧӡѧϯƀ ӌϯѳ ⱀѳϯ ϯʙѳєӣ ʍѧʍƀӀ ʜє ϯѳʌƀκѳ đʌᴙ єđƀӀ ϶ϯѳ ʙϯѳⱀѳҁϯєπєʜʜѳ ѧ ʜѧᴙⱀџʙѧϯƀ ʜѧɯџ ӡѧʌƴπƀӀ ѳʜѧ đѳʌѫʜѧ џʜҁϯєʜκϯџʙʜʜѳ ӡʜѧєɯƀ κѧκ ⱀєѻʌєκҁ єё πѧʍᴙϯƀ ӡѧϯƴʍѧʜџʌѳ џ ʙҁё ӌϯѳ ѳʜѧ ӡʜѧєϯ κѳʍѧʜđƴ ҁѳҁѧϯƀ.',
'[ 먔🪽 ] ∏ѳđʙєđёʍ џϯѳґџ ӡѧ ϶ϯѳϯ ʍєҁᴙҵ ӌϯѳ ҁđєʌѧʌѧ ϯʙѳᴙ ʍѧʍѧ đѧ єҁʌџ ϯѧκ ѣⱀѧϯƀ ʙⱀѳđє џ ʜџӌєґѳ ʙ ґʌѳѣѧʌƀʜѳʍ ʍѧҁɯϯѧѣє ʜѳ ʙҁє ϯѧκџ ѳʜѧ πѳπⱀѳѣƀӀʙѧʌѧ ʜѧ ʜѧɯєʍ ⱀѧӣѳʜє ҁѧʍƀӀє ⱀѧӡʜƀӀє ʙκƴҁƀӀ ӡѧʌƴπ џ ӡʜѧєɯƀ ϶ϯѳ ʜѧʙєⱀʜѳ ʜєπʌѳχѳ.',
'[ 먔🪽 ] ∏ѳκѧ ϯƀӀ ϯѧʍ ҁϯƴӌџɯƀ πѳ κʌѧʙџɯѧʍ ᴙ ƴѫє ӡѧκџđƀӀʙѧѥ ʜѧ ⱀѳϯ ϯʙѳєӣ ʍѧʍɯџ ѳπⱀѧʙđƀӀʙѧӣҁᴙ ҁκѳʌƀκѳ χѳӌєɯƀ ʜѳ ϯєѣє ʜє џӡєѫѧϯƀ ѻѧκϯѧ ϯѳ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ɯѧʌѧʙѧ єѣʌџʙѧᴙ џ ҁѳӡđѧʜʜѧ ϯѳʌƀκѳ đʌᴙ ʜѧҁ џ đʌᴙ ʜѧɯєґѳ κⱀƴґѧ ѳѣѱєʜџᴙ.',
'[ 먔🪽 ] Ϯєⱀπџʌѧ ϯƀӀ єѣѧʜʜѧᴙ ʍѳѫєɯƀ đѧʌƀɯє ґѳʙѳⱀџϯƀ ӌϯѳ ϯʙѳѥ ʍѧϯƀ ʜє κϯѳ ʜє єѣѧʌ ᴙ ʍѳґƴ πⱀᴙʍ ҁєӣӌѧҁ πⱀџϯѧѱџϯƀ єё ӡѧ ɯκџⱀᴙϯʜџκ џ ѳʜѧ ѣƴđєϯ ƴʍѧʌᴙϯƀ ʜѧ κѳʌєʜᴙχ ӌϯѳѣƀӀ ᴙ ʜєʍʜѳѫκѳ πѳʍѧҁџⱀѳʙѧʌ єё ⱀѳϯ ӡѧʌƴπѳӣ ʍƴđѧκ ϯƀӀ єѣѧʜʜƀӀӣ.',
'[ 먔🪽 ] Ɓ κѧѫđѳʍ ʍџⱀє єҁϯƀ ϯѧκѧᴙ ϶єʜѱџʜѧ κѳϯѳⱀѧᴙ ӡѧ ґⱀѳɯџ ґѳϯѳʙѧ ʙӡᴙϯƀ ʙ ⱀѳϯ ʜѳ ʜє ϯʙѳᴙ ʍѧʍѧ єӣ ʙѳѣѱє ʜє ʜƴѫʜƀӀ đєʜƀґџ ϯѳʌƀκѳ ʌџɯƀ ѳѣєѱѧʜџᴙ ӌϯѳ ʙ ѣƴđƴѱєʍ ϯƀӀ ʍѳѫєϯ ѣƀӀϯƀ πѳєѣёɯƀ єё єѱё ѳʜѧ ʙҁєґđѧ ʙєⱀџϯ ʜѳ ʜє κϯѳ πѳʙϯѳⱀʜѳ єё ʜє ʙƀӀπѳⱀѳʌ.',
'[ 먔🪽 ] ∏ѳ ϯʙѳєʍƴ ʙџđƴ ʙџđʜѳ ӌϯѳ ϯƀӀ ӡѧѫѧϯƀӀӣ ѣєđѳʌѧґѧ κѳϯѳⱀƀӀӣ đѧѫє ʜє ʍѳѫєϯ πѳҁϯѳᴙϯƀ ӡѧ ҁʙѳѥ ʍѧʍѧʜѥ ѧ ӌϯѳ єҁʌџ ᴙ ҁєӣӌѧҁ ʙѳӡƀʍƴ χƴӣ џ πⱀѳπџχʜƴ єӣ ʙ ґʌѳϯκƴ ӌϯѳ ϯƀӀ ѣƴđєɯƀ đєʌѧϯƀ đѧ ʙҁє ӡʜѧѥϯ ӌϯѳ ϯƀӀ πѳӡѳʙʜџɯƀ πѧπє ʜѳ ѳʜ ѳπᴙϯƀ πⱀџєđєϯ џ ӡѧʍєʜџϯ єё.',
'[ 먔🪽 ] đѧ ᴙ ϯʙѳѥ ʍѧϯƀ κƴⱀѧπѧκƴ ʙʜѧϯƴⱀє єѣѧʌ πѳʌӡџ ʜѧχƴӣ ѳϯ ҁѥđѧ đⱀƀӀѱ єѣѧʜʜƀӀӣ',
'[ 먔🪽 ] ᴙ ϯʙѳєӣ ʍѧϯєⱀџ χƴёʍ ѱѧҁ πѳ ⱀƀӀʌƴ ҁъєӡѫƴ ҁʌѧѣѧκ єѣʌџʙƀӀӣ đѧʙѧӣ ҁѳҁџ ʍʜє ϯƴϯ џ ϯѳʌƀκѳ πѳπⱀѳѣƴӣ ѳϯκџʜƴϯƀҁᴙ џӡ ϶ϯѳӣ κѳʜѻєⱀєʜҵџџ',
'[ 먔🪽 ] đѧ ᴙ ѱѧҁ ϯʙѳѥ ʍѧϯƀ ϯƴϯ ӌπѳκʜƴ ϯƀӀ πѳʜџʍѧєɯƀ ϶ϯѳ πѳɯёʌ ʜѧχƴӣ ѳϯ ҁѥđѧ πѳκѧ ᴙ ϯєѣє πѧϯʌџ ϯƴϯ ʜє πєⱀєʌѳʍѧʌ',
'[ 먔🪽 ] ᴙ ϯєѣє ʙʜѧϯƴⱀє ʜѧ κʌƀӀκ ѱѧҁ κџʜƴ ҁʌѧѣѧκ đѧʙѧӣ πⱀџđџ ʙ ҁєѣᴙ џ đѧӣ ѳϯπѳⱀ ʍʜє ϯƴϯ',
'[ 먔🪽 ] κƴⱀџҵѧ єѣѧʜʜѧᴙ ϯƀӀ ⱀєɯџʌ џӡ ϶ϯѳӣ κѻ κѧκ ʙƀӀѣⱀѧϯƀҁᴙ єҁʌџ ᴙ ҁ ѣⱀѧϯκѧʍџ ʙʜѧϯƴⱀє ѳϯ ϯєѣᴙ ϯƴϯ ʜє χƴᴙ ʜє ѳҁϯѧʙʌѥ',
'[ 먔🪽 ] ѣƴđƀ κѧκ ᴙ ʙѳϯ πⱀџɯёʌ đѧʌ ϯʙѳєӣ ʍѧϯєⱀџ ʜѧ ⱀѳϯѧʜ ӌё єѱё ʙ ѫџӡʜџ ʜѧđѳ џʌџ ϯƀӀ ⱀєɯџʌ ƴ ʍєʜᴙ ʜѧ ⱀѳϯѧʜ ʙӡᴙϯƀ ɯƴϯʜџκ єѣѧʜʜƀӀӣ',
'[ 먔🪽 ] ʜє ѣƴđєʍ πєⱀєχѳđџϯƀ ʜѧ ʌџӌʜѳҁϯџ ᴙ πⱀѳҁϯѳ ϯʙѳѥ ʍѧϯƀ єѣѧʌ ʙʜѧϯƴⱀє',
'[ 먔🪽 ] ᴙ κѳґđѧ ϯʙѳѥ ʍѧϯƀ ʙҁϯⱀєϯџʌ πєⱀєπƴϯѧʌ єё ҁ ҁѳѣѧκѳӣ єѣѧʜʜѳӣ ϯƀӀ πⱀџκџʜƀ',
'[ 먔🪽 ] ᴙ πѳӌєʍƴ ϯѳ ʜє ⱀєɯѧʌҁᴙ πѳđѳӣđϯџ κ ϯʙѳєӣ ʍѧϯєⱀџ κѧκ ϯѳ ӡѧѳѳѣѱѧϯƀҁᴙ ʜѳ ʙ џϯѳґє πѧҵѧʜƀӀ ҁκѧӡѧʌџ ӌϯѳ ѳʜѧ ɯѧʌѧʙѧ єѣѧʜʜѧᴙ џ ᴙ ѣєӡ ʙҁᴙκџχ ʜєϯ ʙƀӀєѣѧʌ єё',
'[ 먔🪽 ] ʜє πⱀєđҁϯѧʙʌᴙѥ κѧκ ᴙ ѣƴđƴ єҁʌџ ϯʙѳᴙ ʍѧϯƀ ƴʍⱀєϯ ϶ϯѳ πѳʌƴӌѧєϯƀҁᴙ ᴙ ʜє ҁʍѳґƴ πѳӡʙѳʜџϯƀ џ ҁκѧӡѧϯƀ đѧʙѧʌκѧ єѣѧʜʜѧᴙ đѧʙѧӣ πⱀџѣєґѧӣ ʍƀӀ ϯєѣᴙ ʙƀӀєѣѧϯƀ χѳϯџʍ',
'[ 먔🪽 ] ϯƀӀ ӌё ҵѧπʌᴙ єѣѧʜʜѧᴙ ᴙ ʙ ϶ϯѳӣ κѻ ѳϯ ϯєѣᴙ ϯƴϯ ʜє χƴᴙ ʜє ѳҁϯѧʙʌѥ ҁѳѣѧκѧ ϯⱀѧʙʍџⱀѳʙѧʜʜѧᴙ ϯƀӀ πƴϯџ ѳϯχѳđѧ đѧʙѧӣ џѱџ',
'[ 먔🪽 ] ʜє πⱀѳҁϯѳ ᴙ ϯʙѳѥ ʍѧϯƀ єѣѧʌ ʍʜє ґѳʙѳⱀџʌџ єѣѧϯƀ ѳʜѧ đѫџʜ ʙ џϯѳґє ᴙ єё ӡѧ đѫџʜϯѳʜџκ ʙƀӀєѣѧʌ',
'[ 먔🪽 ] ϯƀӀ đѧʙѧӣ єѣѧϯƀ ʜє ѳπⱀѧʙđƀӀʙѧӣҁᴙ ѳϯκⱀƀӀʙѧӣ ⱀѳϯ ᴙ ѱѧҁ ϯєѣє πѧđʌѧ ґʌѧʜđƀӀ ϯƴϯ ӡѧʌƀѥ',
'[ 먔🪽 ] đѧʙѧӣ ᴙ ϯʙѳѥ ӡѧđʜџҵƴ ɯѧκѧʌѧ єѣѧʜʜƀӀӣ ѱѧҁ ϯƴϯ ⱀѧӡđџⱀѧϯƀ ѣƴđƴ ϯƀӀ ʙʜѧϯƴⱀє ⱀєɯџʌ ʍєʜᴙ ѳҁџʌџϯƀ',
'[ 먔🪽 ] ϯʙѳӣ ґѳʌџʍƀӀӣ đđ ϯƴϯ џ ʍєҁᴙҵѧ ʜє πⱀѳҁϯѳџϯ ϯƀӀ ʙѳѳѣѱє ɯѧⱀџɯƀ ҁ κєʍ ҁʙᴙӡѧʌҁᴙ ʍѧʌƀӀɯƀ',
'[ 먔🪽 ] ϯƀӀ ѳπᴙϯƀ ѣⱀƴӌєʜʜƀӀӣ đđ ʙӡᴙʌ ϯѳʌƀκѳ πѳϯѳʍ ʜє πʌѧӌƀ ʍʜє ʙ ʌҁ ӌϯѳ πⱀѳҁϯѳ ɯѧѣʌƀӀ πєⱀєҁϯѧʙʌᴙʌ',
'[ 먔🪽 ] ʜƴ ѫє ᴙ ѱѧҁ ѳϯ ϯʙѳєӣ ґѳʌѳʙƀӀ ʜє χƴᴙ ʜє ѳҁϯѧʙʌѥ ѳπᴙϯƀ ѣƴđєɯƀ ƴ ʍєʜᴙ πⱀѳҁџϯƀ ӡѧ ϯєѣᴙ đđ πѳҁϯѧʙџϯƀ',
'[ 먔🪽 ] đѧ ҁƀӀʜ ɯʌѥχџ єѣѧʜʜƀӀӣ ϯƀӀ đѧѫє єҁʌџ ʙєҁƀ κѳɯєʌёκ ʍѧʍκџʜ ʙƀӀʙєⱀʜџɯƀ ƴ ϯєѣᴙ ʜє χʙѧϯџϯ πѳӡʙѳʌџϯƀ ҁєѣє ʍѳӣ đđ',
'[ 먔🪽 ] đѧ ᴙ ϶κҁϯѧӡ єѣѧʌ ɯѧⱀџɯƀ ӌϯѳ ϯƀӀ ϯƴϯ ʍʜє ʍѳѫєɯƀ ҁκѧӡѧϯƀ ʙєđƀ ᴙ џ ϯʙѳё ⱀƀӀʌѳ ʜѧ 3 ҁϯѳⱀѳʜƀӀ ʙƀӀʙєⱀʜƴ',
'[ 먔🪽 ] ʜƴ ѫє ѳπⱀѧʙđѧӣ ҁєѣє ϯєʍ ӌϯѳ ϯʙѳӣ đđ ѳχƴєʜʜƀӀӣ ʜѳ πⱀѳҁϯѳ ѣѳϯ ґѳʙʜѳ đѧ ᴙ ϯʙѳѥ ʍѧϯƀ єѣѧʌ',
'[ 먔🪽 ] ʜє ѣƴđƀ ѻѧⱀɯʍѧκѳʍ ʙѳӡƀʍџ ҁєѣᴙ ʙ ⱀƴκџ џ πʌѥʜƀ ʙ єѣѧʌѳ ϶κҁϯѧӡƴ ƴҁϯⱀџҵѧ єѣѧʜʜѧᴙ',
'[ 먔🪽 ] ʜє ʙʜѧϯƴⱀє ᴙ ѱѧҁ ⱀѧӡʍѧχʜƴҁƀ џ ʙъєѣƴ ѳπʌєʙƴχƴ ϯʙѳєӣ ʍѧϯєⱀџ χƴʌџ ѳʜѧ ʍѳё ӌҁʙ ϯƴϯ ҁѣџʙѧєϯ',
'[ 먔🪽 ] ᴙ ϯєѣᴙ ѳѣџđєʌ ϯєʍ ӌϯѳ ᴙ ʙƀӀєѣѧʌ ϯʙѳѥ ʍѧϯƀ ϯѳґđѧ πѳʌƴӌѧєϯƀҁᴙ ϯєѣᴙ ѳѣџđєʌ ʙєҁƀ ⱀѧӣѳʜ ӌϯѳ ʌџ ҵѧπʌᴙ єѣƴӌѧᴙ',
'[ 먔🪽 ] ʜƴ ѫє đѧʙѧӣ ҁκѧѫџ ʍʜє ӌϯѳ ʜџѣƴđƀ πѳκѧ ᴙ χѧⱀκѧѥ ʙ єѣѧʌѳ ϯʙѳєӣ ʍѧϯєⱀџ џʌџ ѳπᴙϯƀ ʜѧӌʜёɯƀ ґѳʙѳⱀџϯƀ πⱀѳ ϯѳπѳπʙƀӀє đєđџκџ',
'[ 먔🪽 ] đѧ ϯƀӀ ӡʜѧєɯƀ κϯѳ ӡѧ ʍєʜᴙ ҁϯѳџϯ đѧ ʍѳӣ đđ ґѳđ ҁϯѳџϯ ҁʌƀӀɯџɯƀ ҁʌѧѣѧκ ϯѧκ ϯƀӀ ѫє ʍʜє ʙҁє ⱀѧʙʜѳ ʙ ϶ϯѳӣ κѻ ѳϯκџʜєɯƀҁᴙ ӡѧ ʜєđєʌѥ',
'[ 먔🪽 ] ʜƴ ѫє πѳъᴙҁʜџ ʍʜє χѳϯᴙ ѣƀӀ ӡѧ ϯѳ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ƴ κѧѫđѳґѳ πⱀѳχѳѫєґѳ ʙ ⱀѳϯ ѣєⱀєϯ џʌџ ѳπᴙϯƀ ҁκѧѫєɯƀ ϶ϯѳ ʙҁё πѳϯѳʍƴ ӌϯѳ ʍʜє ʜƴѫєʜ ϯѳπѳʙƀӀӣ đđ',
'[ 먔🪽 ] ϯƀӀ đѧʙѧӣ ʍʜє ϯƴϯ ʜє ѳϯκџʜƀҁᴙ χѳϯᴙ ѣƀӀ ӡѧ 3 ʍєҁᴙҵѧ ѧ ϯѳ ᴙ ʙʜѧϯƴⱀє ӡѧđџѣѳɯџⱀѥ џ ϯʙѳѥ ʍѧϯƀ ʙ πƴχ џ πⱀѧχ ҁѳϯⱀƴ πⱀᴙʍ κѧκ ʍѧϯƀ ϶κҁϯѧӡџ',
'[ 먔🪽 ] ʜє ϯƀӀ ʙʜѧϯƴⱀє πѧⱀѧʙѳӡ єѣѧʜʜƀӀӣ ϯƀӀ ʜѧχƴӣ ƴ ʍѧϯєⱀџ ѣƀӀӌκџ πџӡđџɯƀ ᴙ ѫє єӣ ҁ πѧҵѧʜѧʍџ ʜѧ ⱀѳϯѧ đѧʙѧʌ ѧ ϯƀӀ πѳҁʌє ʜєё κƴⱀџɯƀ ʙѧѻёʌ єѣѧʜʜƀӀӣ',
'[ 먔🪽 ] đѧʙѧӣ ϯƀӀ ʍʜє ѱѧҁ ϯƴϯ χƴӣ ѳϯҁѳҁєɯƀ ѧ ᴙ ϯєѣᴙ ʜє ѣƴđƴ πџđѧⱀѧҁџϯƀ πѳ ʙҁєʍƴ ⱀƴʜєϯƴ ʙʜѧϯƴⱀє ѫє ʙƀӀґѳđʜѳ đʌᴙ ϯєѣᴙ ѻѧⱀɯʍѧκѧ',
'[ 먔🪽 ] ʜє ӡѧѣƴđƀ κѧκ πⱀџđєɯƀ đѳʍѳӣ ҁκѧӡѧϯƀ ҁʙѳєӣ ʍѧϯєⱀџ ӌϯѳ ᴙ єё ӌєχʌџϯƀ ѣƴđƴ џʌџ ϯƀӀ ⱀєџɯʌ ѣʌᴙϯƀ ӌϯѳ ᴙ ƴѫє ʜє єѣƴ ϯʙѳѥ ʍѧϯƀ',
'[ 먔🪽 ] đѧʙѧӣ ѱѧҁ πѳѣѧӡѧⱀџʍ ʜѧ ҁӌєϯ ϯєʍƀӀ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ɯʌѥχѧ ᴙ πѳʜџʍѧѥ ϯєѣє ʜє πⱀџᴙϯʜѳ ʜѳ єӣ ѫє πⱀџᴙϯʜѳ ӌϯѳ ʍƀӀ єё єѣёʍ',
'[ 먔🪽 ] đѧʙѧӣ ѱѧҁ ϯƀӀ ӡѧϯκʜёɯƀ ҁʙѳё єѣѧʌѳ џ πⱀѳҁϯѳ πⱀџӡʜѧєɯƀ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ɯʌѥχѧ єѣѧʜʜѧᴙ џ ӌϯѳ ϯѧκѳӣ ʙƀӀⱀѳđѳκ κѧκ ϯƀӀ єӣ ʜѧχƴӣ ʜє ҁđѧʌҁᴙ',
'[ 먔🪽 ] ʜє ѧ ϯƀӀ ӌё ѱѧҁ πⱀѳҁϯѳ ϯѧκ ʙѳӡƀʍёɯƀ ʍѳӣ χƴӣ џ ѳϯҁѳҁёɯƀ ʜƴ ϯƀӀ đѧʙѧӣ ѳѣđƴʍѧӣ ҁєⱀƀєӡʜѳ ϯѳ ӌϯѳ ᴙ πѳҁʌє ϶ϯѳґѳ ʙҁє ⱀѧʙʜѳ ʙƀӀєѣƴ ϯʙѳѥ ʍѧϯƀ',
'[ 먔🪽 ] ʜє ʜƴ ϯƀӀ  ϯєѣᴙ ʙʜѧϯƴⱀє ѱѧҁ ɯѧʍѧⱀʜƴ ϯƀӀ πѳӣđёɯƀ ʙ ʍƴҁѧⱀʜѥ ӡѧᴙʙƴ πџҁѧϯƀ πѳκѧ ᴙ ϯʙѳѥ ʍѧϯƀ єѣƴ ƴϯκѧ єѣѧʜʜѧᴙ ',
'[ 먔🪽 ] ᴙ κѳґđѧ ϯʙѳѥ ʍѧϯƀ πѳđ πⱀџχѳđѳʍ ґєⱀƀӀӌѧ єѣѧʌ ѳʜѧ κѧӡѧʌѧҁƀ κⱀѧҁџʙѳӣ ʙ џϯѳґє κѳґđѧ ʍєʜᴙ ѳϯπƴҁϯџʌѳ ᴙ ѣєѫѧʌ ʙ ҁϯⱀѧχє ѳϯ ϯʙѳєӣ ʍѧϯєⱀџ',
