'[ 먔🪽 ] ʍƀӀ κѳґđѧ ҁ đⱀƴӡƀᴙʍџ єӡđџʌџ ʜѧ ѳχѳϯƴ ѳѣєӡѧϯєʌƀʜѳ ѣⱀѧʌџ ϯʙѳѥ ʍѧϯƀ ϯƀӀ πѳƴđʍѧєɯƀ ѳʜѧ єѣƴӌџ ѳχѳϯџϯƀҁᴙ ʜє πⱀѳҁϯѳ ɯѧʌѧʙѧ ʜѧ ѳχѳϯє ʜє πѳʍєɯѧєϯ',
'[ 먔🪽 ] ʙ ⱀƴκѧχ ѧʙϯѳʍѧϯ πѳϯѳʍƴ ӌϯѳ ҁѳʌđѧϯ єѣѧʌ ϯʙѳѥ ʍѧϯƀ  џ єѣƴ πѳϯѳʍƴ ӌϯѳ ʙƀӀӣґⱀѧʌ ʙѳӣʜƴ ᴙӣҵѧ ґʌѳϯѧӣ ӡѧ ѳϯӌџӡʜƴ ҁϯⱀєʌᴙӣ',
