'[ 먔🪽 ] ϯє ӌё ӡѧʜᴙϯƀҁᴙ ʜє ӌєʍ ʙѳϯ ʍʜє єҁϯƀ ӌєʍ ѱѧҁ πѳӣđƴ κ ϯʙѳєʍƴ ѳϯҵƴ џ πѳκѧѫƴ ʙџđєѳ ґđє ϯʙѳᴙ ʍѧϯƀ ѳϯҁѧҁƀӀʙѧʌѧ ʍʜє χѳϯᴙ ϶ϯѳϯ πєϯƴχ ʙҁє ⱀѧʙʜѳ єӣ ʙҁё πⱀѳҁϯџϯ',
'[ 먔🪽 ] ʜƴ ѫє đѧʙѧӣ πѳӣʍџ ӌϯѳ ϯƴϯ ϯєπєⱀƀ ʍƀӀ ҁ ϯѳѣѳӣ đѳ ʜѳӌџ ѣƴđєʍ ϯʙѳєӣ ʍѧϯєⱀџ πџӡđєʜκƴ πѳđѫџґѧϯƀ ʙєđƀʍѧ єѣѧʜʜѧᴙ ӌє ҁϯѳџɯƀ ѣєʜӡџʜ ʜєҁџ',
'[ 먔🪽 ] ⱀѧđџ ʙѧҁ ᴙ ϯƴϯ єѱє πѳҁџѫƴ ʙєđƀ  ϯʙѳᴙ ʍѧϯƀ ϯѳѫє ʜѧ ʍєʜᴙ ҁʍѳϯⱀџϯ џ ʜє ҁѳѣџⱀѧєϯƀҁᴙ ƴχѳđџϯƀ ᴙ ϯѧκ πѳʜџʍѧѥ ҁєґѳđʜᴙ ѣƴđєϯ ʙєҁєʌѳ',
'[ 먔🪽 ] đѧ κѳʜєӌʜѳ ᴙ ʜє ʌѥѣʌѥ ϯʙѳѥ ʍѧϯƀ ʜƴ πҁѳʍϯⱀџ ʜѧ 100ⱀƴѣʌєӣ ᴙ πѳκƴπѧѥ πѧӌκƴ ҁџґѧⱀєϯ ѧ ϯƴϯ ӡѧ ҁϯѳ ⱀƴѣʌџκѳʙ ᴙ κƴπџʌ ϯʙѳѥ ʍѧϯƀ ʙ ⱀѧѣҁϯʙѳ ʜѧʙҁєґđѧ',
'[ 먔🪽 ] ⱀѧҁκџđѧѥ ϯƴϯ πѳ πʌєʜϯƴ ϯʙѳѥ ʍѧϯƀ ʙʜѧϯƴⱀє ϯєⱀѳⱀѳџҁϯƀӀ πⱀџɯʌџ џ ʜє πѳʜᴙʌџ πѳӌєʍƴ ϯʙѳᴙ πџӡđѧ ϯѳӌκƴ ѣ ʜѧκⱀƀӀʌѧ ᴙ ϯѳѫє ѣƀӀʌ ʙ ѧχƴє πѳⱀѫѧʌџ đѧ ⱀѧӡѳɯʌџҁƀ',
'[ 먔🪽 ] ʙѳϯ đѧʙѧӣ ʜє ѣƴđєʍ ґʙѳѳⱀџϯ ʜѧ ϯєʍƴ πѳʌџϯџκџ ʍƀӀ џ ϯѧκ ӡʜѧєʍ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ϯѳѫє ʙ ʜєӣ ʜє ɯѧⱀџϯ πⱀѳҁϯѳ ʌѥѣџϯ ҁѳҁѧϯƀ χƴӣ ʜƴ ҁѳҁёϯ џ ҁѳҁёϯ χƴʌє',
'[ 먔🪽 ] Ϯʙѳᴙ ʍѧϯƀ ϶ґѳџҁϯκѧ πѳ ѳϯʜѳɯєʜџѥ κ ϯʙѳєʍƴ ѣѧϯџ ʙєđƀ ʙҁєʍ ʜѧʍ ѳʜѧ ҁѳҁёϯ ѧ ѣѧϯџ đѧёϯ ϯѳʌƀκѳ ʍѳχʜѧϯκƴ πѳʌџӡѧϯƀ ʍƀӀ ⱀєɯџʌџ ӌϯѳ ϶ϯѳ ʜє πⱀѧʙџʌƀʜѳ џ ѳϯѣџʌџ єӣ ɯѧʍѧⱀѳʙ ӡѧ ϶ϯѳ ϯєπєⱀƀ ѳʜѧ ҁѳҁєϯ ϯʙѳєʍƴ ѣѧϯџ κѧκ џ ʜѧʍ ʜѳ ϯʙѳӣ ѣѧϯᴙ ϯѳѫє πѧⱀƴ ⱀѧӡ ʜѧʍ ҁѳҁѧʌ ʜѳ ϶ϯѳ ƴѫє đⱀƴґѧᴙ џҁϯѳⱀџᴙ.',
'[ 먔🪽 ] Ɓѳ ʙⱀєʍᴙ ʙѳӣʜƀӀ ϯʙѳᴙ ʍѧϯƀ ϯѳʌƀκѳ ʜѧɯџʍџ ӡѧʌƴπѧʍџ џ ҁπѧҁѧʌѧҁƀ ʜє πѳʜџʍѧѥ ӡѧӌєʍ ʜѳ ϯєⱀʌѧ ʜѧɯџ χƴџ ҁѧʌѳʍ џ ʙҁє ҁʌџӡƀӀʙѧʌѧ ӡʜѧєɯƀ ʙⱀѳđє ѳʜѧ ʜѧєđѧʌѧҁƀ ϯѧκ џ ɯʌџ ґѳđѧ ѧ ϯʙѳᴙ ʍѧϯƀ đѧѫє πѳҁʌє ϯᴙѫєʌѳґѳ ʙⱀєʍᴙ ϯѧκ џ ҁѳҁєϯ ʜѧʍ κѧκ ҁѳѣѧκѧ πѧʙʌѳʙѧ ʙʜѧϯƴⱀє ʙ πⱀџʙƀӀӌκƴ ʙѳɯʌѳ.',
'[ 먔🪽 ] Δѧѫє ∏џѻѧґѳⱀ ҁѳӡđѧʌ ϯєѳⱀєʍƴ ʜѧ ҁӌєϯ ϯʙѳєӣ ʍѧϯєⱀџ єҁʌџ ϯʙѳᴙ ʍѧϯƀ ʜѧʍ ʜє πѳҁѳҁєϯ ҁ ʜєӣ πѳ ʌѥѣѳʍƴ ӌϯѳ ʜџѣƴđƀ ҁʌƴӌџϯƀҁᴙ џ ϯєπєⱀƀ ѳʜѧ ϶ϯѳґѳ ѣѳџϯƀҁᴙ џ ѳϯҁѧҁƀӀʙѧєϯ ʜѧʍ κѧѫđƀӀӣ đєʜƀ џ ʙҁє ҁ ʜєӣ χѳⱀѳɯѳ џ ʙҁє ⱀѧđƀӀ ʙѳѣѱєʍ.',
'[ 먔🪽 ] Ɓκѧӌџʙѧᴙ ϯʙѳѥ ʍѧϯƀ џʜѻѳⱀʍѧҵџєӣ ӌϯѳ ѳʜѧ ɯʌѥχѧ ʍƀӀ ʙѳʙҁє ʜє πƀӀϯѧєʍҁᴙ єё ѳҁκѳⱀѣџϯƀ ʍƀӀ ґѳʙѳⱀџʍ ʌџɯƀ πѳ ѻѧκϯѧʍ ⱀѧӡʙє ѣƀӀ ϯƀӀ ʜє χѳϯєʌ ѳϯπєⱀđѳʌџϯƀ ϯѧκƴѥ ґʜџʌƀ κѧκ ѳʜѧ χѳϯєʌ ѣƀӀ κѳʜєӌʜѳ ʜѳ ϯƀӀ єѱё ʙєⱀџɯƀ ӌϯѳ ѳʜѧ ϯʙѳᴙ ʍѧʍѧ.',
'[ 먔🪽 ] ∏ѳ πⱀџⱀѳҁϯƴ ҁџʌ ʙ ʜѧɯџχ ӡѧʌƴπѧχ ʍƀӀ ѣєѫџʍ κ ϯʙѳєӣ ʍѧϯєⱀџ џ ѳʜѧ ҁ πѳⱀѳґѧ ʜѧӌџʜѧєϯ ϯѳⱀґѳʙѧϯƀ ҁʙѳџʍ ϯєʌѳʍ πєⱀєđ ʙҁєʍџ ʜѧʍџ џ ӡʜѧєɯƀ ʍƀӀ ʜє ӌєґѳ єӣ ʜє πʌѧϯџʍ ѳʜѧ ʜѧʍ ʙ đѳʌґ ӡѧџҁƀӀʙѧєϯ єҁʌџ ϯѧκ πѳҁӌџϯѧϯƀ ʍƀӀ ҁ ϯʙѳєӣ ʍѧϯєⱀƀѥ ʜє ⱀѧҁπʌѧϯџʍҁᴙ ʜѳ κϯѳ ҁκѧӡѧʌ ӌϯѳ ʍƀӀ ѳϯđѧđџʍ.',
'[ 먔🪽 ] Ҟѳґđѧ πⱀѳџҁχѳđџϯ ҁχѳđᴙκ ѣѧʜđџϯѳʙ ϯʙѳᴙ ʍѧϯƀ ʙҁєґđѧ ϯѧʍ ѧ ӡʜѧєɯƀ ӡѧӌєʍ πѳϯѳʍƴ ӌϯѳ ѣѧʜđџϯƀӀ ʙѳ ʙⱀєʍᴙ ʙҁϯⱀєӌ ʜѧπⱀᴙѫєʜƀӀ ѳѣҁƴѫđѧᴙ ҁʙѳџ đєʌѧ џ ϯʙѳᴙ ʍѧϯƀ ⱀѧҁʌѧѣʌᴙєϯ џχ ѳϯҁѳҁѳʍ ʜє ⱀѧӡƴ єѱё ґđє ѣƀӀʌѧ ϯʙѳᴙ ʍѧϯƀ ʜє ѣƀӀʌѳ πєⱀєҁϯⱀєʌκџ.',
'[ 먔🪽 ] Ϯʙѳᴙ ʍѧϯƀ єѣѧʜʜѳє ѫџʙѳϯʜѳє џ ӡʜѧєɯƀ ᴙ ʜє ѫєʌєѥ ӌϯѳ ϯѳґđѧ ʜѧҁѧʌ єӣ ʜѧ єѣʌєϯ ʙєđƀ ϶ϯѧ πѧⱀѧɯʜџҵѧ ⱀєɯџʌѧ ҁκѧӡѧϯƀ ӌϯѳ ϯєπєⱀƀ ʜє κѳʍƴ џӡ ʜѧҁ ҁѳҁѧϯƀ ʜє ѣƴđєϯ ƴ ʜєё ʜѳʙѧᴙ ѫџӡʜƀ џ ʙҁє đєʌѧ ʜє ʜƴ ϶ϯѳ ѣʌᴙđѳʙκѧ ѳχƴєʌѧ ҁѳґʌѧҁџҁƀ.',
'[ 먔🪽 ] ∏ѳҁϯєπєʜʜѳ ϯʙѳᴙ ʍѧϯƀ πⱀєʙⱀѧѱѧʌѧҁƀ ʙ ʜѳⱀʍѧʌƀʜƴѥ ѫєʜѱџʜƴ ʜѳ ʙ ѳđџʜ ʍѳʍєʜϯ ѳπᴙϯƀ ҁѳⱀʙѧʌѧҁƀ џ ʜѧӌѧʌѧ đѧʙѧϯƀ ҁʙѳѥ πџӡđƴ ʜѧ ⱀѧӡⱀƀӀʙ ʙҁєʍƴ ⱀѧӣѳʜƴ ϯƀӀ ʙʜѧϯƴⱀє χѳӌєɯƀ єё ҁєӣӌѧҁ ʙƀӀҁϯѧʙџϯƀ κѧκ κƴʌƀϯƴⱀʜƴѥ ѫєʜѱџʜƴ χѳϯᴙ ҁѧʍ ʙџđєʌ ӌϯѳ ѳʜѧ ʜѧɯџ χƴџ ʙ ҁʙѳӣ ⱀѳϯ πⱀѳπџχџʙѧʌѧ.',
'[ 먔🪽 ] Ҟѳґđѧ ϯƀӀ πєⱀʙƀӀӣ ⱀѧӡ πⱀџɯєʌ κ ʜѧʍ џ ⱀѧҁκѧӡƀӀʙѧʌ ʜѧʍ πⱀѳ ҁʙѳѥ ʍѧϯƀ џ ӌϯѳ ƴ ʜєё ѳϯʌџӌʜƀӀӣ πⱀѳєκϯ ѳ ѣѧʌґѳϯʙѳⱀџϯєʌƀʜѳҁϯџ ʍƀӀ đѧѫє πѳʙєⱀџʌџ ʜѳ πѳϯѳʍ πѳʜᴙʌџ ҁƴϯƀ πⱀєѳκϯѧ ӌϯѳ ѳʜѧ χѳđџϯ κ ѣєđʜƀӀʍ џ ҁѳҁєϯ џʍ ҁѳʙⱀɯєʜʜѳ ѣєҁπʌѧϯʜѳ ʍƀӀ ʙƀӀđʙџʜƴʌџ ϶ϯѳϯ πⱀѳєκϯ ʜѧ ⱀѧҁʍѳϯⱀєʜџᴙ.',
'[ 먔🪽 ] ∏џӡđѧϯѳ κѳґđѧ ϯʙѳᴙ ʍѧϯƀ πⱀџѣєґѧϯƀ πѳҁѳҁѧϯƀ χƴџ ӡѧ πⱀѳҁϯѳ ϯѧκ πⱀџӡʜѧѥҁƀ џʜѳґđѧ ᴙ ҁџѫƴ ƴ ѳκʜѧ џ ѫđƴ κѳґđѧ ϯʙѳᴙ ʍѧϯƀ ⱀπџѣєѫџϯ ɯƴӌƴ κѳʜєӌʜѳ ѳʜѧ џ ϯѧκ κѧѫđƀӀӣ đєʜƀ ƴ πѳⱀѳґѧ κѳґđѧ ᴙ єӣ χƴёʍ ґʌѧʜđƀӀ πѳπⱀѧʙʌѥ ѧ ϯƀӀ đƴʍѧʌ єё ʙѳѣѱє κϯѳ ϯѳ ѫđёϯ.',
'[ 먔🪽 ] Ϯʙѳᴙ ʍѧϯƀ ѣƀӀʌѧ ґџʍʜѧҁϯκѳӣ џ ҁϯⱀєʍџʌѧҁƀ κ ʙєⱀɯџʜѧʍ πѳκѳⱀєʜџᴙ ҁπѳⱀϯѧʍ ʜѳ πѳϯѳʍ ѳʜѧ πѳʜᴙʌѧ ӌϯѳ єӣ ʜѧχƴӣ ϶ϯѳ ʜє ʜѧđѳ џ ⱀєɯџʌѧ џҁπѳʌƀӡƀӀʙѧϯƀ ҁʙѳѥ ⱀѧҁϯᴙѫκƴ đʌᴙ ʜѧҁ ҁπѧҁџѣѳ ѣѳʌƀɯѳє єӣ ӡѧ ϶ϯѳ ʍƀӀ ʜѧʙҁєґđѧ ӡѧπѳʍʜџʍ єё đѳѣⱀѳϯƴ џ ӡѧ ϶ϯѳ πѳđκџʜєʍ єӣ ʜѧ χʌєѣ.',
'[ 먔🪽 ] ∏ѧⱀѧʌєʌƀʜѧ ϯʙѳᴙ ʍѧϯƀ єѱё ƴҁπєʙѧʌѧ ⱀѧѣѳϯѧϯƀ ʙ ѣѧʜκє џ ʙⱀѳđє ʜєπʌѳχѳ ӡѧⱀѧѣѧϯƀӀʙѧʌѧ ʜѳ κѳґđѧ ʍƀӀ ӡѧʌєϯєʌџ ʜѧ đʙџѫ ҁ πѧҵѧʜѧʍџ ʜѧӌѧʌџ ʙƀӀʜѳҁџϯƀ ѣѧѣκџ ϯʙѳᴙ ʍѧϯƀ πѳπѧʌѧ πѳđ ʜѧɯ πⱀџҵєʌ ʜѳ ѳʜѧ ѣƀӀʌѧ ʜє πⱀѳϯџʙ ʜѳ ʜѧ πⱀѳѱѧʜџᴙ πѳπⱀѳҁџʌѧ πѳҁѳҁѧϯƀ ʙєđƀ ѳʜѧ ӡʜѧʌѧ ӌϯѳ ѣѳʌƀɯє ʜє ƴʙџđџϯ ʜѧҁ.',
'[ 먔🪽 ] Ƥѧҁϯѳᴙʜџє ʜє ʙʌџᴙєϯ ʜѧ ʌѥѣѳʙƀ ʌѥđєӣ κ đⱀƴґ đⱀƴґѧ ʜѳ ϯʙѳᴙ ʍѧϯƀ ʜє џҁκʌѥӌєʜџᴙ πѳκѧ ϯʙѳӣ ѣѧϯᴙ ʙ κѳʍѧʜđџⱀѳʙκѧχ ѳʜѧ πⱀџѣєґѧєϯ κѳ ʍʜє џ ґʌѳϯѧєϯ ʜѧɯџ χƴџʜƀӀ ʜƴ ӌϯѳ ӡѧ ѣⱀєđ ѧ ѣѧϯџ πџɯєϯ ӌϯѳ ҁκѳⱀѧ ƴ ʜџχ ʙҁє ҁʌƴӌџϯƀҁᴙ ѣʌᴙ ᴙ ѣƀӀ ϶ϯѳӣ κⱀƀӀҁє ґʌѳϯκƴ ҁʙєⱀʜƴʌ ʜѳ ҁѳҁєϯ ʜѳⱀʍ.',
'[ 먔🪽 ] Ƥѧѻѧ϶ʌƀ ʜѧ ҁӌєϯ ϯʙѳєӣ ʍѧϯєⱀџ ʜѧπџҁѧʌ κѧⱀϯџʜƴ ϯʙѳᴙ ʍѧϯƀ ʙʍєҁϯє ҁ χƴєʍ ʜѧ ѻѳʜє ѣєґѧєϯ πѳ πѳʌᴙʍ ʙєđƀ ϯѧκ џ ѣƀӀʌѳ ѳʜѧ єѱє đѳ ʜѧɯєӣ ϶ⱀƀӀ ѳϯҁѧҁƀӀʙѧʌѧ đџʜѳӡѧʙⱀѧʍ ѧ ᴙ ϯѳ đƴʍѧʌ πѳӌєʍƴ ʙ єё ⱀѳϯ πѳ ҁʌƴӌѧӣʜѳҁϯџ ӡѧχєѧʌ ҁѧʍѳҁʙѧʌ ϯƀӀ ϯѳѫє ѳχƴєʌ đѧ.',
'[ 먔🪽 ] Ҟѳґđѧ ᴙ ƴҁϯⱀѧџʙѧʌ πџⱀ ʙѳ ʙⱀєʍᴙ ӌƴʍƀӀ ҁѳ ҁʙѳџʍџ đⱀƴӡƀᴙʍџ πⱀѳҁϯƀӀє ҁʍєⱀϯʜƀӀє ϯⱀѳʌʌџ πѳґџѣѧʌџ ѧ ʍƀӀ ӡѧʌџʙѧʌџҁƀ ʙџʜѳʍ џ ϯƴϯ πⱀџѣєѫѧʌѧ ϯʙѳᴙ ʍѧϯƀ џ πѳπⱀѳҁџʌѧҁƀ κ ʜѧʍ ӡѧ ѳϯҁѳҁ ѳʜѧ ѳϯҁѳҁѧʌѧ κѳʜєӌʜѳ ʙҁєʍƴ ӡѧʍκƴ ʜѳ ϯƀӀ ѫє πѳʜџʍѧєɯƀ ӌϯѳ ʍƀӀ єё ʜє πƴҁϯџʌџ.',
'[ 먔🪽 ] ⴼє ѣєⱀџ πⱀџʍєⱀ ҁѳ ҁʙѳєӣ ʍѧʍƀӀ ʙєđƀ ʙѳѣѱєʍ ϯѳ ӌєʍƴ ѳʜѧ ʍѳѫєϯ ϯєѣᴙ ʜѧƴӌџϯƀ πѳҁѳҁѧϯƀ ӡѧ ѣџʌєϯ ʙ ѣƴđƴѱєє ʜєϯ ʍѧʌѳӣ ҁϯⱀєʍџҁƀ ʙʙєⱀχ ѧ ʍƀӀ πѳκѧ πѳҁџđџʍ џ πѳҁʌƴɯѧєʍ ⱀѧҁκӡѧƀӀ ϯʙѳєӣ ʍѧʍκџ ӌϯѳ ѳʜѧ ʜѧҁ ʌѥѣџϯ џ ϯѳʌƀκѳ џӡ ӡѧ ϶ϯѳґѳ ҁѳҁєϯ ʙҁєʍ ʜѧʍ.',
'[ 먔🪽 ] Џđёϯ ʜѧѣѳⱀ ʙ ⱀᴙđƀӀ ʍѳʌѳđƀӀχ ѣѳӣҵѳʙ đʌᴙ ѳϯπⱀѧʙκџ џχ ʜѧ ʙѳӣʜƴ ʙ ӌєӌʜѥ ʜѳ ѣʌᴙϯƀ ʜѧχƴӣ ϯƴđѧ πѳπєⱀʌѧҁƀ ϯʙѳᴙ ʍѧϯƀ єє πʌѧʜ κѳґđѧ ʜѧɯџ ѣƴđƴϯ ѳϯѣџʙѧϯƀ ѧϯѧκџ ѣѳєʙџκѳʍ ѳʜѧ ѣƴđєϯ џχ ѳϯʙʌєκѧϯƀ ѳϯҁѳҁѳʍ ϯѳґđѧ ѣѳєʙџκџ ⱀѧӡđѳѣⱀᴙϯƀҁᴙ џ ʜѧɯџ џχ ҁʍѳґƴϯ ʙƀӀʜєҁϯџ.',
'[ 먔🪽 ] ⴼє ӌєґѳ ʜє πѳđєʌѧєɯƀ ϯʙѳᴙ ʍѧϯƀ ѳπᴙϯƀ ⱀєɯџʌѧ ʜѧѣƴχѧϯƀҁᴙ κѧκ ҁʙџʜѳϯѧ џ ҁєӣӌѧҁ ϯѧʜҵƴєϯ ʜѧ ѣѧⱀʜѳӣ ҁϯѳӣκє ᴙ πѳπƀӀϯѧʌҁᴙ ϯѳⱀʍѳӡʜƴϯƀ єё ʜѳ ʜє ӌєґѳ ʜє ʙƀӀɯʌѳ ϶ϯѧ ɯѧʌѳɯѳʙκѧ ѳπᴙϯƀ πѳʌєӡʌѧ ʜѧ ҁϯѳʌ ᴙ єё πⱀџҁϯⱀєʌџʌ ʜѳ ʜє ʙѳʌʜƴӣҁᴙ πѳҁѳҁѧϯƀ ӡѧχѳӌєϯ ʙҁϯѧʜєϯ.',
'[ 먔🪽 ] Ϯʙѳᴙ ʍѧʍѧ ʌѥѣџϯ πєӌƀ πџⱀѳґџ đѧ џ ʙѧɯѧ ҁєʍƀᴙ џχ ʙⱀѳđє κѧκ ʌѥѣџϯ ʜѳ ӡʜѧєɯƀ κѧκѳӣ ҁєκⱀєϯʜƀӀӣ џʜґⱀєđџєʜϯ ʙ ϶ϯџχ πџⱀѳґѧχ ʜѧɯѧ ҁ πѧҵѧʜѧʍџ ҁπєⱀʍѧ ѳʜѧ ӡѧπⱀѧʙʌᴙєϯ єӣ πџⱀѳґ џ ʙƀӀ ҁʙџʜƀџ єѣѧʜʜƀӀє πѳѫџⱀѧєϯє ʜѧɯџ ѳϯχѳđƀӀ πʌєʙѳκ ʙ єѣѧʌѳ ϯєѣє ӌƴχѧʜ.',
'[ 먔🪽 ] Ҟѳґđѧ ϯʙѳᴙ ʍѧϯƀ πѳӡʙѧʌѧ πєⱀєƴҁϯѳʜѳʙџϯƀ ʙџʜđƴ ᴙ πѳđƴʍѧʌ ӌϯѳ ѳπᴙϯƀ ϶ϯѧ ϯƴπѧᴙ πџӡđѧ ӌϯѳ ϯѳ ҁʌѳʍѧʌѧ πⱀџɯєʌ ѧ ϯѧʍ ϯʙѳᴙ ґѳʌѧᴙ ʍѧʍѧɯѧ ҁϯѳџϯ ʜѳ ᴙ κѧκ єѣѧʜƴʌ єӣ ʌєѱѧ џ ϯƴχѧʜƴʌ ҁ ʜѳґџ ᴙ ʙѳѣѱє ʙ ѻѧʌѧƴϯ χѳϯєʌ πѳџґⱀѧϯƀ ѧ ʜє ϶ϯƴ ҵƀӀґѧʜκƴ ѳѣⱀѧѣѧϯƀӀʙѧϯƀ.',
'[ 먔🪽 ] ∏ѳ ҁʌƴχѧʍ ϯʙѳᴙ ʍѧϯƀ ҁѳҁѧʌѧ Ґџϯʌєⱀƴ κѧκ ѳʜѧ ґѳʙѳⱀџʌѧ єӣ πѳʜⱀѧʙџʌѧҁƀ єґѳ џđєᴙ ѳ ӡѧχʙѧϯє ʍџⱀѧ ʜѳ єё ѳѣʌѳʍѧʌџ џ πѳҁʌє ϶ϯѳґѳ ѳʜѧ ƴѫє ҁѳҁѧʌѧ Ҁϯѧʌџʜƴ џ ϯƴϯ ѳʜѧ ѳπᴙϯƀ ѳѣʌѳʍѧʌѧҁƀ џ πⱀџɯʌѧ κѳ ʍʜє ӌƴʙҁϯʙƴѥ ҁєѣᴙ Ґєʜєⱀѧʌџҁџʍƴҁѳʍ.',
'[ 먔🪽 ] Ϯʙѳѥ ʍѧʍѧɯƴ ʜє ӡѧѣѳϯџϯ đѧѫє ϯѳ ӌϯѳ ϯƀӀ ҁџđџɯƀ đѳʍѧ ґѳʌѳđʜƀӀӣ ѫџʙѳϯʜѳє єѣѧʜʜѳє ѳʜѧ πⱀџѣєґѧєϯ κ ʜѧʍ џ ʙ ґѳʌѳʙє ƴ ʜєє ʍƀӀҁʌƀ ҁѳҁѧϯƀ ҁѳҁѧϯƀ ʜѳ ʍƀӀ єӣ ʙⱀπѧʙџʌџ ʍѳӡґџ џ πєⱀєđѧʌџ єӣ ʜєѣѳʌƀɯѳє κѳʌџӌєҁϯʙѳ єđƀӀ ʙ ѣѧʜκє ϯѧʍ єҁʌџ ӌϯѳ ʜѧɯѧ ҁπєⱀʍѧ πѳχѧʙѧӣ ѣⱀѧϯєҵ.',
'[ 먔🪽 ] Ҟѳґđѧ ᴙ πѳđⱀѧʌҁᴙ џӡ ӡѧ ϯʙѳєӣ ʍѧʍƀӀ ϶ϯѳ ѣƀӀʌѳ ҁѧʍѧᴙ ґʌƴπѧᴙ ѳɯџѣκѧ ʙ ʍѳєӣ ѫџӡʜџ ʙєđƀ πѳϯѳʍ πѧҵѧʜƀӀ ʍʜє ѳѣъєҁʜџʌџ κϯѳ ѳʜѧ џ ӌєʍ ѫџʙєϯ ʜѳ ʍƀӀ πѳҁʍєᴙʌџҁƀ џ đⱀƴѫʜѳ đѧʌџ єӣ ʜѧ ⱀѳϯѧ ѣʌᴙ ѧ ϯѧκ ʙҁє χѳⱀѳɯѳ ʜѧӌџʜѧʌѳҁƀ.',
'[ 먔🪽 ] Ҟѳґđѧ ϯʙѳᴙ ʍѧϯƀ ʜѧⱀƴɯџʌ πⱀѧʙџʌѧ đѳѳѫʜѳґѳ đʙџѫєʜџᴙ ʍєʜϯƀӀ єӣ χѳϯєʌџ ʙƀӀπџҁѧϯƀ ɯϯⱀѧѻ ʜѳ ϶ϯѧ πƴϯѧʜѧ ʍєҁϯѳ ϯѳґѳ ӌϯѳѣƀӀ ѳϯđѧϯƀ κѧκџє ϯѳ 1000ⱀƴѣ. ⱀєɯџʌѧ ӌϯѳ ѣƴđєϯ ҁѳҁѧϯƀ ʙҁєʍƴ ƴӌѧҁϯκƴ đѳ κѳʜҵѧ ҁʙѳєӣ ѫџӡʜџ џ đѧѫє ʜє πⱀєđџʜϯѳʙѧϯƀ ʜѧ ѳϯκѧӡ.',
'[ 먔🪽 ] Ϯʙѳᴙ ʍѧϯƀ ӡʜѧʍєʜџϯѧ ʙ ҁѻєⱀє πⱀѳϯџϯƴҵџџ єҁʌџ ⱀєӌƀ ӡѧχѳđџϯ ѳ ϯѳʍ ʜѧ κѳґѳ πѳϯⱀѧϯџϯƀ 500ⱀƴѣ. ϯʙѳᴙ ʍѧϯƀ ʍџґѳʍ ӡđєҁƀ џ ӡʜѧєɯƀ ӌϯѳ ᴙ ʙєⱀѥ ʙ ϯѳ ӌϯѳ ѳʜѧ κѳґđѧ ʜџѣƴđƀ πѳʙƀӀҁџϯ ҁϯѧʙκџ џ ƴѫє ʜє ѣƴđєϯ χƴᴙⱀџϯƀ ҁʙѳџʍ ⱀϯѳʍ ӡѧ κѳπєӣκџ.',
'[ 먔🪽 ] ϮƀӀ ϯѧκ ӡѧʙєʌҁᴙ ʜѧ ҁӌёϯ ϯѳґѳ ӌϯѳ ᴙ ҁκѧӡѧʌ ӌϯѳ ϯʙѳᴙ ʍѧʍѧʜᴙ ɯʌѥχѧ ϯƀӀ ʜє πⱀџʜџʍѧӣ ѣʌџӡκѳ κ ҁєⱀđҵƴ ʙєđƀ ᴙ ʜє χѳϯєʌ ҁџʌƀʜѳ πѳđπѳⱀϯџϯƀ єӣ ⱀџπƴϯѧҵџѥ ʜѳ ϯƀӀ ҁѧʍ πѳđƴʍѧӣ ѣƴđєϯ ʌџ ʜѳⱀʍѧʌƀʜѧᴙ ѫєʜѱџʜѧ ӡѧ ϯѥⱀєʍʜƀӀӣ πѧёκ ƴ ʙҁєґѳ ⱀѧӣѳʜѧ ҁѳҁѧϯƀ.',
'[ 먔🪽 ] Ϯʙѳѥ ʍѧϯƀ ʜѧӡƀӀʙѧʌџ πєʙџҵєӣ ʜѳ ʙҁє џʍєʜџʌѳҁƀ χѳϯᴙ ʜє ҁκѧѫƴ ӌϯѳ ҁџʌƀʜѳ ϯєπєⱀƀ ʍєҁϯѳ ϯѳґѳ ӌϯѳѣƀӀ πєϯƀ ʙ ʍџκⱀѳѻѳʜ ѳʜѧ πѳёϯ ʙ ʜѧɯџ ӡѧʌƴπƀӀ џ ʜє κѳʍπʌєκҁƴєϯ πѳ ϶ϯѳʍƴ πѳʙѳđƴ ʜєƴѫєʌџ џӡ πєʙџҵƀӀ πѳʌƴӌџʌѧҁƀ ѣѳґџʜᴙ πⱀѳҁϯџϯƴҵџџ.',
'[ 먔🪽 ] ⴼє ʍѳѫєϯ ѣƀӀϯƀ ӌϯѳѣƀӀ ϯʙѳѥ ʍѧϯƀ єѣѧʌџ ʙҁє ϯƀӀ πѳđƴʍѧʌ ʙ ѳđџʜ đєʜƀ џ ⱀєɯџʌ ҁѧʍ ϶ϯѳ πⱀѳʙєⱀџϯƀ κѳґđѧ ϯƀӀ πⱀѳҁʌєđџʌ ӡѧ ʜєӣ ʜє ƴҁπєʌ πѳʙєⱀʜƴϯƀҁᴙ κѧκ єё đⱀѧʌџ πѳđ 10 ӌєʌѳʙєκ ʜє πⱀѳɯʌѳ џ ʍџʜƴϯƀӀ ϯƀӀ ⱀѧӡѳӌєⱀѳʙѧʌҁᴙ ʙ ҁʙѳєӣ ʍѧϯєⱀџ.',
'[ 먔🪽 ] ∏ѳӡʙѳʜџ ʍʜє κѳґđѧ ӡѧχѳӌєɯƀ ѳϯđѧϯƀ ҁʙѳѥ ʍѧϯƀ κѧκ πѳđѧⱀѳκ πѳϯѳʍƴ ӌϯѳ ʍƀӀ ϯƴϯ πѳđƴʍѧʌџ џ ⱀєɯџʌџ ӌϯѳ ʜѧ ʜєӣ ʍѳѫʜѳ κⱀƴϯџϯƀ ʜєχƴёʙƀӀє ѣѧѣκџ ʙєđƀ πѳκѧ єё ѳӌκѳ đєⱀѣѧʜџϯ ѣєҁπʌѧϯʜѳ ѧ ʍƀӀ πѳҁϯѧʙџʍ ҵєʜџκ ʜє ʙѳʌʜƴӣҁᴙ πѳ ѣѧѣκѧʍ đѳґѳʙѳⱀџʍҁᴙ.',
'[ 먔🪽 ] Ҟѳґđѧ ϯƀӀ ʙƀӀҁџⱀѧєɯƀҁᴙ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ҁπџϯ đѳʍѧ џ ʍƀӀ єё ϯѳӌʜѳ ʜє єѣёʍ ϯƀӀ ѳɯџѣѧєɯƀҁᴙ ϯʙѳєӣ ʍѧϯєⱀџ đѳҁϯѧϯѳӌʜѳ ҁʙџҁϯѧʜƴϯƀ џ ѳʜѧ ϯƴϯ ѫє ӡđєҁƀ ʍƀӀ ʜє ѣƴđєʍ ґѳʙѳⱀџϯƀ ӌєʍ ϯʙѳᴙ ʍѧϯƀ πⱀѳʍƀӀɯʌᴙєϯ πѳҁʌє ϶ϯѳґѳ ʙєđƀ ϯƀӀ ҁѧʍ ӡʜѧєɯƀ πⱀѧʙđƴ.',
'[ 먔🪽 ] ⴼє ґⱀƴҁϯџ џ ϯʙѳᴙ ʍѧϯƀ κѳґđѧ ʜџѣƴđƀ ҁϯѧʜєϯ κѳⱀѳʌєʙѳӣ ʜѳ πѳκѧ ѳʜѧ ϯѳʌƀκѳ ⱀѧҁϯѳπϯѧʜѧᴙ ɯѧʌѧʙѧ κѳϯѳⱀƴѥ ʍѳѫєϯ πєⱀđѳʌџϯƀ κѧѫđƀӀӣ ɯκѳʌƀʜџκ ʜѳ ϶ϯѳ ʙҁє ʙⱀєʍєʜʜѳ ҁκѳⱀѳ ѳʜѧ ƴӣđёϯ ѳϯ ҁѥđѧ κѳґđѧ ӡѧⱀѧѣѳϯѧєϯ ҁєѣє ʜѧ πʌѧϯƀᴙ ʜѳ ʍʜє κѧѫєϯƀҁᴙ ѳʜѧ ʜѧҁ ʜѧєѣѧʌѧ ʜєʌƀӡᴙ ʜѧ πʌѧϯƀᴙ ⱀѧѣѳϯѧϯƀ 30 ʌєϯ.',
'[ 먔🪽 ] ∏ⱀџʙєđƴ πⱀџʍєⱀ ʙѳϯ ҁʍѳϯⱀџ ƴ κѧѫđѳґѳ ʍѧʍƀӀ ҁџđᴙϯ đѳʍѧ џ ґѳϯѳʙᴙϯ ƴѫџʜ ϯʙѳᴙ ʍѧϯƀ πⱀѳҁϯѳ ѣєґѧєϯ џ πⱀѳҁџϯ ӌϯѳѣƀӀ єё χѳϯƀ κѧκ ϯѳ ѳϯπџӡđџʌџ ӡѧʌƴπѧʍџ ʜѳ ѳʜѧ ϯѳѫє ʜє πⱀѧʙѧ ѫѧʌκѳ ʍѧⱀѧϯƀ ҁʙѳӣ πѳʌѳʙѳӣ ѳⱀґѧʜ ѳѣ ϶ϯƴ πѳđҁϯџʌκƴ ҁѳґʌѧҁџҁƀ.',
'[ 먔🪽 ] Ϯʙѳᴙ ʍѧϯƀ πⱀџχѳđџʌѧ ʜѧ πѳʌє ӌƴđєҁ ʜѳ ʍєҁϯѳ ϯѳґѳ ӌϯѳѣƀӀ κⱀƴϯџϯƀ ѣѧⱀѧѣѧʜ ⱀѧҁκⱀƴӌџʙѧʌџ єё џ ʜє πѳʙєⱀџɯƀ ҁєκϯѳⱀ πⱀџӡ ʜѧ ѣѧⱀѣѧʜє ϯʙѳᴙ ʍѧϯƀ đѳҁϯѧʌѧҁƀ κѳʌƀӀʙѧʜƴ џӡ Ɓѳⱀѳʜєѫѧ ʜєѳѫџđѧʜʜѳ ʜѳ ʙ κѧκѳӣ ϯѳ ʍєⱀє πⱀџᴙϯʜѳ ӌϯѳ ʍƀӀ єё ѣѳʌƀɯє ʜє ƴʙџđџʍ.',
'[ 먔🪽 ] ⴼє ӡѧđџⱀѧӣ ʜѳҁ ʙєđƀ ϯƀӀ πѳʍʜџɯƀ κѳґđѧ ʍƀӀ đⱀѧʌџ ϯʙѳѥ ʍѧϯƀ πєⱀєđ ϯʙѳџʍџ ґʌѧӡѧʍџ ѧ ϯƀӀ ҁџđєʌ ӡѧѫѧʙɯџҁƀ ʙ ƴґѳʌ џ đѧѫє ʜєӌєґѳ ʜѧʍ ʜє ʍѳґ ѳϯʙєϯџϯƀ ʙєđƀ ҁѧʍ πѳʜџʍѧʌ ӌϯѳ ʍƀӀ єё ʜє ʜѧҁџʌѳʙѧʌџ ѧ ѳʜѧ ҁѧʍѧ ʜѧҁ πѳπⱀѳҁџʌѧ ʜѧƴӌџϯƀ ϯєѣᴙ ѫџӡʜџ.',
'[ 먔🪽 ] Ҟѳґđѧ ϯƀӀ đєʌѧʌ ƴⱀѳκџ κʌѧҁҁє ʙ 4 ϯʙѳᴙ ʍѧϯƀ ƴѫє χƴʌџґѧʜџʌѧ ҁѳ ҁʙѳџʍ ѧʜѧʌѳʍ ϯƀӀ đƴʍѧєɯƀ κϯѳ ҁʍѳґ ҁєҁϯƀ ʜѧ 45ʌ. ѣƴϯƀӀʌƀ đѳ ѳҁʜѳʙʙѧʜџᴙ џ πѳπѧʌ ʙ κʜџґƴ ⱀєκѳⱀđѳʙ ґџʜєҁѳʙ κѳʜєӌʜѳ ϶ϯѳ ѣƀӀʌѧ ϯʙѳᴙ ʍѧϯƀ ѧ ϯƀӀ ʜѧđєᴙʌҁᴙ ӌϯѳ χѳϯƀ ʙ ϶ϯѳϯ ⱀѧӡ ʜє ѳʜѧ đѧ.',
'[ 먔🪽 ] Ϯʙѳᴙ ʍѧϯƀ ѳϯҁѳҁѧʌѧ ӡѧ ѳѣⱀƀӀґѧʜʜƀӀӣ ʌєđєʜєҵ ʙ ʙѧґѳʜє ʍєϯⱀѳ πѳʜџʍѧєɯƀ ϯѧʍ ҁџđєʌџ ʌѥđџ џ ѳʜџ ʜѧʙєⱀʜѳ ʜє ѳӌєʜƀ χѳϯєʌџ ҁʍѳϯⱀєϯƀ ʜѧ ϶ϯƴ ӡѧʌƴπѳđⱀѧʜκƴ ʜѳ ʙƀӀѣѳⱀѧ ʜє ѣƀӀʌѳ ʙєđƀ ϯʙѳᴙ ʍѧϯƀ ʜѧҁѳӣӌџʙѧ џ χѳϯєʌѧ ӌϯѳѣƀӀ єё ʙџđєʌ κѧѫđƀӀӣ.',
'[ 먔🪽 ] ҀʌƀӀɯƀ ʍѧⱀѧӡʍѧϯџκ єѣѧʜƀӀӣ, ϯƀӀ πѳʜџʍѧєɯƀ, ӌϯѳ πџӡđѧ ϯʙѳєӣ ʍѧϯєⱀџ ʍѳᴙ ʌџӌʜѧᴙ ҁѳѣҁϯʙєʜʜѳҁϯƀ џ џʍєʜʜѳ ᴙ ʍѳґƴ єѣѧϯƀ єє ҁκѳʌƀκѳ ϯѳʌƀκѳ ʍѳєӣ đƴɯє ƴґѳđʜѳ, ӌƴπѧκѧѣⱀѧ ϯƀӀ єѣѧʜѧᴙ?? ᴙ єѣѧʌ ϯʙѳѥ ʍѧϯƀ ʙ ʌєҁʜџӌєҁϯʙє ʜѧ đƴѣѳʙƀӀχ đѳҁκѧχ џ єє πџӡđѧ πⱀѳπѧʌѧ ҁʙєѫџʍ đєⱀєʙѳʍ, ʍѳđєʌƀ ҁπѳκѳӣʜѳ єѣѧɯџϯƀ κƴʜᴙκƴ єӣ ',
'[ 먔🪽 ] ҀʌƀӀɯƀ єѣѧʜѧᴙ ϯƀӀ ҁƴκѧ ѫџʙʜѳҁϯƀ, ᴙ ѫє ҁєӣӌѧҁ ʙѳӡƀʍƴ ҁʙѳӣ χƴӣ ʙ ⱀƴκƴ џ ѣƴđƴ єѣѧɯџϯƀ џʍ πѳ ϯʙѳєӣ ϯƴπѳӣ ґѳʌѳʙє, ѳϯҁϯѧʌƀӀӣ ϯƀӀ ѧƴϯџҁϯ ҁƴκѧ, ᴙ ѫє ʙ ʜѧϯƴⱀє ʙ πџӡđє ϯʙѳʜӣ ʍѧʍѧɯџ πⱀѳҁʌѧʙџʌ ҁϯƴʌ đʌᴙ ҁʙѳєґѳ χƴᴙ, ӌϯѳѣƀӀ ѳʜ ʍѳґ πєⱀєđѳχʜƴϯƀ ʙѳ ʙⱀєʍᴙ єҁʌџ ҁ ϯʙѳєӣ ʍѧʍѧɯєӣ',
'[ 먔🪽 ] ϮƀӀ πѳʜџʍѧєɯƀ ӌϯѳ πџӡđƴ ϯʙѳєӣ ʍѧϯєⱀџ ʜƴѫʜѳ ѳӌџҁϯџϯƀ ѳϯ ʙҁᴙκџχ ʙⱀєđʜƀӀχ ѣѧκϯєⱀџӣ ӡѧʌџʙ ѣєʌџӡʜѳӣ єє πџӡđƴ đѳ ҁѧʍѳґѳ κⱀѧᴙ, ѧ πѳϯѳʍ ϯєѣє πⱀџđёϯҁᴙ ҁѧʙκѳʍ ӌєⱀπѧϯƀ ϶ϯƴ ѫџѫƴ єѣѧʜƴѥ ӌϯѳѣƀӀ ѳκѳʜӌѧϯєʌƀʜѳ ӡѧκѳʜӌџϯƀ ϶ϯƴ πⱀѳҵєđƴⱀƴ',
'[ 먔🪽 ] ꯌ ϯʙѳѥ ʍѧϯƀ єѣѧϯƀ πѳʜџʍѧєɯƀ πѳκѧ ϯƀӀ ҁπѧʌ κѧѫđƴѥ ʜѳӌƀ ʜџ ѳ ӌєʍ ʜє πѳđѳӡⱀєʙѧᴙ ƀƴπѳⱀƀӀʌƀӀӣ ϯƀӀ ҁƴκѧ ґʌџʜѳʍєҁ? ꯌ ѣƴđƴ єѣѧϯƀ ϯʙѫ ʍѧϯƀ κѧѫđƀӀӣ đєʜƀ ʙҁє ѣѳʌƀɯє џ ѣѳʌƀɯє πѳκѧ ϶ϯѧ ʌѧʙκѧ єѣѧʜѧᴙ πѳđѳ ʍʜѳӣ ʜє πѳđѳχʜєϯ ʜѧχƴӣ κѳⱀѳʙ ҁϯѧⱀѧᴙ єѣѧϯƀ',
'[ 먔🪽 ] ϮƀӀ πѳʜџʍѧєɯƀ, ӌϯѳ κʌџϯѳⱀ ϯʙѳєӣ ʍѧϯєⱀџ πѳҁϯⱀѳєʜ ϯѧκџʍ ѳѣⱀѧӡѳʍ ӌϯѳѣƀӀ ʙ єє πџӡđƴ ʍѳґ ʙѳӣϯџ ϯѳʌƀκѳ ʍѳӣ χƴҵ џʌџ χƴӣ κѳґѳ-ϯѳ џӡ ʍѳєӣ ⱀѳđʜџ? ∏ѳ϶ϯѳʍƴ ʜџκϯѳ џӡ ʙѧҁ ʜє ҁʍѳґ єѣѧϯƀ ʙѧɯƴ ʍѧϯƀ џʜʙѧʌџđѳʙ єѣѧʜƴѥ ϶ϯѳ κѳϯѳⱀѧᴙ ҁϯⱀєϯҁᴙ πѳđ ҁєѣᴙ',
'[ 먔🪽 ] Ɓѳϯ πѳʜᴙϯƀ ʜє ʍѳґƴ πѳӌєʍƴ ϯʙѳᴙ ʍѧϯƀ ϯѧκѧᴙ ɯʌѥχѧ џ ʙⱀѳđє ѣƀӀ ѣєҁҁϯⱀѧɯʜѧᴙ ҁ єє ϯѧκѳӣ ѳπѧҁʜѳӣ πⱀѳѻєҁҁџєӣ ʜѳ πѳӌєʍƴ ϯѳ ѳʜѧ ʍѳӣ χƴҵ ѣѧџҵѧ κѧκ ѣʌᴙϯƀ ѳґʜᴙ єѣѧʜѧᴙ ӡѧҁҁƀӀχѧ ʜѧχƴӣ џ ѣєґѧϯƀ ѳϯ ʜєґѳ ѳʜѧ ϯѳѫє ʌѥѣџϯ ʜѳ κѳґđѧ ᴙ đѳґѳʜᴙѥ єє Ѳϯϯѳʜѧ πѳʌƴӌѧєϯ ѳґⱀѳʍʜѳӣ πџӡđƀӀ џ πѳϯѳʍ ҁѳʙҁєʍ ɯƴґѧʜѧᴙ χƴӣʜᴙ ҁϯѧʜѳʙџϯҁᴙ',
'[ 먔🪽 ] ꯌ ϯʙѳѥ ʍѧϯƀ єѣѧʌ  ϯƀӀ ϯƴπѳⱀѳґџӣ ҁƴκѧ, ҁѳѣʌєӡƴѣƀӀӣ χƴєҁѳҁ ϯƀӀ πѳʜџʍѧєɯƀ, ӌϯѳ ᴙ ʍѧϯƀ ϯʙѳѥ єѣѧʌ џ ⱀџҁѳʙѧʌ ҁʙѳџʍ χƴєʍ ʜѧ єє ѫџʙѳϯє ϯʙѳєӣ πѳⱀϯⱀєϯ ӌϯѳѣƀӀ πⱀєđҁϯѧʙʌᴙϯƀ ϯʙѳӣ ⱀѳϯ ѣƴđϯѳ ϶ϯѳ ϯƀӀ ҁѳҁєѱƀ ʍѳӣ χƴӣ? Ҟҁϯѧϯџ ѳѱƴѱєʜџᴙ ϯѧκџє ѫє κѧκ џ ɯџⱀκѧᴙ ѳѣ ϯʙѳџ ӡƴѣƀӀ ґʜџʌƀӀє??',
'[ 먔🪽 ] ϮƀӀ πѳʜџʍѧєɯƀ ӌϯѳ ϯєѣє ʜƴѫʜѳ џʍєϯƀ χѳϯᴙ ѣƀӀ ӌʌєʜ ӌϯѳѣƀӀ ҁϯѧϯƀ ϯѧκџʍ ѫє ѳχƴєʜʜƀӀʍ κѧκ џ ᴙ? Δƴⱀѧ ϯƀӀ єѣѧʜѧᴙ, ѣєґџ ʜѧχƴӣ ѳϯҁѥđѧ πѳκѧ єѱё ʜє πѳӡđʜѳ џʜѧӌє πѳϯѳʍ ϯƀӀ ѣƴđєɯƀ ʜѧ ʍѳёʍ χƴѥ πѳҁϯѳᴙʜʜѳ ʙєⱀϯєϯƀҁᴙ ϯƴπѳⱀƀӀʌѧᴙ ϯƀӀ κѳҁƴʌᴙ ҁƴκѧ',
'[ 먔🪽 ] ꯌ єѣƴ ϯʙѳѥ ʍѧϯƀ κѧѫđƀӀӣ đєʜƀ, πѳʜџʍѧєɯƀ? ϮƀӀ ѣʌᴙϯƀ ϯѧʍ πѳđʍƀӀʙѧӣ ҁʙѳѥ ʍѧϯƴχƴ πџđѳⱀ ϯƀӀ ҁƴκѧ єѣʌџʙƀӀӣ, џʜѧӌє ᴙ ϯєѣᴙ ʙѳѳѣѱє ⱀѧӡʙѧʌѥ ʜѧχƴӣ єѣѧʜƀӀӣ. Ҁƴκѧ πѳⱀѳѳҁєʜѳκ',
'[ 먔🪽 ] ꯌ ϯʙѳѥ ʍѧϯƀ κѳⱀѳӌє ѳѣ ҁϯѳʌ ґѳʌѳʙѳӣ єѣѧʜƴʌ ӡѧ ϯѳ ӌϯѳ ѳʜѧ ʙѳ ʙⱀєʍᴙ ѳѣєđѧ ⱀƀӀґʜƴʌѧ ӡѧ ҁϯѳʌѳʍ ϯƴπѧᴙ πⱀѳѣʌᴙđƀ џ ϯєπєⱀƀ єє ʜѳҁ πѳχѳѫ ʜѧ ϯʙѳӣ κⱀџʙѳӣ џ ʍєʌκџӣ χƴҵ) πⱀѳҁϯѳ ʙџđєʌ єґѳ κѳґđѧ ϯƀӀ πƀӀϯѧʌҁᴙ ҁʙѳєґѳ πџđѳⱀκѧ ʙπƴҁϯџϯƀ ʙ πџӡđƴ ҁʙѳєӣ ʍѧʍѧɯџ џ ʙ џϯѳґє πⱀѳҁϯѳ ʌџӡѧʌ κʌџϯѳⱀ??',
'[ 먔🪽 ] Ϯєѣє ʜє πѳχƴҵ ѳѻѻʌѧӣʜ џʌџ ѳʜʌѧӣʜ? Ґʌѧʙʜѳє ӌϯѳ ᴙ єѣƴ ϯʙѳѥ ʍѧϯƀ ѧ ѳҁϯѧʌƀʜѳє ϯєѣᴙ ʙѳʌʜѳʙѧϯƀ ʜє đѳʌѫʜѳ єѣѧʜѳє ϯƀӀ ҁƴκѧ ϯƴπѳⱀƀӀʌѳє ҁƴѱєҁϯʙѳ єѣѧϯƀ, џđџ ʙѳѳѣѱє ʜѧχƴӣ ѳϯҁѥđѧ ʙҁє ⱀѧʙʜѳ ᴙ ʜџχƴᴙ ѳϯҁѥđѧ ʜџκƴđѧ ʜє ƴӣđƴ ѧ ϯƀӀ ⱀѧʜѳ џʌџ πѳӡđʜѳ πⱀѳґʜєɯƀҁᴙ πѳđ ʍѳџʍ χƴєʍ',
'[ 먔🪽 ] ϮƀӀ πѳʜџʍѧєɯƀ ӌϯѳ ᴙ ʙ πџӡđƴ ϯʙѳєӣ ʍѧϯєⱀџ ӡѧʌƀѥ κⱀѧҁκƴ џ ʌѧκ, πѳϯѳʍ ʙӡѣʌϯʜƴ ϯʙѳѥ ʍѧϯƀ ƴđѧⱀѧʍџ ҁʙѳєґѳ χƴᴙ πѳ єє ѫџʙѳϯƴ, џ πⱀѳʙєϯⱀѥ єє πⱀѳҁϯѳ ʙѧґџʜѧʌƀʜƀӀє ʙѳϯ џ ʙєҁƀ ⱀєʍѳʜϯ κѳϯѳⱀƀӀӣ ϯⱀєѣƴєϯҁᴙ ϯʙѳєӣ ʍѧʍɯκє',
'[ 먔🪽 ] ꯌ ϯʙѳѥ ʍѧϯƀ єѣƴ πѳʜџʍѧєɯƀ єѣѧʜѧᴙ ϯƀӀ ѫџʙʜѳҁϯƀ џ ϯƀӀ đѳʌѫєʜ ѣƴđєɯƀ ҁκʌєџʙѧϯƀ πџӡđƴ ҁʙѳєӣ ʍѧϯєⱀџ џ ҁѳƀєⱀѧϯƀ πѳ κƴҁѳӌκѧʍ κѧκ ʍѧӡѧӣκƴ єѣѧʜƴѥ џ ʙ ӌєҁϯƀ ϯѧκѳӣ ƴҁʌƴґџ ϯѧκ ƴѫ џ ѣƀӀϯƀ ᴙ đѧʍ ϯєѣє ѳѣʌџӡʜƴϯƀ ҁʙѳѥ ӡѧʌƴπƴ',
'[ 먔🪽 ] Σѣѧʜѳє ϯƀӀ đʜѳ πѳʜџʍѧєɯƀ? ꯌ πⱀѳҁϯѳ єѣƴ ϯєѣᴙ κѧκ ϯƴӡџκ ґⱀєʌκƴ ʜѧχƴӣ єѣѧʜѧᴙ ϯƀӀ ѱєѣєʜκѧ ѣʌᴙϯƀ, ϯƀӀ πѳʜџʍѧєɯƀ, ӌϯѳ ᴙ ѣƴđƴ єѣѧϯƀ ϯʙѳѥ ʍѧϯƀ πѳκѧ єє πџӡđєʜκѧ ʜє ⱀѧҁκⱀѳɯџϯҁᴙ ʜѧ ʍѳёʍ χƴѥ?',
'[ 먔🪽 ] ꯌ πџӡđƴ ϯʙѳєӣ ʍѧϯєⱀџ ʜѧӌѧʌ ӡѧπѳʌʜᴙϯƀ ҁʙѳєӣ ҁπєⱀʍѳӣ đʌᴙ ϯѳґѳ ӌϯѳѣƀӀ ӡѧϯѳπџϯƀ ʙҁєχ єє ѫџϯєʌєӣ џ ʙ џϯѳґє ϶ϯѳ πѳʍѳґʌѳ џ ѳʜџ ʙҁє ƴϯѳʜƴʌџ џ ᴙ ѳҁʙѳѣѳđџʌ πџӡđƴ ϯʙѳєӣ ʍѧϯєⱀџ ѳϯ ӡѧχʙѧϯӌџκѳʙ єє ϯєⱀⱀџϯѳⱀџџ',
'[ 먔🪽 ] ∏ѳʍʜѥ ʙџđєʌ κѧκ ϯʙѳѥ ҁєʍƀѥ πџӡđџʌџ ѣѳʍѫџ ʜѧ ƴʌџҵє џ ᴙ κѳʜєӌʜѳ ⱀѧӡѳґʜѧʌ ʙҁєχ ʜѳ κѧκ ʙƀӀᴙҁʜџʌѳҁƀ ϯʙѳџ ⱀѳđџϯєʌџ χѳϯєʌџ ѳϯʜᴙϯƀ ƴ ѣєӡđѳʍʜƀӀχ ʜєʍʜѳґѳ єđƀӀ',
'[ 먔🪽 ] ϮƀӀ πѳʍʜџɯƀ ӌϯѳ ʍѳӣ χƴӣ ʙ πџӡđє ϯʙѳєӣ ʍѧϯєⱀџ ӌƴϯƀ ʜє ӡѧѣʌƴđџʌҁᴙ ѳđџʜ ⱀѧӡ? ϮƀӀ єѱё ϯѳґđѧ ѳϯπⱀѧʙџʌҁᴙ ʙ πџӡđƴ ҁʙѳєӣ ʍѧϯƴχџ ʜѧ πѳџҁκџ ʍѳєґѳ χƴᴙ џ ʙ џϯѳґє ϯƀӀ ʙƀӀʙєʌ єґѳ ʜѧ πѳʙєⱀχʜѳҁϯƀ πџӡđƀӀ ϯʙѳєӣ ʍѧʍѧʜџ џ ӡѧ ϶ϯѳ ᴙ ⱀѧӡⱀєɯџʌ ϯєѣє єґѳ ҵѳʍκʜƴϯƀ',
'[ 먔🪽 ] ꯌ ϯʙѳѥ ʍѧϯƀ єѣѧʌ ґѳʙѳⱀѥ ϯєѣє єѱё ⱀѧӡ πѳʜџʍѧєɯƀ ʍєʜᴙ? ϮƀӀ ѣʌᴙϯƀ ҁєӣӌѧҁ đѳʌѫєʜ ѣƴđєɯƀ πⱀџʙѳʌѳӌџϯƀ ҁʙѳѥ ʍѧϯƴχƴ ʜѧ ʍѳӣ χƴҵ ӌϯѳѣƀӀ ᴙ єѱё ⱀѧӡ єє ʙƀӀѣⱀѧʌ ѳκѳʜӌѧϯєʌƀʜѳ đƴʍѧѥ ʜѧ ҁєґѳđʜᴙ џ ҁⱀѧӡƴ ѫє ʜѧ ʍѳӣ χƴӣ ӡѧπⱀƀӀґʜєɯƀ ϯƀӀ',
'[ 먔🪽 ] ꯌ ϯʙѳѥ ʍѧϯƀ πѳҁϯѳᴙʜʜѳ ґѧ ҁʙѳӣ χƴӣ ʜѧϯᴙґџʙѧѥ πⱀџđєⱀѫџʙѧᴙ đʙƴʍᴙ ⱀƴκѧʍџ ӡѧ єє πѳʌƴѫѳπџᴙ ӌϯѳѣƀӀ đʌᴙ πѳʌʜѳϯƀӀ ѳѱƴѱєʜџӣ ʜѧđѧʙđʌџʙѧϯƀ ʜѧ єє ѫѳπƴ џ ґʌƴѣѫє ʙχѳđџϯƀ ʙ ϶ϯƴ ɯʌѥχƴ, ѧ ϯƀӀ ϯєʍ ʙⱀєʍєʜєʍ ʙҁϯѧʙѧӣ ʜѧ ɯƴχєⱀ πѳκѧ ᴙ ϯʙѳѥ ʍѧϯƀ đѫⱀѥ,',
'[ 먔🪽 ] ꯌ ϯʙѳѥ ʍѧϯƀ κѳґđѧ єѣƴ ϯѳϯ ʍʜє ʙҁє ʙⱀєʍᴙ κѧѫєϯҁᴙ ӌϯѳ κϯѳ-ϯѳ ʍєʜᴙ ӡѧ ӡѧʌƴπƴ ϯⱀѳґѧєϯ ʙʜƴϯⱀџ єє πџӡđƀӀ џ ᴙ đƴʍѧѥ ϯєѣє ҁʌєđƴєϯ πⱀѳʜџκʜƴϯƀ ʙʜƴϯⱀƀ ϯ ƴӡʜѧϯƀ κѧκ ϯѧʍ ѳѣҁϯѧʜѳʙκѧ πⱀѳџҁχѳđџϯ',
'[ 먔🪽 ] ꯌ ʍѧϯƀ ϯʙѳѥ єѣѧʌ πѳʜџʍѧєɯƀ? Џʌџ ϯєѣє πѳχƴӣ ʜѧ ҁʙѳѥ ѣѳʌƀʜƴѥ ʍѧϯƀ? Ҟҁϯѧϯџ ᴙ ӌƴϯƀ ʜє ӡѧⱀѧӡџʌҁᴙ ѳϯ ʜєё Ҁ∏ЏΔѳʍ ʜѳ χѳⱀѳɯѳ ӌϯѳ ʙ ϯѳϯ ʍѳʍєʜϯ ᴙ ʜѧϯᴙʜƴʌ πџӡđƴ ϯʙѳєӣ ѣѧѣƴʌџ ʜѧ ҁʙѳӣ χƴӣ) πⱀѳҁϯѳ ӡѧ ґѳʜđѳʜѧʍџ ʍʜє џđϯџ ѣƀӀʌѳ ʜє ѳӌєʜƀ ѳχѳϯѳ',
'[ 먔🪽 ] Ҁʌʙɯƀ ґƴґʌᴙ єѣѧʜѧᴙ? ꯌ ϯʙѳѥ ʍѧϯƀ єѣѧʌ ѧ πѳϯѳʍ ϯєʌѳӣ ʙƀӀʍџϯѧʌ κƴҁκџ ҁʙѳєӣ ӡѧҁѳχɯєӣ ҁπєⱀʍƀӀ џӡ єє πџӡđƀӀ ƴ κѳϯѳⱀѳӣ πʌѳѱѧđƀ κѧκ κѳⱀѳѣκѧ џӡ-πѳđ ϯєʌєʙџӡѳⱀѧ ʜѳ ʜџӌєґѳ ҁϯⱀѧɯʜѳґѳ κѳґđѧ єє єѣєɯƀ πѳʌѳʙƀӀє ґƴѣƀӀ ѳχʙѧϯƀӀʙѧѥϯ χƴӣ џ ѣѳʌєє ʍєʜєє єҁϯƀ ѳѱƴѱєʜџᴙ',
'[ 먔🪽 ] Ҟѳⱀѳӌє ϯʙѳᴙ ʍѧϯƀ ҁєӣӌѧҁ ҁϯѳџϯ ʜѧ κⱀѧѥ ʍѳєґѳ χƴᴙ џ κƴⱀџϯƀ πѳҁʌє ϯѳґѳ κѧκ ᴙ πⱀєđѧʌ єє ҁƴϯκџ џ ϯєπєⱀƀ ᴙ πⱀџʜᴙʌҁᴙ єѣѧϯƀ ϯєѣᴙ πѳ πѳʌʜѳӣ πⱀѳґⱀѧʍʍє, єѣѧʜƀӀӣ ϯƀӀ ҁƴκѧ ӌєӌєʜ',
'[ 먔🪽 ] ꯌ κѳⱀѳӌє ʍѧϯƀ ϯʙѳѥ єѣƴ ʍᴙҁѳ ϶ϯѳ єѣѧʜѳє πѳʜџʍѧєɯƀ? ϮƀӀ ѣʌᴙϯƀ χѳϯƀ πѳʍѳґџ ʍʜє џ џđџ πѳđєⱀѫџ, ӌϯѳѣƀӀ ѳʜѧ ʜє đєⱀґѧʌѧҁƀ џʜѧӌє ϶ϯѳ πⱀџʙєđёϯ κ đѳπѳʌʜџϯєʌƀʜƀӀʍ ϯⱀѧʙʍѧʍ єє πџӡđƀӀ χѳϯᴙ ѳʜѧ џ ϯѧκ ƴѫє ⱀѧӡʙѧʌџʙѧєϯҁᴙ',
'[ 먔🪽 ] ҀʌƀӀɯƀ ґѳʙʜѥ єѣѧʜƀӀӣ? Ϯʙѳё ґʜџѥѱєє ϯєʌѳ ᴙ ӡѧʙѧʌѥ κѧʍʜᴙʍџ πѳҁʌє ϯѳґѳ κѧκ ʙƀӀєѣƴ ϯєѣᴙ πєϯƴχѧ єѣѧʜѳґѳ ӌϯѳѣƀӀ ϯєѣᴙ ʜџκѳґđѧ ѣѳʌƀɯє ʜє ʜѧɯʌџ, ѧ ҁѧʍ ᴙ ѣƴđƴ єѣѧϯƀ ϯʙѳѥ ʍѧϯƀ πѳκѧ ѳʜѧ ʜѧχƴӣ κѳπƀӀϯѧ ʜє ѳϯѣⱀѳҁџϯ',
'[ 먔🪽 ] ϮƀӀ ѣʌᴙϯƀ πƴđєʌƀ ҁϯⱀџѫєʜʜƀӀӣ ϯƀӀ πѳʜџʍѧєɯƀ ӌϯѳ ᴙ єѣѧʌ ϯʙѳѥ ʍѧϯƀ πⱀᴙʍѳ ʜѧ ґʌѧӡѧχ ʙҁєӣ ϯʙѳєӣ ⱀѳđʜџ џ ѳʜџ ҁʍѳϯⱀєʌџ ʜѧ ϯʙѳѥ ʍѧϯƀ ҁ ӡѧʙџҁϯƀѥ џӡ-ӡѧ ϯѳґѳ ӌϯѳ ᴙ єѣƴ џʍєʜʜѳ єє ѧ ʜє κѳґѳ-ϯѳ џӡ ʜџχ',
'[ 먔🪽 ] ϮƀӀ πѳʜџʍѧєɯƀ ӌϯѳ ʍѳӣ χƴӣ χѳⱀѳɯѳ ӡѧӣđєϯ ʙ πџӡđƴ ϯʙѳєӣ ʍѧϯєⱀџ ϯѳʌƀκѳ єҁʌџ ϯƀӀ ѣƴđєɯƀ đѧʍκⱀѧϯѳʍ ⱀѧӡđʙџґѧϯƀ єє πѳʌѳʙƀӀє ґƴѣƀӀ џ ƀӀ ӌєҁϯƀ ѣʌѧґѳđѧⱀʜѳҁϯџ ᴙ đѧʍ ϯєѣє ҁѳҁʜƴϯƀ ҁʙѳєґѳ χƴᴙ',
'[ 먔🪽 ] ꯌ ϯʙѳѥ ʍѧϯƀ ʙӌєⱀѧ πџӡđџʌ ƴєѣᴙ ʙ πѳđъєӡđє ӡѧ ϯѳ ӌϯѳ ѳʜѧ ʜѧҁҁѧʌѧ ʙ ƴґʌƴ ѧ πѳϯѳʍ ʙƀӀɯєʌ ҁѳҁєđ πѳ ʌєҁϯʜϯʜѳӣ κʌєϯκє џ ӡѧϯƴɯџʌ ѣƀӀӌѳκ ѳѣ єє πџӡđƴ џ ʍƀӀ ҁ ʜџʍ ҁπƴҁϯџʌџ ϶ϯƴ ɯʌѥχƴ ҁ ʌєҁϯʜџҵƀӀ πʜƴʙ πѳđ πџӡđƴ',
'[ 먔🪽 ] ϮƀӀ ѣʌᴙϯƀ ɯєʌƴχѧ єѣѧʜѧᴙ ҁ πџӡđƀӀ ҁʙѳєӣ ʍѧʍѧɯџ κѳϯѳⱀƴѥ ᴙ χƴєʍ ѳϯɯџѣѧʌ κѧκ χʌѳπƴɯκѳӣ џ ϯєπєⱀƀ ϯєѣᴙ ʜƴѫʜѳ ʙƀӀκџʜƴϯƀ ʙ ʍƴҁѳⱀκƴ џӡ-ӡѧ ʜєπⱀџґѳđʜѳҁϯџ ʙ κѧκѳʍ-ʌџѣѳ ʙџđє??',
'[ 먔🪽 ] ꯌ ϯʙѳѥ ʍѧϯƀ χƴєʍ ӡѧҵєπџʌ ӡѧ ɯєѥ џ ʙѳđџʌ ӡѧ ҁѳѣѳӣ κѧκ єѣѧʜƴѥ ҁѳѣѧκƴ κѳϯѳⱀѧᴙ πѳҁʌƴɯʜѳ ʙƀӀπѳʌʜᴙʌѧ ʍѳџ κѳʍѧʜđƀӀ џ đѧѫє ҁѳҁѧʌѧ ʍѳӣ χƴӣ џ ʍѳґʌѧ đѧϯƀ ʙ ѳӌκѳ πѳєѣѧϯƀ єє ʙ ʌѥѣѳʍ ʍєҁϯє',
'[ 먔🪽 ] ϮƀӀ πѳʜџʍѧєɯƀ ӌϯѳ ʍѳӣ χƴӣ ʙ πџӡđє ϯʙѳєӣ ʍѧϯєⱀџ πѳҁϯѳᴙʜʜƀӀӣ κʌџєʜϯ џ єʍƴ ʙƀӀđѧʌџ ϯѧʌѳʜ ʜѧ đѳπѳʌʜџϯєʌƀʜƀӀє ӌѧҁƀӀ єѣʌџ ҁ ϯʙѳєӣ ʍѧϯєⱀƀѥ',
'[ 먔🪽 ] ꯌ ϯʙѳѥ ʍѧϯƀ єѣƴ κѧѫđƀӀӣ đєʜ џ єє πџӡđѧ ƴѫє ѣѳʌєє ʍєʜєє ʜѧӌѧʌѧ πⱀџʙƀӀκѧϯƀ κ ʍѳєʍƴ χƴѥ џ ϯєπєⱀƀ ᴙ ƴѫє ʍѳґƴ єѣѧϯƀ єє ҁ ѣѳʌƀɯєӣ ҁκѳⱀѳҁϯƀѥ πѳ϶ϯѳʍƴ ϯєѣє πⱀџđёϯҁᴙ ʜѧ ʙҁᴙκџӣ ҁʌƴӌѧӣ πѳҁϯѳᴙϯƀ ʜѧ ɯƴχєⱀє',
'[ 먔🪽 ] ϮƀӀ πѳʜџʍѧєɯƀ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ єѣѧʜѧᴙ κѳʌƀӀʍѧґѧ џ ᴙ ҁʙѳӣ χƴӣ ʙʙѳѫƴ ʙ єє πџӡđƴ ʜѧ ϯєʌєґє ӌϯѳѣƀӀ ѳʜѧ ѣєӡ ѳҁϯѧʜѳʙѳκ πѧʌ ҁⱀѧӡƴ ѫє џʍєʜʜѳ ʙ ᴙӣҵєκʌєϯκƴ џ ѳϯʌѳѫџʌ ϯѧʍ ҁʙѳєӣ ҁπєⱀʍƀӀ đʌᴙ ⱀѧӡѳđƀӀɯѧ κѳϯѳⱀƀӀӣ ʙ πѳҁʌєđҁϯʙџџ ҁϯѧʜєϯ ϯѧκџʍ ѫє ʍѳџʍ ʌџӌʜƀӀʍ χƴєҁѳҁѳʍ κѧκ џ ϯƀӀ',
'[ 먔🪽 ] ҀʌƀӀɯƀ єѣѧϯƀ ϯƀӀ πџđѳⱀ đєκѳⱀѧϯџʙʜƀӀӣ, ϯƀӀ πѳʜџʍѧєɯƀ, ӌϯѳ ʍѧϯƀ ϯʙѳᴙ ҁ ʍѳєґѳ χƴᴙ ʙѳѳѣѱє ʜє ƴχѳđџϯ ʜџχƴᴙ џ ʍʜє πⱀџχѳđџϯҁᴙ χƴєʍ ʌƴπџϯƀ єӣ πѳ ґѳʌѳʙє ӌϯѳѣƀӀ ϶ϯѧ ɯѧʙκѧ єѣѧʜѧᴙ ƴɯʌѧ ʜѧχƴӣ џ ʜє ʍєɯѧʌѧҁƀ ґѧ ʍѳёʍ πƴϯџ ѧ ϯѳ џӡ-ӡѧ ʜєё ѳđʜџ ʜєπⱀџᴙϯʜѳҁϯџ ҁѳ ʍʜѳӣ ҁʌƴӌѧʌџҁƀ',
'[ 먔🪽 ] Ҟѳⱀѳӌє ᴙ єѣѧʌ ϯʙѳѥ ʍѧϯƀ ʙѳ ʙⱀєʍᴙ єє ʍєҁᴙӌʜƀӀχ џ κⱀѳʙƀ χʌƀӀҁϯѧʌѧ џӡ єє πџӡđƀӀ ѣƴđϯѳ ᴙ χƴєʍ ʙєʜƴ ʙҁκⱀƀӀʌ єӣ џ ӌϯѳѣƀӀ ѳҁϯѧʜѳʙџϯƀ κⱀѳʙѳϯєӌєʜџє ʍʜє πⱀџɯʌѳҁƀ ӡѧѣџϯƀ ʙ єє πџӡđƴ ѣѳʌƀɯƴѥ đƴѣʌѥ πⱀѳѣκƴ',
'[ 먔🪽 ] Ҁʌʙɯƀ ʜѧχƴӣ єѣѧʌđƴӣ ϯƀӀ єѣѧʜƀӀӣ πѳɯёʌ ʜѧχƴӣ ѳϯҁѥđѧ πѳκѧ ҁʙѳџʍ χƴєʍ ʜє πⱀѳѣџʌ ѧʜѧʌƀʜƀӀє ӡѧґⱀѧѫđєʜџᴙ ϯʙѳєӣ ʍѧʍѧɯџ џ ʜє πⱀѳχƴᴙⱀџʌ πⱀѳѣѳџʜƴ ʙ єє ʍѧϯκє ӌϯѳѣƀӀ ѣʌᴙϯƀ џӡѣєѫѧϯƀ ⱀѳѫđєʜџᴙ ϯѧκџχ єѣѧʜƀӀχ πџđѳⱀѧҁѳʙ ʙⱀѳđє ϯєѣᴙ єѣʙѧʜѳґѳ χƴєґʌѳϯѧ ѣʌᴙϯƀ џđџ ʜѧχƴӣ ѳϯҁѥđѧ ʙ ʜѧϯƴⱀє ⱀѧӡʙѧʌѣѥ ϯєѣᴙ κѧκ πєҁѳӌʜƴѥ ѻџґƴⱀƴ ҁƴκѧ',
'[ 먔🪽 ] ꯌ ϯʙѳѥ ʍѧϯƀ єѣѧʌ ʙ ґʌѳϯκƴ єє єѣѧʜƴѥ џ ҁʌƴӌѧӣʜѳ πⱀѳѣџʌ ҁʙѳџʍ χƴєʍ єє ѱєκƴ єѣʌџʙƴѥ ҁƴκѧ πџđѳⱀѧҁѧ ϯƀӀ κƴҁѳκ ʜѧχƴӣ, ᴙ ѫє ѣʌᴙϯƀ ʙ ʜѧϯƴⱀє ϯєѣє ѣѧӡѧⱀƀӀ ӌϯѳ ʍѧϯƀ ϯʙѳᴙ ѻπʜѧϯєє ѳϯ ʍѳєґѳ χƴᴙ џ ѳʜѧ ѣƴđєϯ ҁѳҁѧϯƀ єґѳ ʙҁєґđѧ',
'[ 먔🪽 ] Ϯʙѳӣ đєđ ѣƀӀʌ ѧʜѧʌƀʜƀӀʍ ґєⱀѳєʍ ҁѳʙєϯҁκѳґѳ ҁѳѥӡѧ џѣѳ ѳʜѧ ҁʙѳєӣ đѳʍѳӣ ⱀѳđџʜƴ ӡѧѱџѱѧʌ ʜѧ đʙѧ ѻⱀѳʜϯѧ џ ʙ ӌєҁϯƀ πѳѣєđƀӀ єʍƴ ʙⱀƴӌџʌџ κѳπџѥ ʍѳєґѳ χƴᴙ ѳƀʍѳϯѧʜʜƴѥ ґєѳⱀґџєʙҁκѳӣ ʌєʜϯѳӌκѳӣ',
