"[ 𑱡🩸 ]  ᴋᴏᴦᴅᴀ ᴛʙᴏʏᴀ ʍᴀᴛь ᴄᴨᴜᴄᴛɪᴧᴀᴄь ɴᴀ ɜᴇʍᴧʏᴜ ᴜ ɴᴇᴇ ʙʏᴧᴀ ɜᴀᴅᴀɴɪʏᴀ ᴄᴨᴀᴄᴛɪ ʍɪᴩ ɴᴏ ʍᴇᴄᴛᴏ ϶ᴛᴏᴦᴏ ᴏɴᴀ ɴᴀᴄʜᴀᴧᴀ ᴄᴏᴄᴀᴛь ʜᴜɪ ɴᴀᴨᴩᴀʙᴏ ɪ ɴᴀᴧᴇʙᴏ ɴᴏ ᴄᴜᴛь ʙ ᴛᴏʍ ᴄʜᴛᴏ ᴏɴᴀ ɪ ᴛᴀᴋ ᴄᴨᴀᴄᴀᴇᴛ ʍɪᴩ ᴛᴇʍ ᴄᴀʍʏʍ ᴜᴅʙᴏᴧᴇᴛʙᴏᴩʏᴀᴇᴛ ʙᴄᴇʜ ʍᴜᴢʜᴄʜɪɴ ɴᴀ ᴄʙᴇᴛɪ ᴄᴨᴀᴄɪʙᴏ ᴛʙᴏᴇᴊ ʍᴀʍᴇ ɯᴧʏᴜʜɪ[ 𑱡🩸 ] ",
"[ 𑱡🩸 ]  ᴛʙᴏʏᴀ ʍᴀʍᴀ ᴜᴢʜᴇ ᴅᴀʙɴᴏ ᴨᴩɪʜᴏᴅɪᴛ ᴨᴏᴄᴏᴄᴀᴛь ɴᴀʍ ʜᴜᴊ ɴᴏ ᴄ ᴋᴀᴅᴢʜᴅʏʍ ᴩᴀɜᴏʍ ᴏɴᴀ ʙᴄᴇ ʙᴏᴧьɯᴇ ɪ ʙᴏᴧьɯᴇ ɴᴀɪɴᴀᴇᴛ ᴢʜᴩᴀᴛь ɴᴀɯᴜ ᴄᴨᴇᴩʍᴜ ɴᴏ ᴋ ᴛᴀᴋᴏʍᴜ ɴᴀᴄ ᴢʜɪɜɴь ɴᴇ ᴦᴏᴛᴏʙɪᴧᴀ ɪ ɜᴀ ʙᴄᴇ ᴇᴇ ᴅᴇᴊᴄᴛʙɪʏᴀ ʍʏ ᴩᴇɯɪᴧɪ ᴇᴊ ᴇʙᴀɴᴜᴛь ᴨᴏ ᴧᴇsᴄʜᴜ[ 𑱡🩸 ] ",
"[ 𑱡🩸 ]  ɴᴜ ᴢʜᴇ ᴨᴏᴨᴩᴏʙᴜᴊ ᴏᴨᴩᴏʙᴅᴀᴛь ᴄʙᴏʏᴜ ʍᴀᴛь ᴨᴏᴋᴀ ᴇᴇ ᴩᴏᴛ ɴᴇ ɜᴀᴨᴏᴧɴᴇɴ ɴᴀɯᴇᴊ ᴋᴏɴᴄʜᴇᴊ ɪᴧɪ ʍᴏᴢʜᴇɯь ʙᴄᴛᴀᴛь ɴᴀ ᴋᴏᴧᴇɴɪ ɜᴀ ʍᴇᴄᴛᴏ ᴄʙᴏᴇᴊ ʍᴀᴛᴇᴩɪ ɪ ᴨᴏᴧᴜᴄʜᴀᴛь ʙ ᴩᴏᴛ ᴅᴏʜᴜ ᴋᴏᴛᴏᴩᴀʏᴀ ᴇᴊ ᴛᴀᴋ ɴᴇᴏʙʜᴏᴅɪʍᴀ ʙᴇᴅь ᴏɴᴀ ɴᴜᴢʜᴅᴀᴇᴛьᴄʏᴀ ʙ ɴᴀɯᴇᴊ ᴄᴨᴇᴩʍᴇ ᴋᴀᴋ ʙ ɴᴀᴩᴋᴏᴛɪᴋᴇ[ 𑱡🩸 ] ",
"[ 𑱡🩸 ] ʙɴᴀᴛᴜᴩᴇ ᴛʙᴏʏᴜ ʍᴀᴛь ɴᴀ ʜᴜᴇ ᴨᴩᴏᴋᴀᴛɪᴧᴏ ᴏɴᴀ ʍᴏᴋᴧᴀ ᴨᴏᴅ ᴅᴏᴢʜᴅᴇʍ ᴢʜᴅᴀʙ ᴄʙᴏᴊ ᴀʙᴛᴏʙᴜᴄ ɴᴏ ʙᴄᴇ ᴛᴀᴋɪ ʏᴀ ɴᴇ ᴅᴀᴧ ᴇᴊ ʙᴏɜʍᴏᴢʜɴᴏᴄᴛь ᴨᴩᴏʍᴏᴋɴᴜᴛь ɪ ᴩᴇɯɪᴧ ᴨᴩᴇᴅᴏᴄᴛᴀʙɪᴛь ᴇᴊ ᴄʙᴏᴊ ʜᴜᴊ[ 𑱡🩸 ] ",
