"[ 𑱡🩸 ] ᴅᴀᴠᴀᴊ sᴛʀɪᴘᴛɪᴢ sᴠᴏɪᴍ ʏᴀᴢʏᴄʜᴋᴏᴍ ᴛᴀɴᴛsᴜᴊ ɴᴀ ʜᴜᴇ ᴍᴏёᴍ[ 𑱡🩸 ] ",
