"[ 𑱡🩸 ] ᴋᴜsᴏᴋ ɴᴇᴏᴅᴜsʜᴇᴠʟᴇɴɴᴏɢᴏ ᴋᴜsᴋᴀ sᴀʟᴀ ᴋᴜᴅᴀ ᴛᴇʙᴇ ᴅᴏ ᴍᴇɴʏᴀ?[ 𑱡🩸 ] ",
