"[ 𑱡🩸 ] ᴛᴠᴏʏᴀ ᴍᴀᴛь ʙʀᴏsɪʟᴀ ᴋᴜʀɪᴛь ʙʟᴀɢᴏᴅᴀʀʏᴀ ᴍɴᴇ ᴠ ᴍᴇsᴛᴏ ᴋᴜʀᴇᴠᴀ sᴏsᴇᴛ ᴍɴᴇ ᴄʜʟᴇɴ[ 𑱡🩸 ] ",
"[ 𑱡🩸 ] ɴᴇ sᴏᴊᴅɪ s ᴜᴍᴀ ᴏᴛ ɴᴀᴘᴏʀᴀ ᴄʜʟᴇɴᴏᴠ ɴɪᴄʜᴛᴏᴢʜᴇsᴛᴠᴏ ᴇʙᴀɴᴏᴇ[ 𑱡🩸 ] ",
"[ 𑱡🩸 ] ᴀʜᴀʜ ᴄᴜᴋᴀ ʏᴀ ᴛᴇʙʏᴀ ᴨ᧐ᴩʙᴜ ɪɴʙᴀᴧɪᴅᴀ ᴇʙᴀɴ᧐ᴦ᧐ ᴛᴇᴩᴨɪ ʍᴇɴʏᴀ [ 𑱡🩸 ]  ",
"[ 𑱡🩸 ] ʏᴀ ᴛʙ᧐ᴇ ᴨɪᴢᴅᴀᴧɪsᴄʜᴇ ᴢᴅᴇᴄь ᴩʙᴀᴛь ʙᴜᴅᴜ ᴄʏɴ ᴇʙᴀɴ᧐ᴊ ᴋᴧᴜɯɪ [ 𑱡🩸 ]  ",
"[ 𑱡🩸 ] ᴩᴀᴢ᧐ᴩʙᴇʍ ᴛᴇʙᴇ ᴛᴜᴛ ᴀɴᴜᴄ ᴛᴜᴨ᧐ᴊ ᴄʏɴ ᴄɪɸ᧐ᴢɴ᧐ᴊ ɯᴀᴧᴀʙʏ [ 𑱡🩸 ]  ",
"[ 𑱡🩸 ] ʏᴀ ᴛʙ᧐ʏᴜ ʍᴀᴛь ᴋᴀᴋ ᴨᴀᴜᴋ ʙ ᴀɴᴜᴄ ᴇʙᴀᴧ ᧐ɴᴀ ᴅ᧐ʙ᧐ᴧьɴᴀ sᴄʜᴀᴄ [ 𑱡🩸 ]  ",
"[ 𑱡🩸 ] ʙ᧐ʍᴢʜᴀᴩᴀ ᴛᴜᴛ ɴᴀ ᴋ᧐ᴨᴇᴊᴋɪ ᴨ᧐ᴄᴧᴇ ᧐ᴛᴄ᧐ᴄᴀ ʙʏᴢʜɪᴛь ɴᴇ ᴄʍ᧐ᴢʜᴇɯь ᴀʜᴀʜ [ 𑱡🩸 ]  ",
"[ 𑱡🩸 ] ᴄᴧ᧐ʍᴀʏᴜ ᴛᴇʙᴇ ᴇʙᴀᴧьɴɪᴋ ᴄʙ᧐ɪʍ ʜᴜᴇʍ ɪ ɴᴇ ʙ᧐ᴢᴩᴀᴢʜᴀᴊ [ 𑱡🩸 ]  ",
"[ 𑱡🩸 ] ʙʏᴩʙᴜ ʙᴄᴇ ᴛʙ᧐ɪ ᴋ᧐ᴄᴛɪ ɪᴢ ᴛʙ᧐ᴇᴦ᧐ ɪ ᴛᴀᴋ ʜɪᴧ᧐ᴦ᧐ ᴛᴇᴧьᴛsᴀ ᴅᴀᴧʙᴀᴇʙ [ 𑱡🩸 ]  ",
"[ 𑱡🩸 ] ʏᴀ ᴛᴇʙᴇ ᴅᴀᴧʙᴀᴇʙᴜ ᴄᴋᴀᴢᴀᴧ ᴄ᧐ᴄᴀᴛь ʍɴᴇ ɪ ᴄʜᴇ ᴛʏ ᴅᴇᴧᴀᴇɯь ᴋᴀᴧᴇᴋᴀ [ 𑱡🩸 ]  ",
"[ 𑱡🩸 ] ʏᴀ ᴅᴧʏᴀ ᴛʙ᧐ᴇᴊ ᴇʙᴀɴ᧐ᴊ ʍᴀᴩᴛʏɯьᴇᴊ ᴄᴇʍьɪ ᴨ᧐ʙᴇᴧɪᴛᴇᴧь ɴᴀʜᴜᴊ [ 𑱡🩸 ]  ",
